var book = {
	"name": "ယီဟၫ့",
	"numChapters": 21,
	"chapters": {
		"1": {
			"1": "<sup>1</sup> လၧအၥၫ့လၧအခၪ့ထံၭနီၪဆၧအလူအီၪဝ့ၫလီၫ. ဆၧအလူနီၪအီၪဝ့ၫလၧယွၩအၥိၭတၭ, ဆၧအလူနီၪမွဲ",
			"2": "<sup>2</sup> ယွၩလီၫ.- အဝ့ၫဒၪအီၪဝ့ၫလၧယွၩအၥိၭ လၧအၥၫ့",
			"3": "<sup>3</sup> လၧအခၪ့ထံၭလီၫ.- ကယဲဆၧအီၪထီးအလူၬ အဆံၫ့ ယီၩ, ကဲၪထၪ့လၧအစူၪဖၧၩ့တၭ,ဆၧလၧအဘၪဆၧ မၩကဲၪထၪ့ယူၭနီၪ လကဲၪထၪ့ဘၪဝ့ၫ လၧအဝ့ၫဒၪအ",
			"4": "<sup>4</sup> စူၪဖၧၩ့အီၪနးမံၩ့အ့ၬ.- ဆၧမၧၫ့အီၪဝ့ၫလၧအဖၧၩ့နီၪ,",
			"5": "<sup>5</sup> ဒဲဆၧမၧၫ့နီၪမွဲၦၡၩအဆၧဖၩ့လီၫ.- ဆၧအဖၩ့နီၪဖၩ့ ထၪ့လၧဆၧခံၭကျၩတၭ, ဆၧခံၭနီၪထိးဆၧၫ့ဝ့ၫဒၪ အ့ၬ.",
			"6": "<sup>6</sup> ၦၡၩလၧယွၩအၪ့မၧၫ့လၩ့ဝ့ၫနီၪအီၪလဂၩတၭ,",
			"7": "<sup>7</sup> အမံၩ့မွဲစယီဟၫ့လီၫ.- အဝ့ၫလဂၩနီၪ ဂဲၫဝ့ၫလၧဆၧ မိထိးအၥၭအဂး, ဘဲၫၥိၭအမိထိးအၥၭလၧဆၧဖၩ့အ ဂဲးအကၠီၪ့နီၪ, ဘဲၫၥိၭၦၡၩကိၭဂၩဒ့ၭ မိနဲၩလၧအကၠီၩ့",
			"8": "<sup>8</sup> လီၫ.- အဝ့ၫဒၪမွဲဆၧအဖၩ့နီၪအ့ၬ. ဂဲၫဝ့ၫဘဲၫၥိၭအ",
			"9": "<sup>9</sup> မိထိးအၥၭလၧဆၧဖၩ့အဂဲးအကၠီၪ့နီၪလီၫ.- ဆၧအဖၩ့ လၩ့ထံးလၩ့ဆ့ၭနီၪမွဲဆၧလၧအဒုၭဖၩ့ထၪ့ကယဲ ၦၡၩလၧအဂဲၫနုၬထၪ့ လၧဂၪ့ခိၪချိၫ့ယီၩ ကိၭဂၩဒ့ၭ",
			"10": "<sup>10</sup> လီၫ.- အဝ့ၫနီၪအီၪဝ့ၫလၧဂၪ့ခိၪချိၫ့ယီၩတၭ, ဂၪ့ခိၪယီၩ ကဲၪထၪ့လၧအစူၪဖၧၩ့ လါနၫ့ဘိၩ, ဂၪ့ခိၪယီၩၥ့ၪ",
			"11": "<sup>11</sup> ယၫအဝ့ၫဒၪအ့ၬ.- အဝ့ၫဒၪနီၪဂဲၫလၩ့ လၧအလးဒၪ",
			"12": "<sup>12</sup> ဝ့ၫတၭ, အခ့ၫအၡၩဒၪဝ့ၫထိးဆၧၫ့ဝ့ၫအ့ၬ.- ထီးဒၪ ၦလၧအထိးဆၧၫ့ဝ့ၫ, ဒဲနဲၩထဲၩ့အမံၩ့လဖၪနီၪမွဲ",
			"13": "<sup>13</sup> အဒုၭကဲၪထၪ့အဝ့ၫၥံၪ လၧယွၩအဖိၪလီၫ.- အဝ့ၫၥံၪ အီၪဖျဲၪဝ့ၫလၧဆၧၥွံၪအ့ၬ, လၧဆၧယၪအၥၭအ့ၬ, လၧၦၡၩအၥၭအ့ၬ, အ့ၪမွဲလၧယွၩလီၫ.",
			"14": "<sup>14</sup> ဆၧအလူနီၪကဲၪထၪ့လၧဆၧယၪတၭ, အီၪလၧ ပကျၩယီၩ, ပဒၪဘၪအလၩအဖၩ့, ဘဲၫဖါအဖိၪခွၫ လဂၩဎးအလၩအဖၩ့အၥိၭ, လၧၫ့ဎွ့ၩဝ့ၫလၧဆၧ အခိးအတၩဒဲဆၧမွဲဆၧတီၩလီၫ.",
			"15": "<sup>15</sup> စယီဟၫ့ထိးအၥၭလၧအဂဲးအကၠီၪ့နီၪ, ကိၭၡၭ ထၪ့ဆၧစံၭဝ့ၫဒၪ,ၦလဂၩယီၩမွဲၦလၧအစံၭယူၭ, ၦမိ ဂဲၫလၧယလးခဲၫ့လဂၩနီၪဒိၪနဲၪ့ယၧၩ, အဂဲးဘဲၫယီၩ",
			"16": "<sup>16</sup> မွဲအအီၪဆိၫနဲၪ့ယၧၩလီၫ.- တၭပဝ့ၫဒၪထီးအလူၬယီၩ ပန့ဘၪယူၭအဝ့ၫဒၪ အဆၧလၧၫ့အဆၧဎွ့ၩလနၩ့ ယူၭ,ဒဲအခိးအတၩ လၧအခိးအတၩအဖၫ့ခိၪယူၭ.",
			"17": "<sup>17</sup> အဂဲးဘဲၫယီၩဆၧဖ့ၪလၫ့ဆၧမၪလူၬၥံၪ လၧစမိစ့ၭအ စူၪဖၧၩ့နီၪ, အ့ၪမွဲဆၧ အခိးအတၩဒဲဆၧတီၩဆၧ",
			"18": "<sup>18</sup> လီၩ့ၥံၪ,အီၪထၪ့လၧယ့ၫၡုၬဎရံၬအကၠီၩ့နီၪလီၫ.- ၦလ ဒၪဘၪယွၩအခိးအတၩနးဆိၭနးဂၩတၭ, အဖိၪခွၫ လဂၩဎးအီၪလၧဖါအၥၭနၫၡါအလီၩ့နီၪ, ဒုၭနဲၪ ဖျီၪထၪ့ယူၭအဝ့ၫယူၭ.",
			"19": "<sup>19</sup> ၦယုဒၫဖိၪၥံၪလၧအအီၪလၧ ဒိၩ့ယရုစလံၫ့အဖၧၩ့ နီၪအၪ့မၧၫ့လၩ့ ၦလုဆၧၥံၪဒဲၦလံဝဲၫဖိၪၥံၪ လ့ၩထီၩ့ လၧစယီဟၫ့အအီၪနီၪ, ဘဲၫၥိၭအမိအၪ့စၪ့အဝ့ၫ,နဝ့ၫ ဒၪယီၩနမွဲပလၫလဂၩလဲၪနီၪ, စယီဟၫ့အဆၧထိးအ",
			"20": "<sup>20</sup> ၥၭနီၪမွဲအယီၩ,- ထိးအၥၭ တၭလမီၪ့ဘံၭဘၪဝ့ၫ",
			"21": "<sup>21</sup> နီၪ,ထိးအၥၭလၧယဝ့ၫဒၪယီၩ ယမွဲဎရံၬအ့ၬ.- အဝ့ၫ ၥံၪအၪ့စၪ့ဒီၭဝ့ၫ,အ့ၪမွဲဘဲၫနီၪတၭ, နမွဲပလၫလဂၩလဲၪ နမွဲစအံၫလဲယၫဧၪ. အဝ့ၫနီၪစံၭဆၧၫ့ဝ့ၫမွဲအ့ၬ, နမွဲမီၪ",
			"22": "<sup>22</sup> လဂၩနီၪဆ့ဧၪ. အဝ့ၫဒၪစံၭဆၧၫ့ဝ့ၫမွဲအ့ၬ.- မၩအၥၭ ဘဲၫနီၪတၭ, နမွဲပလၫလဂၩလဲၪ, ၦၡၩလၧအအၪ့မၧၫ့ လၩ့န့ပၧၩနီၪ,ဘဲၫပထဲၩ့လီၩဘၪအဝ့ၫၥံၪ မိၥ့ၪအၥိၭ",
			"23": "<sup>23</sup> တၭ,မွဲနစံၭလၩ့နၥၭဘဲၫၥ့ၪလဲၪ.- အဝ့ၫနီၪစံၭဝ့ၫ, ယဝ့ၫဒၪယီၩယမွဲၦလၧ အလူၥီၫထၪ့လၧမံၩ့လၬကျၩ, မၩလီၩ့ကဆါအဖၧၩ့ၥၭနီၪဆံၭ. ဘဲၫမီၪစအဲၫစ့ယၫ စံၭဝ့ၫအၥိၭနီၪလီၫ.",
			"24": "<sup>24</sup> တၭၦလၧဆၧအၪ့မၧၫ့လၩ့ဝ့ၫလဖၪနီၪ, ဘၪဆဲၫ့လၧ",
			"25": "<sup>25</sup> ၦဖၫရစံၫၥံၪလီၫ.- အဝ့ၫၥံၪအၪ့စၪ့ဝ့ၫတၭ, စံၭအဝ့ၫဒၪ, မၩအၥၭဘဲၫနီၪတၭ, နဝ့ၫဒၪယီၩ, နအ့ၪလမွဲဘၪဎရံၬ, နအ့ၪလမွဲဘၪစအံၫလဲယၫ, နအ့ၪလမွဲဘၪမီၪလဂၩနီၪ",
			"26": "<sup>26</sup> တၭ,မွဲဘၪနီၫလၧနဘၭတံၫဇၫ့ဆၧလဲၪ.- စယီဟၫ့ချဲၩ့ ဆၧၫ့ဝ့ၫတၭ, စံၭဝ့ၫဒၪ, ယဝ့ၫဒၪယီၩ, ယဘၭတံၫဇၫ့ ဆၧလၧထံၫကျၩလီၫ. အ့ၪမွဲၦလၧနၥံၪအကျၩ လၧန",
			"27": "<sup>27</sup> ၥံၪလၥ့ၪယၫဘၪဝ့ၫနီၪအီၪဝ့ၫလဂၩတၭ,- အဝ့ၫနီၪဂဲၫ လၧယလးခဲၫ့တၭ, န့ၫယမိကွဲၪလၩ့ အခၪ့ဖံၭဖျံၩနီၪ,",
			"28": "<sup>28</sup> ယကြၨၭအ့ၬ.- ဆၧယီၩလဖၪ မၩအၥၭလၧစယီဟၫ့ ဘၭတံၫဇၫ့ဆၧလၧထံၫယီၫဒၫ့ဝါလခီၫ လၧဘ့ၭၥနံၫ အဖၧၩ့နီၪလီၫ.",
			"29": "<sup>29</sup> ကဲဂီၩခိၬလနံၩအဝ့ၫနီၪဒၪဘၪယ့ၫၡုၬ ဂဲၫလၧအအီၪ တၭ, စံၭဝ့ၫဒၪ, ယွၩအၥိၪဖိၪလၧအဆိၬန့ခွံၬၦဂၪ့",
			"30": "<sup>30</sup> ခိၪဖိၪအဆၧဒဲၩဘၭနီၪ, ယိခွါဆံၭ.- အဝ့ၫဒၪယီၩ မွဲၦလၧယစံၭဆၧလၧအဂဲး, ၦမိဂဲၫလၧယလးခဲၫ့လ ဂၩနီၪ,ဒိၪနဲၪ့ယၧၩ, အဂဲးဘဲၫယီၩ မွဲအအီၪဆိၫနဲၪ့",
			"31": "<sup>31</sup> ယၧၩလီၫ.- ယဝ့ၫဒၪယီၩယၥ့ၪယၫအဝ့ၫနီၪအ့ၬ. ဘဲၫ ၥိၭအမိအီၪဖျီၪထၪ့ လၧအံၫစရ့လၭအမ့ၬယၫ အဂဲး တၭ,ယဂဲၫဘၭတံၫဇၫ့ဆၧလၧထံၫကျၩလီၫ.",
			"32": "<sup>32</sup> စယီဟၫ့ထိးအၥၭတၭ, စံၭဝ့ၫဒၪ,ယဒၪဘၪၥၭမုနီၪ ဂဲၫလၩ့လၧမူၭခိၪလၩ့ဂၬလၧထိၪလွံတၭ,အီၪဝ့ၫလၧ",
			"33": "<sup>33</sup> အလီၩ့လီၫ.- တၭအဝ့ၫဒၪနီၪယၥ့ၪယၫအ့ၬ. အ့ၪမွဲၦ လၧအအၪ့မၧၫ့ယဂဲၫဘၭတံၫဇၫ့ဆၧလၧထံၫကျၩ လ ဂၩ,အဝ့ၫနီၪစံၭယၧၩ, ၦလၧနဒၪဘၪၥၭမုဂဲၫလၩ့အီၪ ဝ့ၫလၧအလီၩ့တၭး အဝ့ၫနီၪလဂၩမိဘၭတံၫဇၫ့ဆၧ",
			"34": "<sup>34</sup> လၧၥၭမုဆံၫ့ဎံၪအဖၧၩ့လီၫ.- ယဒၪဘၪယူၭတၭ, ယထိးယူၭယၥၭယူၭ, လၧအဝ့ၫနီၪ မွဲယွၩအဖိၪခွၫ လီၫ.",
			"35": "<sup>35</sup> ကဲဂီၩခိၬလနံၩ စယီဟၫ့ဆၧၫ့ထုၪ့ဒီၭဝ့ၫလၧအဖျဲနံၫ",
			"36": "<sup>36</sup> ဂၩအၥိၭတၭ,- ယိယ့ၫၡုၬလ့ၩဆၧတၭ,စံၭဝ့ၫ, ယိခွါ,",
			"37": "<sup>37</sup> ယွၩအၥိၪဖိၪဘီၪ.- အဖျဲနံၫဂၩနါဂၧၫ့ဆၧချဲၩ့နီၪတၭ,",
			"38": "<sup>38</sup> ဖိၬထၪ့ယ့ၫၡုၬအခဲၫ့လီၫ.- ယ့ၫၡုၬကၠၪထဲၩ့အၥၭတၭ, ဒၪဘၪၦလၧအဖိၬအခဲၫ့နီၪ, စံၭအဝ့ၫၥံၪ, မွဲနၥံၪဂဲၫအၪ့ ဎၬနီၪလဲၪး တၭအဝ့ၫၥံၪစံၭဆၧၫ့ဝ့ၫ, ရၭဘံၫဧ့, ဘဲၫၦ",
			"39": "<sup>39</sup> စံၭဆၧအၥိၭ, (ဆရၫ) နအီၪနဝ့ၫခီၫခီၫလဲၪ.- တၭအ ဝ့ၫဒၪစံၭဆၧၫ့ဝ့ၫ, ဂဲၫယိခွါနၥံၪဝ့ၫဘီၪ. အဝ့ၫၥံၪလ့ၩ ယိလၧအအီၪဝ့ၫအလးနီၪ, မွဲလၧဆံၫနၩရံၩဘူၭထၪ့ တၭ,အီၪဝ့ၫလၧအၥိၭလနံၩနီၪလီၫ.",
			"40": "<sup>40</sup> ၦလၧအနါဂၧၫ့ ဆၧလၧစယီဟၫ့နီၪတၭ, ဖိၬထၪ့ ယ့ၫၡုၬအခဲၫ့နံၫဂၩနီၪ, အလဂၩနီၪမွဲစအၫ့ဒူၫထၧၫ့ဖုဝဲ",
			"41": "<sup>41</sup> လၧစစဲမၧၫ့ပံတၧၫတၭ,- အဝ့ၫနီၪအၪ့ဎၬဒၪန့ဆိၫအ ထၧၫ့ဖုဝဲစစဲမၧၫ့တၭ, စံၭအဝ့ၫ, ပဒၪန့ယူၭ မစဲအၫ",
			"42": "<sup>42</sup> ယူၭ, ဘဲၫၦစံၭဆၧအၥိၭ, (ဎရံၬ) နီၪလီၫ.- တၭလ့ၩ ၥိၫ့စိၩအဝ့ၫလၧယ့ၫၡုၬအအီၪလီၫ. ယ့ၫၡုၬယိအဝ့ၫ နီၪတၭ,စံၭဝ့ၫ, နဝ့ၫဒၪယီၩနမွဲစယိနၫအဖိၪခွၫစစဲမၧၫ့ တၭ,ဆၧမိကိၭထဲၩ့နၧၩ့ လၧစစံဖၭ, ဘဲၫပစံၭဆၧအၥိၭ (လိး) လီၫ.",
			"43": "<sup>43</sup> ကဲဂီၩခိၬလနံၩနီၪ ယ့ၫၡုၬမိလ့ၩဘၪအၥၭလၧဂၫလ လံၫအဖၧၩ့တၭ, ဒၪန့စဖံလံၭတၭ, စံၭအဝ့ၫဒၪဂဲၫဖိၬယ",
			"44": "<sup>44</sup> ခဲၫ့ဆံၭ.- စဖံလံၭနီၪဂဲၫစဲၪ့ထၪ့ခွံၬဝ့ၫလၧစအၫ့ဒြူၫ ဒဲ",
			"45": "<sup>45</sup> စပံတၧၫအဒိၩ့ဘ့ၭၥစ့ဒၫနီၪလီၫ.- စဖံလံၭနီၪဒၪန့လၧ စနၥၫ့နအ့လၭတၭ, စံၭအဝ့ၫ,ပဒၪဘၪယူၭၦလၧစမိ စ့ၭလၧလံၬဆၧမၪလူၬအဖၧၩ့, ဒဲမီၪၥံၪကွ့ၭဝ့ၫလၧ အ ဂဲး,ၦနၭဇရ့ၭဖိၪ စယိၥၭအဖိၪခွၫ ယ့ၫၡုၬလဂၩနီၪ",
			"46": "<sup>46</sup> ယူၭ.- စနၥၫ့နအ့လၭစံၭအဝ့ၫ, ဆၧဂ့ၩဆၧဘွၩလမံၩ့ မံၩ့ဂဲၫထၪ့လၧနၭဇရ့ၭအဖၧၩ့နီၪဘၪမိၥ့ၪဧၪ. တၭ",
			"47": "<sup>47</sup> စဖံလံၭစံၭအဝ့ၫ, ဂဲၫယိခွါဘီၪ.- ယ့ၫၡုၬဒၪဘၪစနၥၫ့ နအ့လၭဂဲၫလၧအအီၪတၭ, လီၩဘၪဝ့ၫလၧအဂဲး, ယိ ခွါ,ၦအံၫစရ့လၭဖိၪ လၩ့ထံးလၩ့ဆ့ၭလၧ ဆၧအၪ့ လံၬအၪ့လီၫလအီၪဘၪ လၧအဖၧၩ့လဂၩနီၪဆံၭ.",
			"48": "<sup>48</sup> စနၥၫ့နအ့လၭစံၭအဝ့ၫ, နဝ့ၫဒၪနၥ့ၪယၫယၧၩယီၩ ဘဲၫၥ့ၪလဲၪ. ယ့ၫၡုၬချဲၩ့ဆၧၫ့ဆၧတၭလီၩဘၪအဝ့ၫ, လၧစဖံလံၭလချႃၭကိၭဒံၭဘၪနၧၩတၭ, လၧနအီၪလၧ",
			"49": "<sup>49</sup> ချိၪ့ဒိၩ့အခၪ့ထံၭနီၪယဒၪဘၪယူၭနၧၩလီၫ.- စနၥၫ့ နအ့လၭချဲၩ့ဆၧၫ့အဝ့ၫတၭ, စံၭဝ့ၫ,ရၭဘံၫဧ့, နဝ့ၫဒၪ ယီၩနမွဲယွၩအဖိၪခွၫနီၪ, နမွဲအံၫစရ့လၭအစဎွၩ",
			"50": "<sup>50</sup> လီၫ.- ယ့ၫၡုၬချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭအဝ့ၫ, ယလီၩ ဘၪနၧၩလၧယဒၪဘၪ နၧၩလၧချိၪ့ဒိၩ့အခၪ့ထံၭအကၠီၩ့ တၭ,မွဲနနဲၩဆ့ဧၪ, နမိဒၪဘၪဆၧဒိၪနဲၪ့ အယီၩဒံၭလီၫ.",
			"51": "<sup>51</sup> တၭစံၭအဝ့ၫ, ယလီၩဘၪနၧၩတီၩတီၩလီၩ့လီၩ့ယီၩ, လၧခဲၫ့ထဲၩ့နီၪ, နၥံၪမိဒၪဘၪမူၭခိၪဝဲထၪ့အၥၭတၭ, ယွၩအၥီၫ့လဖၪဂဲၫလၩ့ထဲၩ့ထၪ့ဝ့ၫလၧ ၦၡၩအဖိၪ ခွၫအလီၩ့လီၫ."
		},
		"2": {
			"1": "<sup>1</sup> လၧၥၧၫ့နံၩလနံၩနီၪ တလၭမူၭအမူၭအီၪဝ့ၫလၧကၫ နၫဘၪဆဲၫ့လၧဂၫလလံၫနီၪအဖၧၩ့တၭ, ယ့ၫၡုၬအမိ",
			"2": "<sup>2</sup> အီၪဝ့ၫထီးနီၪဆ့လီၫ.- တၭယ့ၫၡုၬဒဲအထံၩအဖျဲလဖၪ",
			"3": "<sup>3</sup> နီၪ, ၦကိၭဝ့ၫလၧမူၭဖၧၩ့နီၪလီၫ.- ထီးစဘံၭထံၫလၩ့ ၡၩတၭ,ယ့ၫၡုၬအမိစံၭအဝ့ၫ, စဘံၭထံၫအီၪလၧၩ့",
			"4": "<sup>4</sup> အ့ၬ.- ယ့ၫၡုၬစံၭအဝ့ၫ, ၦမုၪဧ့, ဆၧဘၪဆဲၫ့လၧယၧၩ ဒဲနၧၩယီၩမွဲဆၧနီၪလမံၩ့လဲၪ. ယနၩရံၩဘၪဒံၭအ့ၬ.",
			"5": "<sup>5</sup> အမိစံၭဆၧအခ့ၫအၡၩၥံၪ, ထီးဒၪအစံၭနၥံၪလမံၩ့",
			"6": "<sup>6</sup> မံၩ့နီၪ,မၩနၥံၪဝ့ၫဘီၪ.- ဘဲၫၦယုဒၫဖိၪလဖၪၥူၫဝၭဆံၫ့ ဆၧအထူၫအရူၫအီၪဝ့ၫအၥိၭနီၪ, ဖၧၩ့လိးလၧအထီနံၫ",
			"7": "<sup>7</sup> ဒၩ့ၥၧၫ့ဒၩ့အီၪဝ့ၫထီးနီၪဎူၫဖျိၪ့လီၫ.- ယ့ၫၡုၬစံၭအဝ့ၫ ၥံၪ,မၩဎွ့ၩဖၧၩ့လဖၪနီၪလၧထံၫဘီၪ, တၭအဝ့ၫၥံၪမၩ",
			"8": "<sup>8</sup> ဎွ့ၩဝ့ၫထီၩ့လၧအခိၪဖဲၩ့လီၫ.- တၭအဝ့ၫဒၪစံၭအဝ့ၫ ၥံၪဘိၩ့နဲၪ့ယီၩဘျႃၪ့န့တၭ, လ့ၩဆိၬလၧမူၭအခိၪလ ဂၩအအီၪဘီၪ. တၭအဝ့ၫၥံၪလ့ၩဆိၬဝ့ၫလီၫ.",
			"9": "<sup>9</sup> ထံၫလၧအကဲၪထၪ့စဘံၭထံၫနီၪ, မူၭအခိၪထဲးယိဝ့ၫတၭ, မွဲအဂဲၫအထံၭ ခီၫခီၫလဲၪနီၪ ၥ့ၪယၫဝ့ၫအ့ၬ. အ့ၪမွဲအခ့ၫအၡၩၥံၪ လၧအဘျႃၪ့န့ထံၫနီၪၥ့ၪယၫဝ့ၫ",
			"10": "<sup>10</sup> လီၫ.မူၭအခိၪ ကိၭတလၭမူၭအခွၫတၭ,- စံၭအဝ့ၫ, ၦကိၭဂၩဒ့ၭ အီၪက့ၪလၩ့ဆိၫ စဘံၭထံၫ အဂ့ၩတၭ, ထီးၦအီၩဝ့ၫဘျဲၩအီၩနီၪ အီၪက့ၪလၩ့ထဲၩ့စဘံၭထံၫ လၧအဘျၩလီၫ. အ့ၪမွဲနဝ့ၫဒၪ လဂၩယီၩ နအီၪက့ၪ",
			"11": "<sup>11</sup> လၩ့ထးဒံၭစဘံၭထံၫအဂ့ၩ ခီးဘိၩ့နဲၪ့ယီၩလီၫ.- ယ့ၫ ၡုၬမၩလၩ့လၭဆိၫဆၧယီၩ လၧကၫနၫ ဘၪဆဲၫ့လၧ ဂၫလလံၫအဖၧၩ့နီၪ နဲၪဖျီၪထၪ့ အလၩအဖၩ့တၭ, အထံၩအဖျဲၥံၪနဲၩဝ့ၫဒၪလီၫ.",
			"12": "<sup>12</sup> လၧခဲၫ့တၭလ့ၩဝ့ၫလၧကပၧနအၫ့နီၪ, အဝ့ၫဒၪဒဲအ မိ, ဒဲအထၧၫ့ဖုဝဲၥံၪ, ဒဲအထံၩအဖျဲလဖၪတၭ, အီၪဝ့ၫ ထီးနီၪအၪနံၩအၪၥၫ့အ့ၬ.",
			"13": "<sup>13</sup> ဘူၭထၪ့လၧၦယုဒၫဖိၪ အဘိၪ့လ့ၩဖၬတၭယ့ၫ",
			"14": "<sup>14</sup> ၡုၬလ့ၩထၪ့ဝ့ၫ ထီၩ့လၧယရုစလံၫ့နီၪ,- ဒၪဘၪဝ့ၫလၧ ၦအၪ့ဆၫချီ,ဒဲၥိၪ, ဒဲထိၪလွံ, ဒဲၦလၧအအၪ့လဲၩစ့ၩ",
			"15": "<sup>15</sup> ဆၧၫ့နၩ့ဝ့ၫလၧဆၧလုအဂံၪ့ဖၧၩ့လီၫ.- တၭအဝ့ၫဒၪ မၩနိၪဖျ့ၪလၧဖျံၩဖိၪတၭ,နၫ့ထၪ့ခွံၬၦကိၭဂၩဒ့ၭလၧဆၧ လုအဂံၪ့ဖၧၩ့ဒဲၥိၪ, ဒဲချီၥံၪလီၫ. တၭလူၫလၩ့ခွံၬ ၦအၪ့",
			"16": "<sup>16</sup> လဲၩစ့ၩအစ့ၩနီၪတၭ, ချႃၬလၩ့ခွံၬစပွဲၥံၪနီၪ,- စံၭၦလၧ အအၪ့ဆၫထိၪလွံနီၪ, ဆိၬထၪ့ခွံၬဆၧလဖၪယီၩဘီၪ. ယဖါအဂံၪ့ယီၩ ထီးမၩကဲၪထၪ့လၧ ဆၧအၪ့ခၩအဂံၪ့",
			"17": "<sup>17</sup> လဂ့ၩ.- ထီးနီၪလဖၧၫ့ အထံၩအဖျဲၥံၪနၪ့ထၪ့ထဲၩ့ ဆၧကွ့ၭဝ့ၫလၧအလံၬစံၭဝ့ၫဒၪ, ယၥၭဆီၪ့လၧနဂံၪ့အဂးနီၪ အၪ့ခွံၬယူၭယၧၩယူၭ.",
			"18": "<sup>18</sup> မၩအၥၭဘဲၫနီၪတၭ, ၦယုဒၫဖိၪလဖၪချဲၩ့ဆၧၫ့ဆၧ, စံၭအဝ့ၫ, နမၩဆၧလဖၪယီၩတၭ, မွဲနဒုၭနဲၪပၧၩလၧ",
			"19": "<sup>19</sup> ဆၧနီၫလၫအလၩ့လၭလမံၩ့လဲၪ.- ယ့ၫၡုၬချဲၩ့ဆၧၫ့ ဝ့ၫတၭ,စံၭအဝ့ၫၥံၪ ရိလၩ့ဎီးခွံၬဆၧလုအဂံၪ့ယီၩတၭ, ၥၧၫ့နံၩအထးဖၧၩ့နီၪ ယမိမၩထၪ့ထဲၩ့ထီးအဂီၩ့",
			"20": "<sup>20</sup> လီၫ.- ၦယုဒၫဖိၪၥံၪစံၭဒီၭဝ့ၫ, ဆၧလုအဂံၪ့ယီၩ ၦမၩ ထၪ့ဝ့ၫလံဆံၫဎူၫနံၪ့ယၫတၭး လၧၥၧၫ့နံၩအထးဖၧၩ့",
			"21": "<sup>21</sup> နီၪ,မွဲနမၩထၪ့ထဲၩ့နဝ့ၫဘၪမိဂီၩ့ဆ့ဧၪ.- မွဲလါနၫ့ဘိၩ အဝ့ၫဒၪစံၭဆၧလုဂံၪ့ ဘၪဆဲၫ့လၧအမိၡါလီၫ.",
			"22": "<sup>22</sup> မၩအၥၭဘဲၫနီၪတၭ, ထီးအဂဲထုၪ့မၧၫ့ထၪ့ထဲၩ့ဝ့ၫနီၪ, အထံၩအဖျဲၥံၪနၪ့ထၪ့ထဲၩ့ လၧအလီၩဘၪဆၧနီၪ လီၫ.တၭအဝ့ၫၥံၪ နဲၩဆၧကွ့ၭအၥၭ ဒဲယ့ၫၡုၬအဆၧ ချဲၩ့နီၪလီၫ.",
			"23": "<sup>23</sup> ထီးအအီၪလၧယရုစလံၫ့အဖၧၩ့, လၧဘိၪ့လ့ၩဖၬ အဘိၩ့ဘၭနီၪ, ၦၡၩဒၪဘၪဆၧလၩ့လၭလၧအမၩဝ့ၫ",
			"24": "<sup>24</sup> တၭ,ၦအၪဂၩနဲၩထဲၩ့အမံၩ့လီၫ.- မွဲလါနၫ့ဘဲၫနီၪတၭ, ယ့ၫၡုၬဒိၭနဲၩ့အၥၭ လၧအဝ့ၫၥံၪအစူၪဖၧၩ့အ့ၬ. မွဲ",
			"25": "<sup>25</sup> အၥ့ၪယၫၦကိၭဂၩဒ့ၭအဂဲးလီၫ.- ၦထိးအၥၭလၧ ၦၡၩအဂဲးအကၠီၪ့နီၪ, အလးအီၪအ့ၬး အဂဲးဘဲၫယီၩ ဆၧအီၪလၧၦၡၩအဖၧၩ့နီၪ အဝ့ၫဒၪၥ့ၪယၫဝ့ၫဒၪလီၫ."
		},
		"3": {
			"1": "<sup>1</sup> ၦဘၪဆဲၫ့လၧၦဖၫရစံၫလဖၪ အမံၩ့စနံၭကဒံမၧၭ",
			"2": "<sup>2</sup> ၦယုဒၫဖိၪအၦဒိၪအီၪဝ့ၫလဂၩလီၫ.- အဝ့ၫနီၪလဂၩ ဂဲၫလၧယ့ၫၡုၬအအီၪ လၧမုနၩလခီၫတၭ, စံၭအဝ့ၫ, ရၭဘံၫဧ့,ပၥ့ၪယၫလၧနမွဲ ဆရၫလၧအဂဲၫလၩ့လၧယွၩ အအီၪလီၫ. အဂဲးဘဲၫယီၩ ၦလၧအမၩလၩ့လၭဆၧ ဘဲၫနမၩနီၪ, ယွၩအ့ၪလအီၪဘၪလၧအၥိၭတၭ, မၩ",
			"3": "<sup>3</sup> ဝ့ၫၥ့ၪနးဂၩအ့ၬ.- ယ့ၫၡုၬချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭဝ့ၫဒၪ, ယလီၩဘၪနၧၩ တီၩတီၩလီၩ့လီၩ့ယီၩ, ၦအ့ၪလအီၪ ဖျဲၪဘၪဝ့ၫနးဖၧၫ့ဒီၭတၭ, မွဲအဒၪဘၪယွၩအဘၩ့အ မုးၥ့ၪအ့ၬ.",
			"4": "<sup>4</sup> စနံၭကဒံမၧၭစံၭအဝ့ၫ, ၦလၧအၥၭၡါဝ့ၫနီၪ,အီၪဖျဲၪ ဝ့ၫမိၥ့ၪဘဲၫၥ့ၪလဲၪ. မွဲအနုၬထဲၩ့ဝ့ၫလၧအမိအဒၧၩ့လး",
			"5": "<sup>5</sup> ဖၧၩ့တၭ, အီၪဖျဲၪနံၫဖၧၫ့လဖၧၫ့ဘၪမိၥ့ၪဧၪ.- ယ့ၫၡုၬ ချဲၩ့ဆၧၫ့ဆၧ, စံၭဝ့ၫဒၪ, ယလီၩဘၪနၧၩတီၩတီၩလီၩ့ လီၩ့ယီၩ,ၦအ့ၪလအီၪဖျဲၪဘၪလၧထံၫဒဲလၧၥၭမုနီၪ တၭ,နုၬထဲၩ့ဝ့ၫလၧယွၩအဘၩ့အမုးအဖၧၩ့ ၥ့ၪအ့ၬ.",
			"6": "<sup>6</sup> ဆၧအီၪဖျဲၪလၧဆၧယၪ,မွဲဆၧယၪတၭ, ဆၧအီၪဖျဲၪ",
			"7": "<sup>7</sup> လၧၥၭမု,မွဲၥၭလီၫ.- ယစံၭနၥံၪယီၩ နၥံၪဘၪအီၪဖျဲၪ နးဖၧၫ့ဒီၭတၭ, ထီးဆီၫ့မီၪ့လၩ့လၭ လၧနၥံၪအၥၭလ",
			"8": "<sup>8</sup> ဂ့ၩ.- ဆၧလၧလံၩယီၩ, ထီးဒၪအမိအူၪဘၪအၥၭလၧ ဆၧနးစီၪ့နီၪ,အူၪဝ့ၫဒၪလီၫ. နနါဂၧၫ့လါနၫ့အၥီၫတၭ, မွဲအဂဲၫခီၫခီၫလဲၪ, လ့ၩခီၫခီၫလဲၪနီၪ, နၥ့ၪယၫအ့ၬ. ကယဲၦအီၪဖျဲၪဝ့ၫလၧၥၭမုယီၩ မၩအၥၭဘဲၫနီၪၥိၭ",
			"9": "<sup>9</sup> ကိၭဂၩဒ့ၭလီၫ.- စနံၭကဒံမၧၭချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭ",
			"10": "<sup>10</sup> အဝ့ၫ,ဆၧယီၩလဖၪ မၩအၥၭမိၥ့ၪဘဲၫၥ့ၪလဲၪ.- ယ့ၫ ၡုၬချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭအဝ့ၫ, နဝ့ၫဒၪယီၩ, နမွဲမၬ, ဆရၫလၧအံၫစရ့လၭဖိၪအကျၩတၭ, ဆၧယီၩလဖၪ",
			"11": "<sup>11</sup> မွဲနၥ့ၪယၫအ့ၬဧၪ.- ယလီၩဘၪနၧၩတီၩတီၩလီၩ့လီၩ့ ယီၩ,ပလီၩလၩ့လၬလၩ့ဆၧလၧပၥ့ၪယၫပဝ့ၫ, ပထိး ပၥၭလၧဆၧလၧပဒၪဘၪပဝ့ၫတၭ, ပဆၧထိးပၥၭနီၪ,",
			"12": "<sup>12</sup> နၥံၪထိးဆၧၫ့အ့ၬ.- ဆၧလၧအဘၪဆဲၫ့လၧဂၪ့ခိၪလဖၪ နီၪ,ယအ့ၪလီၩဘၪတၭ, နၥံၪလနဲၩဘၪနီၪ, ဆၧလၧအ ဘၪဆဲၫ့လၧမူၭခိၪလခီၫ ယအ့ၪလီၩဘၪတၭ, မွဲနၥံၪမိ နဲၩဘဲၫၥ့ၪလဲၪ.",
			"13": "<sup>13</sup> ၦၡၩလ့ၩထၪ့လၧမူၭခိၪနးဂၩအ့ၬ. လ့ၩထၪ့န့ၫ ၦလၧအဂဲၫလၩ့လၧမူၭခိၪ, ၦၡၩအဖိၪခွၫလၧအအီၪဝ့ၫ",
			"14": "<sup>14</sup> လၧမူၭခိၪအဖၧၩ့လဂၩယီၩလီၫ.- ဘဲၫစမိစ့ၭဘီၩ့ထၪ့ ဂူလၧၡါမုနၧၫ့ဖၫအၥိၭနီၪ, ၦၡၩအဖိၪခွၫယီၩ, မိ",
			"15": "<sup>15</sup> ဘၪဘီၩ့ထၪ့အၥၭ ဘဲၫနီၪအၥိၭ,- ဘဲၫၥိၭကယဲၦလၧ အနဲၩထဲၩ့ဝ့ၫလဂၩလါလါနီၪ, မိန့ဘၪဆၧမၧၫ့လၩ့",
			"16": "<sup>16</sup> ဆိၩလၩ့ကၠၪလီၫ.- အဂဲးဘဲၫယီၩ ယွၩအဲၪၦဂၪ့ခိၪဖိၪ ထီးအဖ့ၪလၫ့ခွံၬအဖိၪခွၫအီၪဝ့ၫလဂၩဎးဘဲၫၥိၭ ကယဲၦလၧအနဲၩထဲၩ့ဝ့ၫ လဂၩဂၩနီၪ, မိဘၪဆၧဂၭ ဂီၩ့အ့ၬ. အ့ၪမွဲမိန့ဘၪဆၧမၧၫ့လၩ့ဆိၩလၩ့ကၠၪလီၫ.",
			"17": "<sup>17</sup> အဂဲးဘဲၫယီၩ ယွၩအၪ့မၧၫ့လၩ့အဖိၪခွၫလၧဂၪ့ခိၪချိၫ့ ယီၩ,ဘဲၫၥိၭအမိစ့ၩရၫ့ၦဂၪ့ခိၪဖိၪမွဲအ့ၬ, မွဲဘဲၫၥိၭ ၦဂၪ့ခိၪဖိၪၥံၪမိထီၩ့ဝ့ၫ လၧဆၧထိးထဲၩ့တၩ့ထဲၩ့လၧ",
			"18": "<sup>18</sup> အဝ့ၫနီၪအကၠီၩ့လီၫ.- ၦလၧအနဲၩထဲၩ့အဝ့ၫနီၪ, ဘၪ ထိးဆၧစ့ၩရၫ့စၪအ့ၬ. အ့ၪမွဲၦလၧအလနဲၩဘၪအ ဝ့ၫနီၪ,ဘၪယူၭဆၧစ့ၩရၫ့စၪယူၭဘိၩ့နဲၪ့ယီၩလီၫ. အ ဂဲးဘဲၫယီၩယွၩအဖိၪခွၫလဂၩဎးနီၪ မွဲအနဲၩထဲၩ့ဝ့ၫ",
			"19": "<sup>19</sup> အမံၩ့အ့ၬ.- တၭဆၧစ့ၩရၫ့စၪနီၪမွဲဆၧယီၩ,ဆၧဖၩ့ ဂဲၫလၩ့လၧဂၪ့ခိၪချိၫ့ယီၩတၭ, ဘၪၦၡၩအၥၭလၧဆၧ ခံၭအၪနဲၪ့ဆၧဖၩ့နီၪဒံၭ, မွဲလၧအဆၧမၩအၧၩ့ဝ့ၫအ",
			"20": "<sup>20</sup> ဂဲးလီၫ.- အဂဲးဘဲၫယီၩကယဲၦလၧ အမၩဆၧအၧၩ့လ ဂၩဂၩနီၪ, မ့ၬလဲၩဆၧဖၩ့တၭ, ဘဲၫၥိၭအဆၧမၩထီး ဘၪဆၧအၪ့ၥီၪ့လဂ့ၩနီၪ, ဂဲၫဝ့ၫလၧဆၧဖၩ့အအီၪ",
			"21": "<sup>21</sup> အ့ၬ.- အ့ၪမွဲၦမၩဆၧအတီၩအလီၩ့နီၪ, ဘဲၫၥိၭအ ဆၧမၩမိအီၪဖျီၪထၪ့လၧအမၩဝ့ၫ လၧယွၩအဖၧၩ့တၭ, ဂဲၫဝ့ၫလၧဆၧဖၩ့အအီၪနီၪလီၫ.",
			"22": "<sup>22</sup> ဆၧနီၪလဖၪအလးခဲၫ့တၭ, ယ့ၫၡုၬဒဲအထံၩအဖျဲၥံၪ လ့ၩလၧခးယုဒၫတၭ အီၪဝ့ၫလၧအဝ့ၫၥံၪအၥိၭ ထီးနီၪ",
			"23": "<sup>23</sup> တၭ,ဘၭတံၫဇၫ့ဆၧလီၫ.- စယီဟၫ့ ဘၭတံၫဇၫ့ ဆၧလၧအံနၧၫ့ ဘူၭလၧစ့လံၫ့နီၪ,အဂဲးဘဲၫယီၩမွဲ ထံၫအၪလၧအလးထီးနီၪလီၫ. တၭၦၡၩၥံၪဂဲၫဒိၭဘၭ",
			"24": "<sup>24</sup> တံၫဇၫ့အၥၭလီၫ.- အဂဲးဘဲၫယီၩစယီဟၫ့လၩ့ လၧထီၫ့ဖၧၩ့ဒံၭအ့ၬ.",
			"25": "<sup>25</sup> မၩအၥၭဘဲၫနီၪတၭ, စယီဟၫ့အထံၩအဖျဲၥံၪ, ဒဲၦ ယုဒၫဖိၪၥံၪတ့ၭလိၬအၥၭလၧၥူၫဝၭဆံၫ့ဆၧအထူၫအ",
			"26": "<sup>26</sup> ရူၫအဂဲးအကၠီၪ့လီၫ.- အဝ့ၫၥံၪဂဲၫလၧစယီဟၫ့အအီၪ တၭ, စံၭအဝ့ၫ, ရၭဘံၫဧ့, ယိခွါ, ၦအီၪလၧနၥိၭလၧ ယီၫဒၫ့ဝါလခီၫ, လၧနထိးနၥၭလၧအဂဲးလဂၩနီၪ, ဘၭတံၫဇၫ့ဆၧတၭ, ၦကိၭဂၩဒ့ၭလ့ၩလၧအအီၪ လီၫ.",
			"27": "<sup>27</sup> စယီဟၫ့ချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭဝ့ၫ,ဆၧအ့ၪလဖ့ၪလၫ့ ဘၪဝ့ၫလၧမူၭခိၪလခီၫနီၪ, ၦလဂၩဂၩန့ဘၪ ဆၧၥ့ၪ",
			"28": "<sup>28</sup> နးမံၩ့အ့ၬ.- နၥံၪမိထိးနၥံၪအၥၭ လၧယလီၩဘၪ ယူၭနၥံၪယီၩ,ယလမွဲဘၪဎရံၬတၭ, မွဲဆၧအၪ့မၧၫ့",
			"29": "<sup>29</sup> လၩ့န့ယၧၩလၧဎရံၬအမ့ၬယၫလီၫ.- ၦလဂၩန့ဘၪ တလၭမူၭအမုၪနီၪ, မွဲတလၭမူၭအခွၫတၭ, မွဲလါနၫ့ ဘိၩ,တလၭမူၭအခွၫအထံၩအၥိၭဆၧၫ့ထုၪ့တၭ, နါဂၧၫ့ဘၪတလၭမူၭအခွၫအလူနီၪ ၥၭထိၬမၬဝ့ၫလီၫ. မၩအၥၭဘဲၫနီၪတၭ, ယဆၧၥၭထိၬယီၩလၧၫ့ထၪ့ဎွ့ၩ",
			"30": "<sup>30</sup> ထၪ့ဝ့ၫလီၫ.- အဝ့ၫဒၪနီၪမိဘၪအၪထၪ့ဝ့ၫဒၪတၭ, အ့ၪ မွဲယဝ့ၫဒၪယီၩ, ယဘၪလၩ့ၡၩထဲၩ့ဝ့ၫလခီၫလီၫ.",
			"31": "<sup>31</sup> ၦဂဲၫလၩ့ဝ့ၫလၧထၭလဂၩနီၪ, အီၪလၧဆၧထီးအ လူၬအဖၫ့ခိၪလီၫ. ၦအီၪဝ့ၫလၧဂၪ့ခိၪယီၩ, ဘၪဆဲၫ့ လၧဂၪ့ခိၪတၭ, ချဲၩ့ဆၧလၧအဘၪဆဲၫ့ လၧဂၪ့ခိၪ လီၫ.ၦဂဲၫလၩ့ဝ့ၫလၧမူၭခိၪ, မွဲအအီၪဝ့ၫလၧဆၧထီး",
			"32": "<sup>32</sup> အလူၬအဖၫ့ခိၪလီၫ.- ထီးဒၪဆၧလၧအဒၪဘၪဝ့ၫဒဲအ နါဂၧၫ့ဘၪဝ့ၫနီၪ, ထိးအၥၭလၧအဂဲးတၭ, အဆၧထိး",
			"33": "<sup>33</sup> အၥၭနီၪၦထိးဆၧၫ့ဝ့ၫနးဂၩအ့ၬ.- အဆၧထိးအၥၭ နီၪ,ၦလၧအထိးဆၧၫ့ဝ့ၫတၭ, စဲၩနဲၪ့ထၬဝ့ၫလၧယွၩ",
			"34": "<sup>34</sup> မွဲဆၧမွဲဆၧတီၩလီၫ.- အဂဲးဘဲၫယီၩၦလၧယွၩအၪ့မၧၫ့ လၩ့ဝ့ၫလဂၩနီၪလီၩလၩ့လၬလၩ့ယွၩအလူအထၫ လီၫ.အဂဲးဘဲၫယီၩယွၩလတိၪ့ဘၪဝ့ၫတၭ,ဖ့ၪလၫ့",
			"35": "<sup>35</sup> အဝ့ၫလၧၥၭမုနီၪလီၫ.- ဖါအဲၪအဖိၪခွၫတၭ, ဖ့ၪလၫ့ ယူၭဆၧထီးအလူၬလၧအစူၪဖၧၩ့ယူၭ.",
			"36": "<sup>36</sup> ၦလၧအနဲၩထဲၩ့အဖိၪခွၫနီၪ, အီၪဝ့ၫလၧဆၧမၧၫ့ လၩ့ဆိၩလၩ့ကၠၪလီၫ. တၭၦလၧအလနဲၩဘၪ ဖိၪခွၫ နီၪ,လဒၪန့ဘၪဆၧမၧၫ့နီၪလကၭလၧၩ့, ယွၩအဆၧ ၥၭထၪ့အီၪဂုးခၧၫ့ဝ့ၫလၧအလီၩ့လီၫ."
		},
		"4": {
			"1": "<sup>1</sup> မၩအၥၭဘဲၫနီၪတၭ, ထီးကဆါနီၪၥ့ၪယၫလၧၦဖၫ ရစံၫၥံၪနါဂၧၫ့လၧယ့ၫၡုၬဒုၭကဲၪထၪ့ အထံၩအဖျဲၥံၪ",
			"2": "<sup>2</sup> ဒဲဘၭတံၫဇၫ့ဆၧအၪနဲၪ့စယီဟၫ့ဒံၭတၭ,- (မွဲလါ နၫ့ဘိၩ,ယ့ၫၡုၬလဘၭတံၫဇၫ့ဘၪဆၧနီၪ, မွဲအထံၩအ",
			"3": "<sup>3</sup> ဖျဲၥံၪလီၫ.)- အဝ့ၫဒၪစဲၪ့ထၪ့ခွံၬဝ့ၫ လၧခးယုဒၫတၭ,",
			"4": "<sup>4</sup> ထဲၩ့ထဲၩ့ဒီၭဝ့ၫလၧ ဂၫလလံၫအဖၧၩ့လီၫ.- တၭအဝ့ၫ",
			"5": "<sup>5</sup> နီၪဘၪခၫ့ဂၬခွံၬ ခးစမ့ရအၫလီၫ.- မၩအၥၭဘဲၫနီၪ တၭ,လ့ၩထီၩ့လၧဒိၩ့လဖျိၪ့ ကိၭဝ့ၫလၧစဲခၫအီၪလၧခး စမ့ရအၫဘူၭလၧဂၪ့ခိၪအဝၩ့ လၧစယၫကူၭဖ့ၪလၫ့အ",
			"6": "<sup>6</sup> ဖိၪခွၫစယိၥၭနီၪလီၫ.- စယၫကူၭအထံၫဖၧၩ့ အီၪဝ့ၫ ထီးနီၪလီၫ. မၩအၥၭဘဲၫနီၪတၭ, ယ့ၫၡုၬလ့ၩဆၧနီၪ ဆၧပွံၭအၥၭတၭ, ဆၧၫ့နၩ့ဝ့ၫလၧထံၫဖၧၩ့အနဲၩ့ထံၭ နီၪ,လၩ့ဘူၭဎူၫနၩရံၩလီၫ.",
			"7": "<sup>7</sup> ၦစမ့ရအၫမုၪလဂၩဂဲၫအၪ့ဒုၪ့ထံၫနီၪ, ယ့ၫၡုၬစံၭအ",
			"8": "<sup>8</sup> ဝ့ၫ,ဒုၭအီၩယၧၩနးဆံၭဘီၪ.- အဂဲးဘဲၫယီၩအထံၩအ ဖျဲလဖၪလ့ၩဝ့ၫလၧဒိၩ့ဖၧၩ့ ဘဲၫၥိၭအမိဎွ့ၩဆၧအၪ့နီၪ",
			"9": "<sup>9</sup> လီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ၦစမ့ရအၫမုၪစံၭအဝ့ၫ, နဝ့ၫဒၪနမွဲၦယုဒၫဖိၪတၭ, နအၪ့ကံၩ့အီၩဆၧလၧၦစမ့ ရအၫမုၪယီၩမွဲဘၪလဲၪး အဂဲးဘဲၫယီၩ ၦယုဒၫဖိၪ,ဒဲၦ",
			"10": "<sup>10</sup> စမ့ရအၫဖိၪယီၩ, ဖံၭၥိၭလိၬအၥၭအ့ၬ.- ယ့ၫၡုၬချဲၩ့ ဆၧၫ့ဆၧတၭ, စံၭအဝ့ၫ, နအ့ၪၥ့ၪယၫယွၩအခိးအတၩ, ဒဲၦလဂၩလၧအလီၩဘၪနၧၩ, ဒုၭအီၩယၧၩဆံၭ,နမိ အၪ့ကံၩ့ဆၧလၧအဝ့ၫနီၪတၭ, အဝ့ၫမိဖ့ၪလၫ့နၧၩလၧ",
			"11": "<sup>11</sup> ထံၫမၧၫ့လီၫ.- ၦမုၪစံၭအဝ့ၫ, ကဆါဧ့,နအၪ့ဒုၪ့ထံၫ ယီၩနထံၫဆဲၩ လအီၪဘၪတၭ, ထံၫဖၧၩ့ယီၩယိၬမၬ လီၫ.မၩအၥၭဘဲၫနီၪတၭ, နအီၪလၧထံၫမၧၫ့ဘဲၫၥ့ၪ",
			"12": "<sup>12</sup> လဲၪ.- ပဖါစယၫကူၭဖ့ၪလၫ့ပၧၩလၧထံၫဖၧၩ့ယီၩတၭ, အနၫ့ဆါဒၪဝ့ၫ ဒဲအဖိၪအလံၩ, ဒဲအဆၧဖိၪဆၧဎါၥံၪ နီၪ,အီၩဆၧလၧအဖၧၩ့ယီၩတၭ, နဝ့ၫဒၪယီၩမွဲနဒိၪ",
			"13": "<sup>13</sup> နဲၪ့အဝ့ၫနီၪဆ့ဧၪ.- ယ့ၫၡုၬချဲၩ့ဆၧၫ့အဝ့ၫနီၪတၭ, စံၭ ဝ့ၫ,ကယဲၦလၧအအီၩထံၫယီၩ လဂၩဂၩနီၪ, ဆၧမိၥၭ",
			"14": "<sup>14</sup> ဝံဒီၭအၥၭလီၫ.- အ့ၪမွဲထီးဒၪ ၦလၧအအီၩထံၫ လၧ ယမိဖ့ၪလၫ့အဝ့ၫလဂၩဂၩနီၪ, ဆၧမိၥၭဝံလၧၩ့အၥၭ လၧထံၫနးဆိၭအ့ၬ. ထံၫလၧယဖ့ၪလၫ့ဝ့ၫနီၪ မိကဲၪထၪ့ ဝ့ၫလၧထံၫထၪ့ဖျိၭလၧအဖၧၩ့တၭ, မိထၪ့ဘၭဝ့ၫလၧ",
			"15": "<sup>15</sup> ဆၧမၧၫ့လၩ့ဆိၩလၩ့ကၠၪလီၫ.- ၦမုၪစံၭအဝ့ၫကဆါ ဧ့,ဘဲၫၥိၭယထီးၥၭဝံလၧၩ့ ယၥၭလၧထံၫဒဲထီးဘၪဂဲၫ အၪ့ဒုၪ့လၧၩ့ထံၫထီးယီၩလဂ့ၩတၭ, ဖ့ၪလၫ့ယၧၩလၧ ထံၫနီၪဆံၭ.",
			"16": "<sup>16</sup> ယ့ၫၡုၬစံၭအဝ့ၫ, ထဲၩ့ကိၭန့နဝၩတၭ, ဂဲၫထဲၩ့ထီး",
			"17": "<sup>17</sup> ယီၩဆံၭ.- ၦမုၪချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭဝ့ၫ, ယဝၩအီၪ အ့ၬ.ယ့ၫၡုၬစံၭဝ့ၫ, နစံၭဆၧလၧနဝၩလအီၪဘၪနီၪ,",
			"18": "<sup>18</sup> ဘၪယူၭ.- အဂဲးဘဲၫယီၩနဝၩအီၪဝဲၩယူၭယဲဆၫ့ယူၭ, ၦလၧနအီၪလၧအၥိၭ ဘိၩ့နဲၪ့ယီၩ လဂၩနီၪ, လမွဲဘၪ နဝၩတၭ, နစံၭဆၧနီၪ မွဲယူၭတီၩယူၭ.",
			"19": "<sup>19</sup> ၦမုၪစံၭအဝ့ၫ, ကဆါဧ့,ယဒၪဘၪလၧနမွဲမီၪလဂၩ",
			"20": "<sup>20</sup> လီၫ.- ပဖါၥံၪဘိၪ့ထၪ့ဘၩထၪ့ဆၧလၧခိၪလီၩ့ယီၩ အလီၩ့လီၫ. တၭနၥံၪစံၭလၧၦဘၪဘိၪ့ထၪ့ဘၩထၪ့",
			"21": "<sup>21</sup> ဆၧအလးနီၪ မွဲယရုစလံၫ့လီၫ.- ယ့ၫၡုၬစံၭအဝ့ၫ, ၦမုၪဧ့,နဲၩယၧၩလၧအဆၧၫ့အထီ မိဘၪဝ့ၫလၧခိၪလီၩ့ ယီၩမွဲဂ့ၩ, လၧယရုစလံၫ့မွဲဂ့ၩ, နၥံၪဘၩထၪ့ဖါအ့ၬ.",
			"22": "<sup>22</sup> နၥံၪဝ့ၫဒၪယီၩ နၥံၪဘိၪ့ထၪ့ဘၩထၪ့ဆၧလၧ နၥံၪလ ၥ့ၪယၫဘၪတၭ, ပဝ့ၫဒၪယီၩ ပဘိၪ့ထၪ့ဘၩထၪ့ဆၧ လၧပၥ့ၪယၫလီၫ. အဂဲးဘဲၫယီၩ ဆၧထိးထဲၩ့တၩ့ထဲၩ့",
			"23": "<sup>23</sup> ဘၪဆဲၫ့လၧၦယုဒၫဖိၪလီၫ.- မွဲလါနၫ့တၭ, အမုအ လၩမိထီၩ့ဝ့ၫတၭ, ဘၪဘိၩ့နဲၪ့ယီၩဒၪလ့ၬ, ထီးဒၪၦလၧ အဘၩဆၧလၩ့ထံးလၩ့ဆ့ၭလဖၪနီၪ, မိဘိၪ့ထၪ့ဘၩ ထၪ့ဖါလၧၥုၪ့လၧၥၭ, ဒဲလၧဆၧမွဲဆၧတီၩလီၫ. အ ဂဲးဘဲၫယီၩ ဖါအၪ့ဎၬၦလဖၪ လၧအဘိၪ့ထၪ့ဘၩထၪ့",
			"24": "<sup>24</sup> အဝ့ၫဘဲၫနီၪၥိၭလီၫ.- ယွၩမွဲၥၭတၭ, ၦၡၩလၧအ ဘိၪ့ထၪ့ဘၩထၪ့အဝ့ၫနီၪ, ဘၪဘိၪ့ထၪ့ဘၩထၪ့ဝ့ၫလၧ",
			"25": "<sup>25</sup> ၥုၪ့လၧၥၭ, ဒဲလၧဆၧမွဲဆၧတီၩအဖၧၩ့လီၫ.- ၦမုၪနီၪ စံၭဆၧၫ့အဝ့ၫ, ယၥ့ၪယၫလၧ မစဲအၫ ဂဲၫဝ့ၫ, (လၧ ပကိၭဝ့ၫဎရံၬနီၪ,) ထီးအဝ့ၫဒၪအ့ၪဂဲၫထီၩ့ဝ့ၫတၭ, မိ လီၩဘၪပၧၩလၧဆၧထီးအလူၬလီၫ.",
			"26": "<sup>26</sup> ယ့ၫၡုၬစံၭအဝ့ၫ, ၦလၧအချဲၩ့ဆၧလၧနၧၩ, ယၧၩ",
			"27": "<sup>27</sup> ယီၩမွဲအဝ့ၫဒၪနီၪလီၫ.- ထီးနီၪလဖၧၫ့အထံၩအဖျဲ ၥံၪဂဲၫထဲၩ့ထီၩ့ဝ့ၫတၭ, အဝ့ၫဒၪချဲၩ့ဒုၪ့လိၬအၥၭလၧ ၦမုၪနီၪ,အဝ့ၫၥံၪထီၫမံၫထီၫမၪဝ့ၫလီၫ. မွဲလါနၫ့ဘိၩ, နအၪ့ဎၬနီၪလဲၪ, နချဲၩ့ဒုၪ့လိၬနၥၭလၧအဝ့ၫ, မွဲဘၪလဲၪ နီၪ, ၦစံၭဝ့ၫနးဂၩအ့ၬ.",
			"28": "<sup>28</sup> မၩအၥၭဘဲၫနီၪတၭ, ၦမုၪအီၪက့ၪလၩ့ထး အဖၧၩ့",
			"29": "<sup>29</sup> ထံၫ, ထဲၩ့ထဲၩ့ဝ့ၫလၧဒိၩ့ဖၧၩ့, စံၭၦၡၩ,- ၦလဂၩလၧ အလီၩဘၪယၧၩ ကယဲဆၧလၧယမၩယဝ့ၫလမံၩ့လါ လါနီၪ, ဂဲၫယိခွါဘီၪ.အဝ့ၫဒၪယီၩမွဲဎရံၬနီၪမွဲအ့ၬဧၪ.",
			"30": "<sup>30</sup> မၩအၥၭဘဲၫနီၪတၭ, ၦလဖၪနီၪဂဲၫထၪ့ဝ့ၫ လၧဒိၩ့ဖၧၩ့",
			"31": "<sup>31</sup> တၭ,လ့ၩဝ့ၫလၧအအီၪလီၫ.- ထီးအထီနီၪအထံၩအ ဖျဲၥံၪအၪ့ကံၩ့အၪ့ယၫအဝ့ၫ, စံၭဝ့ၫ, ရၭဘံၫဧ, အၪ့ဆၧ",
			"32": "<sup>32</sup> ဘီၪ.- အဝ့ၫဒၪစံၭအဝ့ၫၥံၪ, ယဆၧအၪ့လၧနၥံၪလၥ့ၪ",
			"33": "<sup>33</sup> ယၫဘၪနီၪအီၪဝ့ၫလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, အထံၩ အဖျဲၥံၪ စံၭလိၬအၥၭ, မွဲၦဂဲၫဖ့ၪအၪ့အဆၧလဂၩဂၩ",
			"34": "<sup>34</sup> ဆ့ဧၪ.- ယ့ၫၡုၬစံၭအဝ့ၫၥံၪ, ယဆၧအၪ့နီၪမွဲလၧ ယမိ မၩထီးဒၪၦလၧအအၪ့မၧၫ့လၩ့ယၧၩ လဂၩအၥၭတၭ,",
			"35": "<sup>35</sup> မၩအဆၧမၩထီးအဂီၩ့ဝ့ၫနီၪလီၫ.- နၥံၪစံၭနၥံၪဝ့ၫ, အီၪဒံၭလၩလံဘံၪ့တၭ, မိဘၪဆၧကူၭဝ့ၫအထီနီၪ, မွဲအ့ၬဧၪ.ယိခွါ. ယလီၩဘၪနၥံၪ,စၪ့ထၪ့နၥံၪအမ့ၬတၭ, ယိလၧဆံၬၥံၪ နၩၥံၪနီၪဘီၪ. ဘိၩ့နဲၪ့ယီၩဒၪလ့ၬဘုၪ",
			"36": "<sup>36</sup> ဝီၩယူၭလၧဆၧမိကူၭဝ့ၫအဂးလီၫ.- ၦလၧအကူၭ ဘုၪနီၪန့ဘၪဝ့ၫအလံၩ့အလဲၫတၭ, အၪ့ထုၫ့ကီၪ့ဝ့ၫဆၧ ၥူၪဆၧၥၪလၧဆၧမၧၫ့လၩ့ဆိၩလၩ့ကၠၪအဂး, ဘဲၫ ၥိၭၦလၧအဎွံၪဆၧ, ဒဲၦလၧအကူၭဆၧနီၪ,မိၥၭထိၬ",
			"37": "<sup>37</sup> ဎုၬဝ့ၫနံၫဂၩလူၬလီၫ.- ၦဎွံၪဆၧမွဲလဂၩ, ဒဲၦကူၭဆၧမွဲ လဂၩဒၪနီၪ, ဆၧချဲၩ့လထံၪယီၩ, မွဲဆၧအတီၩအ",
			"38": "<sup>38</sup> လီၩ့လီၫ.- ယအၪ့မၧၫ့နၥံၪလ့ၩကူၭဆၧလၧနၥံၪလမၩ ဘၪအလးတၭ, ၦဂူၫဂၩၥံၪမၩဝ့ၫတၭ, နၥံၪဝ့ၫယီၩ နၥံၪလ့ၩနုၬလၧအဝ့ၫၥံၪ အဆၧမၩအဖၧၩ့လီၫ.",
			"39": "<sup>39</sup> ဆၧလၧၦမုၪထိးအၥၭနီၪ :အဝ့ၫဒၪလီၩဘၪယၧၩ, လၧကယဲဆၧလၧယမၩယဝ့ၫလမံၩ့လါလါ: အဆၧ ချဲၩ့လထံၪနီၪအကၠီၩ့တၭ, ၦစမ့ရအၫဖိၪၥံၪ အီၪလၧ",
			"40": "<sup>40</sup> ဒိၩ့ဖၧၩ့နီၪ, နဲၩထဲၩ့အဝ့ၫအၪဂၩလီၫ.- မၩအၥၭ ဘဲၫနီၪတၭ,ထီးၦစမ့ရအၫဖိၪလဖၪ ဂဲၫလၧအအီၪတၭ, အၪ့ကံၩ့အၪ့ယၫအဝ့ၫ ဘဲၫၥိၭအမိအီၪ လၧအဝ့ၫၥံၪအ",
			"41": "<sup>41</sup> ၥိၭတၭ, အဝ့ၫဒၪအီၪဝ့ၫထီးနီၪနံၫနံၩလီၫ.- လၧအလူ",
			"42": "<sup>42</sup> ဒၪဝ့ၫအကၠီၩ့တၭ, ၦနဲၩထဲၩ့အဝ့ၫအၪဂၩလီၫ.- အဝ့ၫ ၥံၪစံၭၦမုၪ, အယီၩမွဲလၧနလူအကၠီၩ့နီၪ ပနဲၩထဲၩ့ဆၧ မွဲအ့ၬ. အဂဲးဘဲၫယီၩ ပနါဂၧၫ့ဘၪပဝ့ၫတၭ, ပၥ့ၪ ယၫလၩ့ထံးလၩ့ဆ့ၭ လၧၦလဂၩယီၩ မွဲၦလၧအထိး တဲၩ့တၩ့ထဲၩ့ ၦဂၪ့ခိၪဖိၪဎရံၬနီၪလီၫ.",
			"43": "<sup>43</sup> လၧနံၫနံၩအလးခဲၫ့တၭ, အဝ့ၫစဲၪ့ထၪ့ခွံၬ ထီးနီၪ,",
			"44": "<sup>44</sup> လ့ၩထီၩ့လၧဂၫလလံၫအဖၧၩ့နီၪလီၫ.- အဂဲးဘဲၫယီၩ ယ့ၫၡုၬအနၫ့ဆါဒၪဝ့ၫ ထိးအၥၭလၧမီၪလဂၩဂၩနီၪ",
			"45": "<sup>45</sup> ထီးအထံၫအခးဖၧၩ့ ဒၪဝ့ၫအလၩအဖၩ့အီၪအ့ၬ.- မၩ အၥၭဘဲၫနီၪတၭ, ထီးအလ့ၩထီၩ့လၧဂၫလလံၫအဖၧၩ့ နီၪ, ၦဂၫလလံၫဖိၪၥံၪ ထိးဆၧၫ့ဝ့ၫဒၪလီၫ. အဂဲးဘဲၫ ယီၩအဝ့ၫၥံၪလ့ၩလၧဘိၪ့ဖၧၩ့ လၧယရုစလံၫ့နီၪဒၪဘၪ ယူၭဆၧလၧအမၩဝ့ၫ ထီးအလူၬလၧဘိၪ့ဖၧၩ့ယူၭ.",
			"46": "<sup>46</sup> မၩအၥၭဘဲၫနီၪတၭ, ယ့ၫၡုၬလ့ၩဒီၭလၧကၫနၫဘၪ ဆဲၫ့လၧဂၫလလံၫ ထီးအလးလၧအမၩကဲၪထၪ့ထံၫ လၧစဘံၭထံၫနီၪလီၫ. ၦဒိၪလဂၩအဖိၪခွၫလကဲၪ",
			"47": "<sup>47</sup> ဘၪအီၪလၧကပၧနအၫ့နီၪလီၫ.- အဝ့ၫနီၪနါဂၧၫ့လၧ ယ့ၫၡုၬဂဲၫထၪ့လၧခးယုဒၫ ထီၩ့လၧဂၫလလံၫအဖၧၩ့ တၭ,လ့ၩဝ့ၫထီၩ့လၧအအီၪနီၪ, အၪ့ကံၩ့အၪ့ယၫဝ့ၫ ဘဲၫၥိၭအမိဂဲၫမၩဘျၪထဲၩ့ အဖိၪခွၫတၭ, အဂဲးဘဲၫ",
			"48": "<sup>48</sup> ယီၩလၩ့ဘူၭလၧအမိၥံၫဝ့ၫဒၪလီၫ.- မၩအၥၭဘဲၫနီၪ တၭ,ယ့ၫၡုၬစံၭအဝ့ၫ, နၥံၪအ့ၪလဒၪဘၪ ဆၧမၩနဲၪ့",
			"49": "<sup>49</sup> ဒဲဆၧလၩ့လိလၩ့လၭနီၪနၥံၪနဲၩဆၧအ့ၬ.- ၦဒိၪစံၭ အဝ့ၫ,ကဆါဧ့, လၧယဖိၪခွၫ လချႃၭၥံၫဒံၭဘၪတၭ,",
			"50": "<sup>50</sup> ဂဲၫလၩ့ဘီၪ.- ယ့ၫၡုၬစံၭဝ့ၫ,ထဲၩ့ကဒၪဘီၪ, နဖိၪ ခွၫမၧၫ့ဝ့ၫလီၫ. ၦလဂၩနီၪနဲၩဆၧချဲၩ့လၧယ့ၫၡုၬလီၩ",
			"51": "<sup>51</sup> ဘၪဝ့ၫတၭ,ထဲၩ့ထဲၩ့ဝ့ၫလီၫ.- ထဲၩ့လၩ့ဝ့ၫအဘိၩ့ဘၭ တၭ,အခ့ၫအၡၩလဖၪဂဲၫအၪ့ဂၬဝ့ၫတၭ, လီၩဘၪဆၧ,",
			"52": "<sup>52</sup> စံၭဝ့ၫ, နဖိၪခွၫမၧၫ့ဝ့ၫလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, အဝ့ၫဒၪအၪ့စၪ့အဝ့ၫၥံၪ, အနၩရံၩလၧအကီၩ့ယါထဲၩ့ဝ့ၫ နီၪလီၫ.အဝ့ၫၥံၪလီၩဘၪဝ့ၫ, လၧမုဂၪလနံၩ နွ့ၫနၩရံၩ နီၪ,အဆၧဆူၪဂိၬဘျၪထဲၩ့ဝ့ၫလီၫ.",
			"53": "<sup>53</sup> မၩအၥၭဘဲၫနီၪတၭ, အဖါၥ့ၪယၫလၧအမွဲ နၩရံၩ လၧယ့ၫၡုၬလီၩဘၪဝ့ၫနဖိၪခွၫမၧၫ့ဝ့ၫလီၫ. အဝ့ၫနီၪ အနၫ့ဆါနဲၩထဲၩ့ဆၧဒဲ အဂံၪ့ဖိၪထၧၫ့ဂံၪ့ယၫလီၫ.",
			"54": "<sup>54</sup> ယ့ၫၡုၬဂဲၫထၪ့ခွံၬ လၧခးယုဒၫထီၩ့လၧဂၫလလံၫအ ဖၧၩ့နီၪ,မၩလၩ့လၭဒီၭဆၧလမံၩ့ယီၩ, မွဲနံၫမံၩ့လမံၩ့ လီၫ."
		},
		"5": {
			"1": "<sup>1</sup> လၧဆၧလဖၪနီၪအလးခဲၫ့တၭ, ၦယုဒၫဖိၪမၩဘိၪ့",
			"2": "<sup>2</sup> လဘိၪ့တၭ, ယ့ၫၡုၬလ့ၩထၪ့လၧယရုစလံၫ့လီၫ.- က မၫအီၪလၧယရုစလံၫ့အဖၧၩ့, လၧၥိၪတရၫ့အနဲၩ့ထံၭ တၭ,ကိၭဝ့ၫအမံၩ့လၧၦဟံဘြႃၫအလူဘၥ့ၭစဒၫနီၪအီၪ",
			"3": "<sup>3</sup> လၧအခိၪၥိၭထၪ့အၥၭယဲဖျိၪ့ထီးနီၪလီၫ.- ၦခမျၧးဖၭ ဒိၪဘၪဆၧစူၭဆၧဆၫၦမ့ၬဘျီၪ, ၦခၪ့ဂၭဂီၩ့, ၦအဎဲၫ့ အၥွံၬၥံၪအီၪဝ့ၫလၧအဖၧၩ့ ယိလါလၧထံၫမိဝ့ၭဖျၩ့ထၪ့",
			"4": "<sup>4</sup> ဝ့ၫဒၪလီၫ.- အဂဲးဘဲၫယီၩ ထီးအဘၪအမုအလၩနီၪ, အၥီၫ့လဂၩဂဲၫလၩ့လၧကမၫဖၧၩ့တၭ, မၩဝၭဖျၩ့ထံၫ လီၫ.မၩအၥၭဘဲၫနီၪတၭ, ထံၫဝၭဖျၩ့ထၪ့အလးခဲၫ့, ၦလၧအလ့ၩလၩ့ဆိၫဝ့ၫလဂၩဂၩနီၪ, ကယဲဆၧဆၫ",
			"5": "<sup>5</sup> လၧအလီၩ့လမံၩ့မံၩ့ဘျၪထဲၩ့ဝ့ၫဒၪလီၫ.- ၦလၧအ ဘၪဆၧဆၫၥၧၫ့ဆံၫဎိၭနံၪ့အီၪဝ့ၫထီးနီၪလဂၩလီၫ.",
			"6": "<sup>6</sup> ယ့ၫၡုၬဒၪဘၪလၧအမံၫနၩ့တၭ, ၥ့ၪယၫဝ့ၫလၧအဆၫ ယံၬယံၬယူၭနီၪ, စံၭအဝ့ၫ, မိဘျၪထဲၩ့ဘၪနၥၭဆ့ဧၪ.",
			"7": "<sup>7</sup> ၦဆၫလဂၩနီၪစံၭဆၧၫ့အဝ့ၫ, ကဆါဧ့, ထီးထံၫဝၭဖျၩ့ ထၪ့ဝ့ၫတၭ, ၦလၧအမိလ့ၩဆိၬလၩ့ယၧၩ လၧကမၫ ဖၧၩ့နီၪအီၪနးဂၩအ့ၬ. ယလ့ၩလၩ့အဘိၩ့ဘၭနီၪ,",
			"8": "<sup>8</sup> ၦဂူၫဂၩလ့ၩလၩ့ဝ့ၫ လၧယၫလခီၫလီၫ.- ယ့ၫၡုၬစံၭအ",
			"9": "<sup>9</sup> ဝ့ၫဒၪ, ဂဲထုၪ့မၩန့ထၪ့နလးမံၫတၭ,စဲၪ့ထၪ့ဘီၪ.- ၦလ ဂၩနီၪ အဆၧဆၫဘျၪထဲၩ့ဝ့ၫချဲၫ့မၬတၭ, ဂဲထုၪ့မၩန့ ထၪ့အလးမံၫတၭစဲၪ့ထၪ့ဝ့ၫလီၫ.",
			"10": "<sup>10</sup> မုနံၩနီၪမွဲမးၥံၫအနံၩလီၫ. မၩအၥၭဘဲၫနီၪတၭ, ၦယုဒၫဖိၪလဖၪစံၭၦလၧ အဆၧဆၫဘျၪထဲၩ့ဝ့ၫလဂၩ နီၪ,မွဲမးၥံၫအနံၩတၭ နဆိၬနလးမံၫနီၪကြၨၭအ့ၬ.",
			"11": "<sup>11</sup> အဝ့ၫဒၪစံၭဝ့ၫ, ၦလၧအမၩဘျၪထဲၩ့ယၧၩလဂၩနီၪ,အ",
			"12": "<sup>12</sup> အဝ့ၫဒၪစံၭယၧၩ, မၩန့ထၪ့နလးမံၫတၭစဲၪ့ထၪ့ဘီၪ.-အ ဝ့ၫၥံၪအၪ့စၪ့အဝ့ၫ ၦလၧအစံၭနၧၩ, မၩန့ထၪ့နလးမံၫ",
			"13": "<sup>13</sup> တၭစဲၪ့ထၪ့နီၪ, မွဲပလၫလဂၩလဲၪ.- တၭမွဲပလၫလဂၩ လဲၪနီၪ, ၦလၧအဆၧဆၫ ဘျၪထဲၩ့ဝ့ၫလဂၩနီၪ လၥ့ၪ ယၫဘၪဝ့ၫး အဂဲးဘဲၫယီၩ ၦခမျၧးအီၪထီးနီၪတၭ, ယ့ၫၡုၬစဲၪ့ထၪ့ခွံၬဝ့ၫလီၫ.",
			"14": "<sup>14</sup> လၧဆၧလဖၪနီၪအလးခဲၫ့တၭ, ယ့ၫၡုၬဒၪဘၪအဝ့ၫ လၧဆၧလုအဂံၪ့ဖၧၩ့တၭ, စံၭအဝ့ၫ, ယိခွါ နအီၪဆီၪ့ အီၪချဲၫ့ဂ့ၩမၬတၭ, ဘဲၫၥိၭဆၧနၭနဲၪ့နီၪ ထီးဘၪနၧၩ",
			"15": "<sup>15</sup> လဂ့ၩတၭ,ထီးမၩလၧၩ့ဆၧဒဲၩဘၭလဂ့ၩ.- ၦလဂၩ နီၪလ့ၩလီၩဘၪ ၦယုဒၫဖိၪ လၧၦမၩအီၪဆီၪ့ထၪ့ထဲၩ့",
			"16": "<sup>16</sup> ယၧၩလဂၩနီၪမွဲယ့ၫၡုၬလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ၦယုဒၫဖိၪမၩအၧၩ့မၩနၭယ့ၫၡုၬလီၫ. အဂဲးဘဲၫယီၩ မွဲအမၩဆၧနီၪလဖၪလၧမးၥံၫအနံၩ အကၠီၩ့နီၪလီၫ.",
			"17": "<sup>17</sup> ယ့ၫၡုၬချဲၩ့ဆၧၫ့အဝ့ၫၥံၪ, ယဖါမၩဆၧခီးဘိၩ့နဲၪ့ယီၩ",
			"18": "<sup>18</sup> တၭ,ယဝ့ၫဒၪယမၩဆ့လီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ယ့ၫၡုၬလၨၪခၫ့ဖၬ မးၥံၫအနံၩနီၪလကၭလၧၩ့တၭး စံၭ ဝ့ၫ,လၧယွၩနီၪမွဲအဖါဒၪဝ့ၫတၭ, မၩန့ၫဎီၩ့အၥၭလၧ ယွၩနီၪအကၠီၩ့ ၦယုဒၫဖိၪလဖၪ အၪ့ဎူၫအၪ့ဎၬမၩၥံၫ အဝ့ၫအၪနဲၪ့အလးဒံၭလီၫ.",
			"19": "<sup>19</sup> မၩအၥၭဘဲၫနီၪတၭ, ယ့ၫၡုၬချဲၩ့ဆၧၫ့ဆၧ, စံၭအ ဝ့ၫၥံၪ,ယလီၩဘၪနၥံၪတီၩတီၩလီၩ့လီၩ့း ဖိၪခွၫမၩ အဆၧဒၪဝ့ၫၥ့ၪနးမံၩ့အ့ၬ. မၩၥ့ၪန့ၫဆၧလၧအဒၪဘၪ ဖါမၩဝ့ၫလီၫ. အဂဲးဘဲၫယီၩ ထီးဒၪအဝ့ၫဒၪမၩဆၧလ",
			"20": "<sup>20</sup> မံၩ့မံၩ့နီၪ, ဖိၪခွၫမၩဝ့ၫဒၪဘဲၫနီၪအၥိၭဆ့လီၫ.- အဂဲး ဘဲၫယီၩဖါအဲၪအဖိၪခွၫတၭ, ကယဲအနၫ့ဆါဒၪဝ့ၫ မၩဆၧထီးအလူၬနီၪ, ဒုၭနဲၪအဝ့ၫနီၪလီၫ. တၭမိဒုၭ နဲၪအဝ့ၫလၧဆၧမၩဒိၪနဲၪ့အယီၩဒံၭ, ဘဲၫၥိၭ နၥံၪမိ",
			"21": "<sup>21</sup> ထီၫမံၫထီၫမၪလီၫ.- အဂဲးဘဲၫယီၩ ဘဲၫဖါဒုၭဂဲထုၪ့ ထဲၩ့ဆၧတၭ, မၩမၧၫ့ထၪ့ထဲၩ့ၦၥံၫအၥိၭနီၪ ထီးဒၪ ၦလၧအဖိၪခွၫ မိဒုၭမၧၫ့ထၪ့ထဲၩ့ ဘၪအၥၭလဂၩဂၩ",
			"22": "<sup>22</sup> နီၪ,မၩဝ့ၫဘဲၫနီၪအၥိၭဆ့လီၫ.- အဂဲးဘဲၫယီၩဖါ စ့ၩရၫ့ၦနးဂၩအ့ၬ. အ့ၪမွဲဖ့ၪလၫ့ ကယဲဆၧစ့ၩရၫ့ထီး",
			"23": "<sup>23</sup> အလူၬလၧအဖိၪခွၫအစူၪဖၧၩ့,- ဘဲၫၦထီးအလူၬ မိယူၭထၪ့ယၪ့ထၪ့ဖိၪခွၫ ဘဲၫအယူၭထၪ့ယၪ့ထၪ့ဖါ အၥိၭနီၪလီၫ. ၦလၧအလယူၭလယၪ့ဘၪဖိၪခွၫနီၪ, မွဲ အယူၭယၪ့ဖါ လၧအအၪ့မၧၫ့လၩ့န့အဝ့ၫနီၪ ဆ့အ့ၬ.",
			"24": "<sup>24</sup> ယလီၩဘၪနၥံၪ တီၩတီၩလီၩ့လီၩ့, ၦလၧအနါဂၧၫ့ယ လူယထၫတၭ, နဲၩထဲၩ့ၦလၧအအၪ့မၧၫ့လၩ့န့ယၧၩ နီၪ,မွဲအအီၪလၧဆၧမၧၫ့လၩ့ဆိၩလၩ့ကၠၪတၭ, လဘၪ ဘၪဆၧစ့ၩရၫ့စၪဝ့ၫတၭ, ခၫ့ဂၬခွံၬယူၭ လၧဆၧၥံၫ",
			"25": "<sup>25</sup> နီၪ,ထီၩ့လၧဆၧမၧၫ့အဖၧၩ့လီၫ.- ယလီၩဘၪနၥံၪ တီၩတီၩလီၩ့လီၩ့လၧအဆၧၫ့အထီမိဘၪတၭ, ဘၪယူၭ ဘိၩ့နဲၪ့ယီၩယူၭ, လၧၦအၥံၫဝ့ၫလဖၪနီၪမိနါဂၧၫ့ယွၩ အဖိၪခွၫအလူတၭ, ၦလၧအနါဂၧၫ့ဝ့ၫလဖၪနီၪ,မိ",
			"26": "<sup>26</sup> မၧၫ့ထၪ့ထဲၩ့ဝ့ၫလီၫ.- အဂဲးဘဲၫယီၩ ဘဲၫဖါအီၪလၧဆၧ မၧၫ့လၧအဖၧၩ့ဒၪဝ့ၫအၥိၭနီၪ, မွဲအဒုၭအီၪဖိၪခွၫလၧ",
			"27": "<sup>27</sup> ဆၧမၧၫ့လၧအဖၧၩ့ဒၪဝ့ၫဘဲၫနီၪအၥိၭဆ့လီၫ.- အ အဝ့ၫဒၪမွဲၦၡၩအဖိၪခွၫအကၠီၩ့နီၪ, ဆၧဖ့ၪလၫ့အဝ့ၫလၧ",
			"28": "<sup>28</sup> ဆၧအစီၩ့အမၩ့ဘဲၫၥိၭအမိစ့ၩရၫ့ဆၧလီၫ.- ထီးဆီၫ့ မီၪ့လၩ့လၭနၥံၪအၥၭ လၧဆၧယီၩအကၠီၩ့လဂ့ၩ, အ ဂဲးဘဲၫယီၩအဆၧၫ့အထီ မိဘၪဝ့ၫလၧကယဲၦအီၪ လၧဆၧၥွၪခိၪအဖၧၩ့ကိၭဂၩဒ့ၭနီၪ, မိနါဂၧၫ့ဘၪအလူ,",
			"29": "<sup>29</sup> တၭမိဂဲၫထဲၩ့ထၪ့ဝ့ၫၦလၧအမၩယူၭဆၧဂ့ၩလဖၪ နီၪ, လၧဆၧမၧၫ့အဆၧဂဲထုၪ့ထဲၩ့ဝ့ၫတၭ, ၦလၧအမၩ ယူၭဆၧအၧၩ့လဖၪနီၪ, လၧဆၧစ့ၩရၫ့စၪအဆၧ ဂဲထုၪ့ထဲၩ့ဝ့ၫလီၫ.",
			"30": "<sup>30</sup> ယမၩဒၪယဆၧၥ့ၪနးမံၩ့အ့ၬ. ဘဲၫယနါဂၧၫ့ဆၧ အၥိၭနီၪ,ယစ့ၩရၫ့ဆၧနီၪမွဲအတီၩအလီၩ့လီၫ. အဂဲး ဘဲၫယီၩယအၪ့ဎၬမၩထီးယၥၭဒၪယဝ့ၫမွဲအ့ၬ. မွဲထီး ဒၪၦလၧအအၪ့မၧၫ့လၩ့န့ယၧၩလဂၩအၥၭနီၪလီၫ.",
			"31": "<sup>31</sup> ယအ့ၪထိးယၥၭလၧယဂဲးယကၠီၪ့ဒၪယဝ့ၫတၭ,",
			"32": "<sup>32</sup> ယဆၧထိးယၥၭနီၪတီၩအ့ၬ.- ၦဂူၫဂၩထိးအၥၭလၧ ယဂဲးယကၠီၪ့အီၪဝ့ၫလဂၩတၭ, ယၥ့ၪယၫဆၧလၧ အဝ့ၫဒၪထိးအၥၭလၧ ယဂဲးယကၠီၪ့နီၪမွဲအတီၩလီၫ.",
			"33": "<sup>33</sup> နၥံၪဝ့ၫယီၩ, နၥံၪအၪ့မၧၫ့ၦလ့ၩလၧစယီဟၫ့အအီၪ တၭ,အဝ့ၫဒၪထိးအၥၭလၧဆၧမွဲဆၧတီၩလီၫ.",
			"34": "<sup>34</sup> မွဲလါနၫ့ဘိၩ့ၦၡၩအဆၧထိးအၥၭနီၪ, ယထိးဆၧၫ့ယ ဝ့ၫအ့ၬ. မွဲဘဲၫၥိၭနၥံၪမိထီၩ့လၧဆၧထိးထဲၩ့တၩ့ထဲၩ့",
			"35": "<sup>35</sup> နၥံၪတၭ, ယချဲၩ့ဆၧလဖၪယီၩလီၫ.- အဝ့ၫနီၪမွဲမ့ၪ ဒိၩ့လၧအခဲၩဖၩ့ထၪ့တၭ, နၥံၪအၥၭအီၪလၧနၥံၪမိၥုၪ့",
			"36": "<sup>36</sup> ထိၬၥၭထိၬ လၧအဆၧဖၩ့အကျၩလဆိလီၫ.- ယ အီၪလၧဆၧထိးအၥၭဂ့ၩနဲၪ့ စယီဟၫ့အဆၧထိးအၥၭ ဒံၭလီၫ. အဂဲးဘဲၫယီၩဆၧမၩလၧဖါဖ့ၪလၫ့ယၧၩ, ဘဲၫ ၥိၭယမိမၩထီးအဂီၩ့တၭ, ဆၧမၩလၧယမၩလဖၪ ယီၩထိးအၥၭလၧယဂဲး လၧဖါအၪ့မၧၫ့လၩ့န့ယၧၩ",
			"37": "<sup>37</sup> လီၫ.- တၭဖါလၧအအၪ့မၧၫ့လၩ့န့ယၧၩနီၪထိးယူၭ အၥၭလၧယဂဲးယကၠီၪ့ယူၭလီၫ. အလူၥီၫနီၪနၥံၪနါ ဂၧၫ့နးဖၧၫ့အ့ၬ.အခံးအဂၩ့နီၪ နၥံၪဒၪဘၪနးဆိၭ",
			"38": "<sup>38</sup> အ့ၬ.- အလူအထၫနီၪအီၪဂုးခၧၫ့ဝ့ၫလၧနၥံၪအဖၧၩ့ အ့ၬ.အဂဲးဘဲၫယီၩ ၦလၧအအၪ့မၧၫ့လၩ့ဝ့ၫလဂၩနီၪ နၥံၪနဲၩအဝ့ၫဒၪအ့ၬ.",
			"39": "<sup>39</sup> ဆၧကွ့ၭအၥၭလဖၪနီၪအၪ့ဎၬယိနၥံၪဝ့ၫဆံၭး အဂဲးဘဲၫယီၩနၥံၪဆီၫ့မီၪ့ လၧနၥံၪမိန့ဘၪဆၧမၧၫ့လၩ့ ဆိၩလၩ့ကၠၪလၧအဖၧၩ့တၭ, အဝ့ၫၥံၪမွဲဆၧထိးအၥၭ",
			"40": "<sup>40</sup> လၧယဂဲးယကၠီၪ့လီၫ.- ဘဲၫၥိၭနၥံၪမိန့ဘၪဆၧမၧၫ့",
			"41": "<sup>41</sup> နီၪ,နၥံၪမိဂဲၫလၧယအီၪအ့ၬ.- ၦၡၩအၪ့အူၭဆၧနီၪ",
			"42": "<sup>42</sup> ယထိးဆၧၫ့ယဝ့ၫအ့ၬ.-အ့ၪမွဲယၥ့ၪယၫနၥံၪ, လၧ",
			"43": "<sup>43</sup> ယွၩအဆၧအဲၪလအီၪဘၪလၧနၥံၪအဖၧၩ့လီၫ.- ယဝ့ၫ ဒၪယီၩယဂဲၫလၧယဖါအမံၩ့တၭ နၥံၪထိးဆၧၫ့ယၧၩ အ့ၬ.အ့ၪမွဲၦဂူၫဂၩနီၪ အ့ၪဂဲၫလၧအမံၩ့ဒၪဝ့ၫနီၪ, နၥံၪ",
			"44": "<sup>44</sup> မိထိးဆၧၫ့အဝ့ၫလီၫ.- နၥံၪထိးဆၧၫ့ဆၧအၪ့အူၭထၪ့ လိၬနၥံၪအၥၭလဂၩဒဲလဂၩတၭ, ယွၩအဆၧအၪ့အူၭ နီၪနၥံၪ လအၪ့ဎူၫအၪ့ဎၬဘၪတၭ, နၥံၪနဲၩဆၧမိၥ့ၪ ဘဲၫၥ့ၪလဲၪ.",
			"45": "<sup>45</sup> ထီးဆီၫ့မီၪ့လၧယမိအီၪက့ၪဆၧမၪ လၧနၥံၪအလီၩ့ လၧဖါအအီၪနီၪလဂ့ၩ, ၦအီၪက့ၪဆၧမၪ လၧနၥံၪအ လီၩ့အီၪဒံၭလဂၩဒံၭး မွဲၦလၧနၥံၪဒိၭနဲၩ့နၥံၪအၥၭ",
			"46": "<sup>46</sup> လၧအစူၪဖၧၩ့စမိစ့ၭနီၪလီၫ.- အဂဲးဘဲၫယီၩ နၥံၪအ့ၪ နဲၩစမိစ့ၭနီၪ, နၥံၪမိနဲၩယၧၩဆ့, အဂဲးဘဲၫယီၩ အဝ့ၫ",
			"47": "<sup>47</sup> ဒၪကွ့ၭဆၧလၧယဂဲးယကၠီၪ့လီၫ.- နၥံၪအ့ၪလနဲၩ ဘၪဆၧလၧအဝ့ၫဒၪ ကွ့ၭဝ့ၫလဖၪနီၪး နၥံၪနဲၩယဆၧ ချဲၩ့လဖၪယီၩမိၥ့ၪဘဲၫၥ့ၪလဲၪ."
		},
		"6": {
			"1": "<sup>1</sup> ဆၧလဖၪနီၪအလးခဲၫ့တၭ, ယ့ၫၡုၬခၫ့ဂၬကွံၩဂၫ",
			"2": "<sup>2</sup> လလံၫလၧအမွဲတဘံရအၭလၧဝါလခီၫလီၫ.- ၦခမျၧး ဒၪဘၪအမၩဆၧလၩ့လၭ လၧၦစူၭၦဆၫအလီၩ့တၭ,",
			"3": "<sup>3</sup> ဖိၬထၪ့အခဲၫ့လီၫ.- ယ့ၫၡုၬလ့ၩထၪ့ဝ့ၫလၧခိၪလီၩ့လ ဖျိၪ့အလီၩ့ဆၧၫ့နၩ့ဝ့ၫလၧအထံၩအဖျဲၥံၪ အၥိၭထီးနီၪ",
			"4": "<sup>4</sup> လီၫ.- လၩ့ဘူၭလၧအမိဘၪၦယုဒၫဖိၪအဘိၪ့လ့ၩဖၬ",
			"5": "<sup>5</sup> နီၪဆ့လီၫ.- ယ့ၫၡုၬစၪ့ထၪ့အမ့ၬၥၪဒၪဘၪၦခမျၧးဖၭ ဒိၪဂဲၫလၧအအီၪတၭ, စံၭစဖံလံၭနီၪ, ဘဲၫအဝ့ၫၥံၪမိ",
			"6": "<sup>6</sup> အၪ့ဘၪဆၧအၥိၭပဎွ့ၩကိၪနီၪမိန့ခီၫခီၫလဲၪ.- ဘဲၫၥိၭ အမိမၩခွါအဝ့ၫဒၪတၭ, စံၭဆၧဘဲၫနီၪအၥိၭလီၫ. အ ဂဲးဘဲၫယီၩမွဲအမိမၩဝ့ၫဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪနီၪ အနၫ့",
			"7": "<sup>7</sup> ဆါၥ့ၪယၫဒၪဝ့ၫလီၫ.- စဖံလံၭစံၭဆၧၫ့အဝ့ၫ, ဘဲၫၥိၭ အဝ့ၫၥံၪမိန့ဘၪဂၩဆံၭဂၩဆံၭတၭ, ကိၪအဎွ့ၩဒန့ရံၫ",
			"8": "<sup>8</sup> နံၫယၩလၧၫ့အ့ၬ.- အထံၩအဖျဲစအၫ့ဒူၫ,လၧအထၧၫ့",
			"9": "<sup>9</sup> ဖုဝဲလၧစစဲမၧၫ့ပံတၧၫလဂၩ,- စံၭအဝ့ၫဖိၪၥၪအီၪထီး ယီၩလဂၩအကိၪအီၪယဲလီၪ့, ဒဲအယၪအီၪနံၫဘံၪ့လီၫ. မွဲလါနၫ့ဘိၩ, ဆၧလဖၪနီၪ လၧၦၡၩဎွ့ၩယီၩအဂးမွဲ",
			"10": "<sup>10</sup> ဆၧနီၪလဲၪ.- ယ့ၫၡုၬစံၭဝ့ၫ, အၪ့မၧၫ့ၦၡၩဆၧၫ့နၩ့ဒံၩ့ ခံၫ့ဘီၪ.လၧအလးထီးနီၪ နၪ့အီၪအၪမၬလီၫ. မၩအ ၥၭဘဲၫနီၪတၭ, ၦဆၧၫ့နၩ့ဒံၩ့ခံၫ့လဖၪနီၪ အီၪဖိၭဘိၭ",
			"11": "<sup>11</sup> ယဲထီၫ့လီၫ.- ယ့ၫၡုၬမၩန့ကိၪနီၪ, စံၭထၪ့အၪ့အူၭဆၧ အခိးအတၩဂီၩ့, ဖ့ၪလၫ့ၦလၧအဆၧၫ့နၩ့ဒံၩ့ခံၫ့လဖၪ နီၪလီၫ. ဘဲၫနီၪအၥိၭယၪနံၫဘံၪ့နီၪ, ထီးဒၪၦမိန့ဘၪ",
			"12": "<sup>12</sup> အၥၭလီၫ.- ထီးအဝ့ၫၥံၪအၪ့ဘျဲၩအၪ့ဝ့ၫတၭ, ဘဲၫၥိၭ ဆၧထီးလၩ့မါနးဆံၭလဂ့ၩ, အဝ့ၫဒၪလီၩဘၪအထံၩ",
			"13": "<sup>13</sup> အဖျဲၥံၪ အၪ့ထုၫ့ကီၪ့ထဲၩ့အဘျဲၪအဆဲဘီၪ.- မၩအ ၥၭဘဲၫနီၪတၭ,ၦအၪ့ကိၪယဲလီၪ့နီၪ, အဘျဲၪအဆဲအီၪ လၩ့ထးဝ့ၫ,အဝ့ၫၥံၪအၪ့ထုၫ့ကီၪ့ထဲၩ့ဝ့ၫ, ဎွ့ၩဒၩ့လဆံၫ နံၫဖျိၪ့လီၫ.",
			"14": "<sup>14</sup> မၩအၥၭဘဲၫနီၪတၭ, ၦလဖၪနီၪဒၪဘၪလၧယ့ၫၡုၬ မၩဆၧလၩ့လၭတၭ, စံၭဝ့ၫ,အယီၩမွဲမၬ, မီၪလၧအဂဲၫ",
			"15": "<sup>15</sup> လၩ့လၧဂၪ့ခိၪယီၩလဂၩလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ယ့ၫၡုၬၥ့ၪယၫဝ့ၫ လၧအဝ့ၫၥံၪမိဂဲၫမၩန့ဆီၪ့ဝ့ၫ, ဘဲၫ ၥိၭအမိဒုၭကဲၪထၪ့လၧစဎွၩတၭ, လ့ၩထၪ့ဒီၭဝ့ၫလၧ ခိၪလီၩ့အလီၩ့လဂၩဎးလီၫ.",
			"16": "<sup>16</sup> ထီးမုဂၪလၩ့နီၪအထံၩအဖျဲၥံၪလ့ၩလၩ့ဝ့ၫလၧ",
			"17": "<sup>17</sup> ကွံၩနဲၩ့တၭ,- ထၪ့ဝ့ၫလၧချံၫဖၧၩ့နီၪခၫ့ဂၬကွံၩမိထဲၩ့ ထဲၩ့ဝ့ၫလၧကပၧနအၫ့နီၪလီၫ. ထီးနီၪလဖၧၫ့ ဆၧခံၭ လၩ့တၭ, ယ့ၫၡုၬဂဲၫလထီၩ့ဒံၭဘၪ လၧအဝ့ၫၥံၪအ",
			"18": "<sup>18</sup> အီၪလီၫ.- လံၩအူၪဆၧဆီၪ့တၭ, လပီၩထၪ့ဝ့ၫဖၭ",
			"19": "<sup>19</sup> ဒိၪလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, အဝ့ၫၥံၪကၧးတငၨၭ ထီးစတ့ဒအၫ့ နံၫဆံၫယဲ ဘူၭထၪ့ၥၧၫ့ဆံၫတၭ, ဒၪဘၪ ယ့ၫၡုၬစဲၪ့လၧကွံၩဖၧၩ့ လၧထံၫဖံၭခိၪတၭ, ဂဲၫဘူၭထၪ့",
			"20": "<sup>20</sup> လၧချံၫနဲၩ့ထံၭနီၪ, အဝ့ၫၥံၪၥၭမဲၪဝ့ၫဒၪလီၫ.- အဝ့ၫဒၪ",
			"21": "<sup>21</sup> စံၭအဝ့ၫၥံၪ,မွဲယၧၩတၭ, ထီးၥၭမဲၪလဂ့ၩ.- မၩအၥၭ ဘဲၫနီၪတၭ, အဝ့ၫၥံၪအၥုၪ့ထိၬအၥၭထိၬတၭ, ထိးဆၧၫ့ အဝ့ၫလၧချံၫဖၧၩ့တၭ, ချံၫနီၪထီၩ့ချဲၫ့မၬ လၧအမိ လ့ၩဝ့ၫအလးလီၫ.",
			"22": "<sup>22</sup> ကဲဂီၩခိၬလနံၩနီၪၦခမျၧးဆၧၫ့ထုၪ့လၧကွံၩနဲၩ့ထံၭ နီၪ,ၥ့ၪယၫဝ့ၫလၧချံၫအဂူၫဂၩလအီၪဘၪ, အီၪန့ၫလၧ အထံၩအဖျဲၥံၪ လ့ၩနုၬဝ့ၫလဖျိၪ့နီၪတၭ, ယ့ၫၡုၬလ့ၩ ထၪ့ဎုၬဝ့ၫလၧချံၫဖၧၩ့လၧအထံၩအဖျဲၥံၪ အၥိၭအ့ၬ,စဲၪ့",
			"23": "<sup>23</sup> ထၪ့န့ၫအထံၩအဖျဲၥံၪလီၫ.- မွဲလါနၫ့ဘိၩချံၫအဂူၫဂၩ လဖၪဂဲၫလၧတဘံရအၭ ဘူၭလၧအလးလၧကဆါစံၭ ထၪ့အၪ့အူၭဆၧအခိးအတၩ လၧအဝ့ၫၥံၪအၪ့ကိၪနီၪ",
			"24": "<sup>24</sup> လီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ထီးၦခမျၧးၥ့ၪယၫဝ့ၫလၧ ယ့ၫၡုၬမွဲဂ့ၩ, အထံၩအဖျဲၥံၪမွဲဂ့ၩ, လအီၪဘၪထီးနီၪ တၭ,အဝ့ၫၥံၪထူၬထၪ့ချံၫတၭ, လ့ၩအၪ့ဎူၫအၪ့ဎၬယ့ၫ ၡုၬထီၩ့လၧကပၧနအၫ့လီၫ.",
			"25": "<sup>25</sup> ထီးအဝ့ၫၥံၪ ဒၪဘၪအဝ့ၫ လၧကွံၩဝါလခီၫတၭ, စံၭအဝ့ၫ,ရၭဘံၫဧ့, နဂဲၫထီးယီၩထီၩ့ဆံၭယံၬ ယူၭ",
			"26": "<sup>26</sup> လဲၪ.- ယ့ၫၡုၬချဲၩ့ဆၧၫ့အဝ့ၫၥံၪ, စံၭဝ့ၫ,ယလီၩဘၪ နၥံၪတီၩတီၩလီၩ့လီၩ့, နၥံၪဝ့ၫယီၩ, မွဲနၥံၪဒၪ ဘၪဆၧလၩ့လၭအကၠီၩ့နီၪ နၥံၪအၪ့ဎၬယၧၩအ့ၬ,",
			"27": "<sup>27</sup> မွဲနၥံၪအၪ့ဘၪကိၪဘျဲၩအၪ့အကၠီၩ့လီၫ.- ဘဲၫၥိၭ နၥံၪမိန့ဘၪဆၧအၪ့လၧ အဂၭဂီၩ့ၥ့ၪနီၪ, ထီးမၩလဂ့ၩး အ့ၪမွဲဘဲၫၥိၭနၥံၪမိန့ဘၪဆၧအၪ့လၧအဂုးခၧၫ့ဝ့ၫ လၧဆၧမၧၫ့လၩ့ဆိၩလၩ့ကၠၪ လၧၦၡၩအဖိၪခွၫ မိဖ့ၪ လၫ့နၥံၪတၭ, အၪ့ဂူၬမၩနၥံၪဝ့ၫဆံၭ. အဂဲးဘဲၫယီၩ အဝ့ၫလဂၩနီၪ ဖါယွၩလဂၩစဲၩနဲၪ့ထၬဝ့ၫဒၪလီၫ.",
			"28": "<sup>28</sup> မၩအၥၭဘဲၫနီၪတၭ, အဝ့ၫၥံၪစံၭဝ့ၫ, ဘဲၫၥိၭပမိမၩ",
			"29": "<sup>29</sup> ယွၩအဆၧမၩနီၪ, မွဲပမိဘၪမၩဘဲၫၥ့ၪလဲၪ.- ယ့ၫၡုၬ ချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭအဝ့ၫၥံၪ, ယွၩအဆၧမၩနီၪ, မွဲအ ယီၩ, ဘဲၫၥိၭနၥံၪမိနဲၩထဲၩ့ၦလၧအအၪ့မၧၫ့လၩ့န့",
			"30": "<sup>30</sup> ဝ့ၫလဂၩနီၪလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, အဝ့ၫၥံၪ, စံၭ အဝ့ၫ,နမၩလၩ့လၭဆၧဘဲၫၥိၭ ပမိဒၪဘၪပဝ့ၫ, ဒဲနဲၩ ထဲၩ့နၧၩနီၪ,မွဲဆၧနီၪလမံၩ့လဲၪ. မွဲနမၩဆၧနီၪလဲၪ.",
			"31": "<sup>31</sup> ပဖါၥံၪအၪ့မၪ့နၫလၧမံၩ့လၬကျၩဘဲၫဆၧကွ့ၭအ ၥၭအၥိၭနီၪ, အဝ့ၫဒၪ ဖ့ၪအၪ့အဝ့ၫၥံၪ ကိၪလၧမူၭခိၪ",
			"32": "<sup>32</sup> လီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ယ့ၫၡုၬစံၭအဝ့ၫၥံၪ, ယ လီၩဘၪနၥံၪ တီၩတီၩလီၩ့လီၩ့ စမိစ့ၭဖ့ၪလၫ့နၥံၪအ ကိၪလၧမူၭခိၪနီၪအ့ၬ. အ့ၪမွဲယဖါနီၪ, ဖ့ၪလၫ့နၥံၪ",
			"33": "<sup>33</sup> အကိၪလၩ့ထံးလၩ့ဆ့ၭ လၧမူၭခိၪလီၫ.- အဂဲးဘဲၫ ယီၩၦလၧအဂဲၫလၩ့လၧမူၭခိၪတၭ, ဖ့ၪလၫ့ဆၧမၧၫ့ လၧၦဂၪ့ခိၪဖိၪလဂၩနီၪ, မွဲယွၩအကိၪလီၫ.",
			"34": "<sup>34</sup> မၩအၥၭဘဲၫနီၪတၭ, အဝ့ၫၥံၪစံၭအဝ့ၫ, ကဆါဧ့,",
			"35": "<sup>35</sup> ဖ့ၪလၫ့ပၧၩလၧကိၪနီၪထံၪဎးဆံၭ.- ယ့ၫၡုၬစံၭအဝ့ၫ ၥံၪယမွဲကိၪမၧၫ့လီၫ. ၦလၧအဂဲၫ လၧယအီၪလဂၩ နီၪ,ဆၧလမိၥၭဝံလၧၩ့ဘၪအၥၭ,ဒဲၦလၧအနဲၩထဲၩ့ ယၧၩလဂၩနီၪ, ဆၧမိၥၭဝံလၧၩ့အၥၭလၧထံၫနး",
			"36": "<sup>36</sup> ဆိၭအ့ၬ.- မွဲလါနၫ့ဘိၩ ယစံၭနၥံၪလၧနၥံၪဒၪဘၪဆ့",
			"37": "<sup>37</sup> ယူၭယၧၩတၭ, နၥံၪနဲၩအ့ၬ.- ကယဲၦလၧယဖါဖ့ၪ လၫ့ယၧၩလဂၩဂၩနီၪ, မိဂဲၫထဲၩ့လၧယအီၪလီၫ. ၦ လၧအဂဲၫလၧယအီၪနီၪ, ယခွံၬၡိၭခွံၬယဝ့ၫလၩ",
			"38": "<sup>38</sup> လါအ့ၬ.- အဂဲးဘဲၫယီၩ မွဲယဂဲၫလၩ့လၧမူၭခိၪနီၪ လမွဲ ဘၪဘဲၫၥိၭ ယမိမၩထီးဒၪယၥၭ, အ့ၪမွဲထီးဒၪၦလၧအ",
			"39": "<sup>39</sup> အၪ့မၧၫ့လၩ့န့ယၧၩလဂၩအၥၭလီၫ.- ၦလဂၩလၧ အအၪ့မၧၫ့လၩ့န့ယၧၩအၥၭမွဲအယီၩ, ကယဲၦလၧ အဖ့ၪလၫ့ယၧၩလဂၩဂၩနီၪ, ဘဲၫၥိၭအထီးလၩ့မါဘၪ နးဂၩလဂ့ၩ, မွဲဘဲၫၥိၭယမိဒုၭဂဲထုၪ့ထဲၩ့အဝ့ၫ လၧမု",
			"40": "<sup>40</sup> နံၩအထုၬခိၬနီၪလီၫ.- တၭဖါလၧအအၪ့မၧၫ့လၩ့န့ ယၧၩလဂၩအၥၭမွဲအယီၩ, ဘဲၫၥိၭၦလၧအဒၪဘၪ ဖိၪခွၫ,ဒဲနဲၩထဲၩ့အဝ့ၫ လဂၩဂၩ နီၪ, မိန့ဘၪဆၧမၧၫ့ လၩ့ဆိၩလၩ့ကၠၪတၭး ယမိဒုၭဂဲထုၪ့ထဲၩ့အဝ့ၫ လၧမု နံၩအထုၬခိၬလီၫ.",
			"41": "<sup>41</sup> မၩအၥၭဘဲၫနီၪတၭ, အဝ့ၫဒၪစံၭဝ့ၫ, ယဝ့ၫဒၪယီၩ ယမွဲကိၪဂဲၫလၩ့လၧမူၭခိၪနီၪ, ၦယုဒၫဖိၪၥူၭဝံၪၥူၭလၩ",
			"42": "<sup>42</sup> ဆၧလၧဆၧနီၪလမံၩ့အဂဲး- စံၭဝ့ၫ,ၦယီၩမွဲစယိၥၭအ ဖိၪခွၫ ယ့ၫၡုၬလဂၩနီၪမွဲအ့ၬဧၪ. အမိဒဲအဖါနီၪပ ၥ့ၪယၫမွဲအ့ၬဧၪ. အခိးမွဲဘဲၫနီၪတၭ, မွဲဘၪနီၫလၧအ",
			"43": "<sup>43</sup> စံၭဝ့ၫယဂဲၫလၩ့ လၧမူၭခိၪနီၪလဲၪ.- ယ့ၫၡုၬချဲၩ့ဆၧၫ့ ဆၧတၭ,စံၭအဝ့ၫၥံၪ, နၥံၪချဲၩ့ဒုၪ့လိၬနၥံၪအၥၭနီၪ,",
			"44": "<sup>44</sup> ထီးၥူၭဝံၪၥူၭလၩဆၧလဂ့ၩ.- ယဖါလၧအအၪ့မၧၫ့ လၩ့န့ယၧၩလဂၩ အ့ၪလမီၩ့ဘၪဝ့ၫနီၪ, ၦၡၩဂဲၫလၧယ အီၪၥ့ၪနးဂၩအ့ၬ.ယမိဒုၭဂဲထုၪ့ထဲၩ့အဝ့ၫလၧမုနံၩ",
			"45": "<sup>45</sup> အထုၬခိၬလီၫ.- ဆၧကွ့ၭအၥၭလၧမီၪၥံၪအဖၧၩ့, ယွၩ မိၥီၪ့လိၪအဝ့ၫၥံၪထီးအလူၬနီၪလီၫ. မၩအၥၭဘဲၫ နီၪတၭ,ကယဲၦလၧအနါဂၧၫ့ ဖါအဆၧချဲၩ့ဒဲမၩလိၪဝ့ၫ",
			"46": "<sup>46</sup> လဖၪနီၪ,ဂဲၫဝ့ၫလၧယအီၪလီၫ.- အ့ၪလမွဲဘၪၦလ ဂၩလၧအဂဲၫလၩ့လၧယွၩအအီၪနီၪ, ၦဒၪဘၪဖါနး ဂၩအ့ၬ.အဝ့ၫနီၪဒၪဘၪဖါလီၫ.",
			"47": "<sup>47</sup> ယလီၩဘၪနၥံၪတီၩတီၩလီၩ့လီၩ့, ၦလၧအနဲၩ့ထဲၩ့ ယၧၩလဂၩဂၩနီၪ, အီၪဝ့ၫလၧဆၧမၧၫ့ လၩ့ဆိၩလၩ့",
			"48": "<sup>48</sup> ကၠၪလီၫ.- ယဝ့ၫဒၪယီၩ ယမွဲဆၧမၧၫ့အကိၪနီၪ လီၫ.",
			"49": "<sup>49</sup> နၥံၪအဖါၥံၪအၪ့မၪ့နၫ လၧမံၩ့လၬကျၩနီၪၥံၫဝ့ၫ",
			"50": "<sup>50</sup> လီၫ.- အယီၩမွဲကိၪလၧအဂဲၫလၩ့လၧမူၭခိၪ ဘဲၫၥိၭၦ",
			"51": "<sup>51</sup> လၧအအၪ့ဝ့ၫလဂၩဂၩနီၪမိၥံၫဘၪအ့ၬ.- ယဝ့ၫဒၪယီၩ ယမွဲဆၧမၧၫ့အကိၪ လၧအဂဲၫလၩ့လၧမူၭခိၪလီၫ. ဆၧလၧကိၪယီၩၦလၧအအၪ့ဝ့ၫလဂၩဂၩနီၪ မိမၧၫ့ဝ့ၫ လၩ့ဆိၩလၩ့ကၠၪလီၫ. ကိၪလၧယမိဖ့ၪလၫ့နီၪ, မွဲယ ယၪလၧယမိဖ့ၪလၫ့ လၧဂၪ့ခိၪဖိၪအဂးလီၫ.",
			"52": "<sup>52</sup> မၩအၥၭဘဲၫနီၪတၭ, ၦယုဒၫဖိၪၥံၪ တ့ၭလိၬအၥၭ တၭ,စံၭဝ့ၫ, ၦၡၩယီၩဖ့ၪအၪ့ပၧၩလၧအယၪမိၥ့ၪ",
			"53": "<sup>53</sup> ဘဲၫၥ့ၪလဲၪ.- မၩအၥၭဘဲၫနီၪတၭ ယ့ၫၡုၬလီၩဘၪအ ဝ့ၫၥံၪ,ယစံၭနၥံၪတီၩတီၩလီၩ့လီၩ့, နၥံၪအ့ၪလအၪ့ ဘၪၦၡၩအဖိၪခွၫအယၪ, နၥံၪအ့ၪလအီၩဘၪအၥွံၪ",
			"54": "<sup>54</sup> နီၪဆၧမၧၫ့အီၪလၧနၥံၪအဖၧၩ့အ့ၬ.- ၦလၧအအၪ့ ယယၪဒဲအီၩယၥွံၪနီၪ မွဲအအီၪလၧဆၧမၧၫ့လၩ့ဆိၩ လၩ့ကၠၪတၭ, ယမိဒုၭဂဲထုၪ့ထဲၩ့အဝ့ၫလၧမုနံၩအထုၬ",
			"55": "<sup>55</sup> ခိၬလီၫ.- အဂဲးဘဲၫယီၩ ယယၪမွဲဆၧအၪ့လၩ့ထံးလၩ့ ဆ့ၭတၭ,ယၥွံၪမွဲဆၧအီၩလၩ့ထံးလၩ့ ဆ့ၭဆ့လီၫ.",
			"56": "<sup>56</sup> ၦလၧအအၪ့ယယၪဒဲ အီၩယၥွံၪနီၪမွဲအအီၪဂုးခၧၫ့ဝ့ၫ လၧယဖၧၩ့တၭ, ယအီၪယဝ့ၫလၧအဖၧၩ့ဆ့လီၫ.",
			"57": "<sup>57</sup> ဘဲၫဖါလၧအမၧၫ့နီၪ အၪ့မၧၫ့လၩ့န့ယၧၩ, ဒဲယမၧၫ့လၧ အဝ့ၫနီၪအကၠီၩ့အၥိၭတၭ, ၦလၧအအၪ့ယၧၩနီၪ,",
			"58": "<sup>58</sup> မိမၧၫ့ဝ့ၫလၧယကၠီၩ့ဆ့လီၫ.- ဆၧယီၩမွဲကိၪလၧအဂဲၫ လၩ့လၧမူၭခိၪလီၫ. မွဲဘဲၫနၥံၪအဖါၥံၪ အၪ့မၪ့နၫတၭ ၥံၫဝ့ၫအၥိၭနီၪမွဲအ့ၬ. ၦလၧအအၪ့ကိၪယီၩ, မိမၧၫ့ ဝ့ၫအဆိၩဆိၩအကၠၪကၠၪလီၫ.",
			"59": "<sup>59</sup> ဆၧယီၩလဖၪ မွဲအလီၩလၩ့လၬလၩ့ဝ့ၫ လၧၥရိၬ ဖၧၩ့, ထီးအၥီၪ့ဆၧၥၫ့ဆၧ လၧကပၧနအၫ့အဘိၩ့ဘၭ နီၪလီၫ.",
			"60": "<sup>60</sup> မၩအၥၭဘဲၫနီၪတၭ, အထံၩအဖျဲ အၪဂၩနါဂၧၫ့ ဝ့ၫတၭ, စံၭဝ့ၫ, ဆၧချဲၩ့ယီၩကၪမၬလီၫ. မွဲပလၫခိၭနၪ မိၥ့ၪနးဂၩလဲၪ.",
			"61": "<sup>61</sup> ယ့ၫၡုၬၥ့ၪယၫလၩ့အၥၭဒၪဝ့ၫ, လၧအထံၩအဖျဲၥံၪ ၥူၭဝံၪၥူၭလၩဆၧလၧဆၧနီၪအဂဲးတၭ, စံၭအဝ့ၫၥံၪ,လၧ",
			"62": "<sup>62</sup> ဆၧယီၩလမံၩ့အကၠီၩ့မွဲနၥံၪအၥၭ ဂၭဂီၩ့ဆ့ဧၪ.- နၥံၪ အ့ၪဒၪဘၪၦၡၩအဖိၪခွၫယီၩ ထဲၩ့ထၪ့လၧအလးလၧ အအီၪဝ့ၫလၧအခၪ့ထံၭနီၪ, မွဲနၥံၪမိဆီၫ့မီၪ့ဘဲၫၥ့ၪ",
			"63": "<sup>63</sup> လဲၪ.- ဆၧမၩမၧၫ့ထၪ့ဆၧယီၩမွဲၥၭလီၫ. ဆၧဖံၭဆၧ ယၪန့ကဲၩ့န့ကၩဆၧနးမံၩ့အ့ၬ. ဆၧချဲၩ့လဖၪလၧ ယ",
			"64": "<sup>64</sup> လီၩဘၪနၥံၪနီၪ မွဲၥၭဒဲဆၧမၧၫ့လီၫ.- မွဲလါနၫ့ဘိၩလၧ နၥံၪဝ့ၫအကျၩ, ၦလနဲၩဘၪဝ့ၫအီၪလနၩ့နၩ့လီၫ. အ ဂဲးဘဲၫယီၩ လၧအၥၫ့လၧအခၪ့ထံၭနီၪ, ၦလၧအလနဲၩ ဘၪဝ့ၫလဖၪ, ဒဲၦလၧအမိဖ့ၪလၫ့ခွံၬအဝ့ၫလဂၩနီၪ",
			"65": "<sup>65</sup> ယ့ၫၡုၬၥ့ၪယၫဝ့ၫလီၫ.- စံၭဝ့ၫ,မၩအၥၭဘဲၫနီၪတၭ, ယ လီၩဘၪယူၭနၥံၪယူၭး ယဖါအ့ၪလဒုၭဂဲၫဘၪၦၡၩ လၧယအီၪတၭ,ၦဂဲၫထီၩ့ဝ့ၫ ၥ့ၪနးဂၩအ့ၬ.",
			"66": "<sup>66</sup> ခီၫဒၪလၧအဆၧၫ့အထီနီၪတၭ, အထံၩအဖျဲၥံၪအၪ",
			"67": "<sup>67</sup> ဂၩထဲၩ့ထဲၩ့ဝ့ၫဒၪဖိၬလၧၩ့အခဲၫ့အ့ၬ.- မၩအၥၭဘဲၫ နီၪတၭ,ယ့ၫၡုၬစံၭ ၦလဆံၫနံၫဂၩနီၪ, မွဲနၥံၪမိထဲၩ့",
			"68": "<sup>68</sup> ဘၪနၥံၪအၥၭဆ့ဧၪ.- စစဲမၧၫ့ပံတၧၫ ချဲၩ့ဆၧၫ့အဝ့ၫ, ကဆါဧ့, မွဲပမိလ့ၩလၧပလၫအအီၪလဂၩလဲၪ. ဆၧ မၧၫ့အဆိၩအကၠၪအဆၧချဲၩ့နီၪအီၪလၧနၧၩလီၫ.",
			"69": "<sup>69</sup> ပနဲၩထဲၩ့ဆၧတၭ, ပၥ့ၪယၫလၧနမွဲယွၩ အဆၧဆံၫ့ဎံၪ လဂၩနီၪလီၫ.",
			"70": "<sup>70</sup> ယ့ၫၡုၬချဲၩ့ဆၧၫ့အဝ့ၫၥံၪ, နၥံၪဝ့ၫယီၩ, ယရွံန့နၥံၪ လဆံၫနံၫဂၩမွဲအ့ၬဧၪ.ၦလၧနၥံၪအကျၩလဂၩနီၪ",
			"71": "<sup>71</sup> မွဲဒုၪဒၩလီၫ.- စံၭဆၧနီၪမွဲအစံၭလၧစစဲမၧၫ့အဖိၪခွၫ စယုဒၭအံၭစကၭရအၧၭ အီၪလၧၦလဆံၫနံၫဂၩ အ ကျၩလၧအမိဖ့ၪလၫ့ခွံၬဝ့ၫ လဂၩနီၪအကၠီၩ့ လီၫ."
		},
		"7": {
			"1": "<sup>1</sup> လၧဆၧနီၪလဖၪအလးခဲၫ့တၭ, ယ့ၫၡုၬစဲၪ့ဝံၩ့ဝၩ့ လၧဂၫလလံၫအဖၧၩ့လီၫ. အဂဲးဘဲၫယီၩ မိစဲၪ့ဝံၩ့ဝၩ့ ဘၪအၥၭလၧခးယုဒၫအဖၧၩ့အ့ၬ. အဂဲးဘဲၫယီၩၦယု",
			"2": "<sup>2</sup> ဒၫဖိၪလဖၪအၪ့ဎၬမၩၥံၫအဝ့ၫဒၪလီၫ.- ၦယုဒၫဖိၪ အ",
			"3": "<sup>3</sup> ဘိၪ့တဲၩနီၪလၩ့ဘူၭလၧအမိဘၪဝ့ၫလီၫ.- မၩအၥၭ ဘဲၫနီၪတၭ, အထၧၫ့ဖုဝဲၥံၪစံၭအဝ့ၫ, ဘဲၫၥိၭနထံၩနဖျဲ ၥံၪမိဒၪဘၪနဆၧမၩလဖၪလၧနမၩနဝ့ၫနီၪ, စဲၪ့ထၪ့ခွံၬ ထီးယီၩတၭ, လ့ၩထီၩ့လၧခးယုဒၫအဖၧၩ့နီၪဘီၪ.",
			"4": "<sup>4</sup> အဂဲးဘဲၫယီၩ ၦအ့ၪအၪ့ဎၬမၩဖျီၪထၪ့အနၫ့ဆါဒၪဝ့ၫ တၭ,မၩၥူၪဆၧနးဂၩအ့ၬ. ဆၧနီၪလဖၪနအ့ၪမၩတၭ,",
			"5": "<sup>5</sup> မၩဖျီၪထၪ့နၥၭ လၧၦဂၪ့ခိၪဖိၪအမ့ၬယၫဘီၪ.- အဂဲး",
			"6": "<sup>6</sup> ဘဲၫယီၩ အထၧၫ့ဖုဝဲၥံၪနဲၩအဝ့ၫဆ့အ့ၬ.- မၩအၥၭ ဘဲၫနီၪတၭ, ယ့ၫၡုၬလီၩဘၪအဝ့ၫၥံၪ, ယမုယလၩဘၪ ဒံၭအ့ၬ. အ့ၪမွဲနၥံၪဝ့ၫဒၪယီၩ, နၥံၪအမုအလၩဘၪ",
			"7": "<sup>7</sup> ဒၪအဆၧလထံၪဎးလီၫ.- ဂၪ့ခိၪဖိၪမ့ၬလဲၩနၥံၪလၥ့ၪ",
			"8": "<sup>8</sup> ဘၪ,အ့ၪမွဲယဝ့ၫဒၪယီၩ, မွဲအမ့ၬလဲၩယၧၩလီၫ.- အဂဲး ဘဲၫယီၩယထိးယၥၭလၧအဆၧမၩနီၪမွဲအအၧၩ့လီၫ. လ့ၩထၪ့နၥံၪဝ့ၫလၧဘိၪ့ဖၧၩ့ဆံၭ. ယဝ့ၫဒၪယလ့ၩဒံၭ",
			"9": "<sup>9</sup> အ့ၬ.အဂဲးဘဲၫယီၩ ယမုယလၩ ဘၪဒံၭအ့ၬ.- လီၩ ဘၪအဝ့ၫၥံၪ လၧဆၧနီၪလဖၪဂီၩ့တၭ, အီၪဝ့ၫလၧ ဂၫလလံၫအဖၧၩ့နီၪလီၫ.",
			"10": "<sup>10</sup> မွဲလါနၫ့ဘိၩ, ထီးအထၧၫ့ဖုဝဲၥံၪ လ့ၩထၪ့ဝ့ၫဂီၩ့, အဝ့ၫဒၪလ့ၩထၪ့ဆ့လၧဘိၪ့ဖၧၩ့နီၪတၭ, အ့ၪမွဲလ့ၩဖျီၪ",
			"11": "<sup>11</sup> ဝ့ၫဒၪအ့ၬ, လ့ၩၥူၪဝ့ၫလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ၦယုဒၫဖိၪလဖၪ အၪ့ဎၬအဝ့ၫလၧဘိၪ့ဖၧၩ့တၭ, စံၭဝ့ၫ,",
			"12": "<sup>12</sup> မွဲအအီၪခီၫခီၫလဲၪ.- ၦခမျၧးၥူၭဝံၪၥူၭလၩဆၧအၪအၪ လ့ၬလၧအဂဲးလီၫ. ၦလနၩ့နၩ့စံၭဝ့ၫလၧအမွဲၦအဂ့ၩ လီၫ.အဂူၫဂၩလနၩ့နၩ့စံၭဝ့ၫမွဲအ့ၬး မွဲၦလၧအအၪ့",
			"13": "<sup>13</sup> လီၫန့ၦခမျၧးနီၪလီၫ.- မွဲလါနၫ့ဘိၩ, လၧအၥၭ မဲၪၦယုဒၫဖိၪအကၠီၩ့တၭး ချဲၩ့ဖျီၪထၪ့ဆၧလၧအ ဂဲးဘုၪ့နးဂၩအ့ၬ.",
			"14": "<sup>14</sup> မၩဘိၪ့ဆၧထီၩ့လၧအၥၭကျၩနီၪ, ယ့ၫၡုၬလ့ၩထၪ့",
			"15": "<sup>15</sup> လၧဆၧလုအဂံၪ့ဖၧၩ့တၭ,ၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ဆၧလီၫ.- ၦ ယုဒၫဖိၪလဖၪထီၫမံၫထီၫမၪဝ့ၫတၭ,စံၭဝ့ၫ,ၦလဂၩ ယီၩလမၩလိၪဘၪဆၧနးဆိၭတၭ, မွဲအၥ့ၪလံၬဘဲၫၥ့ၪ",
			"16": "<sup>16</sup> လဲၪ.- မၩအၥၭဘဲၫနီၪတၭ, ယ့ၫၡုၬချဲၩ့ဆၧၫ့အဝ့ၫၥံၪ, စံၭဝ့ၫ,ယဆၧၥီၪ့ဆၧၥၫ့ယီၩ, လမွဲဘၪယဆၧဒၪယ ဝ့ၫတၭ,မွဲၦလၧအအၪ့မၧၫ့လၩ့န့ယၧၩလဂၩ အဆၧ",
			"17": "<sup>17</sup> လီၫ.- ဆၧၥီၪ့ဆၧၥၫ့နီၪမွဲအဘၪဆဲၫ့လၧယွၩဧၪ, မွဲယ ချဲၩ့ဒၪယဝ့ၫလဲၪ, ၦအ့ၪမိမၩဘၪအၥၭထီးဒၪယွၩအ",
			"18": "<sup>18</sup> ၥၭလဂၩဂၩတၭ,မိၥ့ၪယၫဝ့ၫဒၪလီၫ.- ၦလၧအလီၩ လၩ့လၬလၩ့ဆၧလၧအဂဲးဒၪဝ့ၫနီၪ, မွဲအအၪ့ဎၬအ လၩအဖၩ့ဒၪဝ့ၫလီၫ. ၦလၧအအၪ့ဎၬ ၦလၧအအၪ့ မၧၫ့လၩ့ဝ့ၫလဂၩ အလၩအဖၩ့နီၪ, မွဲအတီၩ အလီၩ့",
			"19": "<sup>19</sup> တၭ,ဆၧလတီၩလလီၩ့ဘၪလၧအဖၧၩ့အ့ၬ.- စမိစ့ၭဖ့ၪ လၫ့နၥံၪလၧဆၧမၪလူၬတၭ, နၥံၪလထီးန့ဘၪဆၧမၪ လူၬနီၪနးဂၩ,မွဲအ့ၬဧၪ. မွဲဘၪနီၫလၧနၥံၪအၪ့ဎၬမၩ",
			"20": "<sup>20</sup> ၥံၫယၧၩလဲၪ.- ၦခမျၧးချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭဝ့ၫ, ဆၧနၪ အီၪလၧနလီၩ့း မွဲပလၫအၪ့ဎၬမၩၥံၫနၧၩလဂၩလဲၪ.",
			"21": "<sup>21</sup> ယ့ၫၡုၬချဲၩ့ဆၧၫ့ဆၧတၭ စံၭအဝ့ၫၥံၪ, ယမၩယူၭဆၧ",
			"22": "<sup>22</sup> လမံၩ့တၭ,နၥံၪထီၫမံၫထီၫမၪထီးအလူၬလီၫ.- စမိစ့ၭ ဖ့ၪလၫ့နၥံၪလၧဆၧကူၭတရံၭလီၫ. မွဲအလဘၪဆဲၫ့ ဘၪလၧစမိစ့ၭတၭ, ဘၪဆဲၫ့လၧဖါၥံၪတၭ, လၧမး",
			"23": "<sup>23</sup> ၥံၫအနံၩနီၪ, နၥံၪကူၭတရံၭၦၡၩလီၫ.- ဘဲၫၥိၭစမိစ့ၭ အဆၧမၪလူၬထီးဘၪ ဆၧလၨၪခၫ့ဖၬဘၪဝ့ၫ လဂ့ၩ တၭ,ၦအ့ၪဒိၭဆၧကူၭတရံၭ လၧမးၥံၫအနံၩနီၪတၭ, ယဝ့ၫဒၪယီၩ ယမၩဆီၪ့ထၪ့ထဲၩ့ၦလဂၩထၧၫ့ဂၩယၫ လၧမးၥံၫအနံၩ အကၠီၩ့နီၪ, မွဲနၥံၪၥၭထၪ့ယၧၩဆ့",
			"24": "<sup>24</sup> ဧၪ.- ထီးစ့ၩရၫ့ဆၧဘဲၫဆၧဖျီၪထၪ့ဝ့ၫအၥိၭလဂ့ၩ, အ့ၪမွဲစ့ၩရၫ့ ဆၧတီၩတီၩလီၩ့လီၩ့ဆံၭ.",
			"25": "<sup>25</sup> မၩအၥၭဘဲၫနီၪတၭ, ၦအီၪလၧယရုစလံၫ့ လနၩ့ နၩ့စံၭဝ့ၫ, အယီၩမွဲၦလၧအဝ့ၫၥံၪအၪ့ဎၬမၩၥံၫဝ့ၫနီၪ",
			"26": "<sup>26</sup> မွဲအ့ၬဧၪ.- ယိခွါ, မွဲအချဲၩ့လၧအၥၭဒူၩလါနၫ့နီၪ, ၦၡၩၥံၪစံၭဆၧနးမံၩ့အ့ၬ. အယီၩမွဲဎရံၬနီၪ, ၦဒိၪၦၡါ",
			"27": "<sup>27</sup> ၥံၪၥ့ၪယၫလၩ့ထံးလၩ့ဆ့ၭဆ့ဧၪ.- မွဲလါနၫ့ဘိၩ့, အယီၩလဂၩအီၪထၪ့ဝ့ၫခီၫခီၫလဲၪနီၪပၥ့ၪယၫ, အ့ၪ မွဲထီးဎရံၬအ့ၪဂဲၫလၩ့ခိၬ, မွဲအမိအီၪထၪ့အထံၭခီၫခီၫ လဲၪနီၪ,ၦၥ့ၪယၫဝ့ၫနးဂၩအ့ၬ.",
			"28": "<sup>28</sup> မၩအၥၭဘဲၫနီၪတၭ, ယ့ၫၡုၬၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ ဆၧ လၧဆၧလုအဂံၪ့ဖၧၩ့အဘိၩ့ဘၭတၭ, ကိၭၡၭထၪ့ဆၧ, စံၭဝ့ၫဒၪ, နၥံၪၥ့ၪယၫယၧၩတၭ, ယအီၪထၪ့အထံၭ ခီၫခီၫလဲၪနီၪ, နၥံၪၥ့ၪယၫဆ့လီၫ. ယဂဲၫလၩ့ဒၪယဝ့ၫ အ့ၬ,ၦလၧအအၪ့မၧၫ့လၩ့ယၧၩလၧနၥံၪလၥ့ၪယၫဘၪ",
			"29": "<sup>29</sup> ဝ့ၫလဂၩနီၪ,မွဲအတီၩအလီၩ့လီၫ.- အ့ၪမွဲယဝ့ၫဒၪယီၩ, ယၥ့ၪယၫအဝ့ၫလီၫ. အဂဲးဘဲၫယီၩ ယဂဲၫလၩ့လၧ",
			"30": "<sup>30</sup> အအီၪတၭ,အဝ့ၫဒၪအၪ့မၧၫ့လၩ့ယၧၩလီၫ.- မၩအၥၭ ဘဲၫနီၪတၭ, ၦအၪ့ဎၬဖီၪ့ထၬအဝ့ၫနီၪ, ၦအီၪက့ၪအ စူၪလၧအလီၩ့နးဂၩအ့ၬ. အဂဲးဘဲၫယီၩအဆၧၫ့အထီ ဘၪဒံၭအ့ၬ.",
			"31": "<sup>31</sup> ၦအီၪလၧၦခမျၧးအကျၩ နဲၩထဲၩ့ဝ့ၫအၪဂၩတၭ စံၭဝ့ၫ,ထီးဎရံၬအ့ၪဂဲၫဝ့ၫနီၪ, မွဲအမိမၩ ဆၧလၩ့လၭ အၪနဲၪ့အယီၩလဂၩမၩဝ့ၫလဖၪဆ့ဧၪ.",
			"32": "<sup>32</sup> ၦဖၫရစံၫလဖၪနါဂၧၫ့ လၧၦခမျၧးၥူၭဝံၪၥူၭလၩဆၧ နီၪလဖၪလၧအဂဲးတၭ, ၦဖၫရစံၫဒဲၦလုဆၧအဒိၪလ",
			"33": "<sup>33</sup> ဖၪနီၪအၪ့မၧၫ့အခ့ၫအၡၩ လ့ၩဖီၪ့ထၬအဝ့ၫလီၫ.- မၩ အၥၭဘဲၫနီၪတၭ,ယ့ၫၡုၬစံၭအဝ့ၫၥံၪ, ယအီၪဒံၭလၧန ၥံၪအၥိၭလယံၬလၧၩ့ဘၪတၭ, ယမိထဲၩ့ထၪ့ထဲၩ့လၧၦ",
			"34": "<sup>34</sup> လၧအအၪ့မၧၫ့လၩ့ယၧၩလဂၩအအီၪလီၫ.- နၥံၪမိအၪ့ ဎၬယၧၩတၭ, နၥံၪဒၪဘၪလၧၩ့ယၧၩအ့ၬ. ထီးယအီၪ",
			"35": "<sup>35</sup> အလးနီၪ,နၥံၪလ့ၩထီၩ့ၥ့ၪဆ့အ့ၬ.- မၩအၥၭဘဲၫနီၪ တၭ,ၦယုဒၫဖိၪလဖၪချဲၩ့လိၬအၥၭတၭ, စံၭဝ့ၫ, ဘဲၫ ၥိၭပထီးဒၪဘၪဝ့ၫလဂ့ၩတၭ, မွဲအမိလ့ၩခီၫခီၫလဲၪ. မွဲအမိလ့ၩလၧၦၡၩလၩ့မုလၩ့ဖၭလၧ ၦဂြံစၭဖိၪၥံၪအ",
			"36": "<sup>36</sup> ကျၩ,ဒဲအမိၥီၪ့လိၪၦဂြံစၭဖိၪဆ့ဧၪ.- ဆၧချဲၩ့ယီၩ လၧအစံၭဝ့ၫ, နၥံၪမိအၪ့ဎၬယၧၩတၭ,နၥံၪလဒၪန့ဘၪ, ဒဲထီးယအီၪအလးနီၪ,နၥံၪလ့ၩထီၩ့လၥ့ၪဘၪ, မွဲဆၧ နီၪလဲၪ.",
			"37": "<sup>37</sup> ဆၧဘိၪ့အနံၩ လၧခဲၫ့ထုၬအနံၩဖၭဒိၪနီၪ,ယ့ၫၡုၬ ဆၧၫ့ထုၪ့တၭ,ကိၭၡၭထၪ့ဆၧစံၭဝ့ၫ, ၦအ့ၪၥၭဝံအၥၭ လၧထံၫလဂၩဂၩနီၪ, မွဲအဂဲၫလၧယအီၪတၭ,အီၩ",
			"38": "<sup>38</sup> ကဒၪဘီၪ.- ဘဲၫဆၧကွ့ၭအၥၭစံၭဝ့ၫအၥိၭနီၪ, ၦလၧ အနဲၩယၧၩယီၩ, ထံၫမၧၫ့အချိၬလဖၪ မိယွၩလၩ့လၧ အဂူၭဖိၫ့ဖၧၩ့ လၧထံၫမၧၫ့လီၫ.",
			"39": "<sup>39</sup> စံၭဆၧယီၩ မွဲအစံၭဝ့ၫလၧၥၭမုနီၪ လၧၦနဲၩထဲၩ့ ဆၧလဖၪမိဒိၭန့ဝ့ၫလီၫ. အဂဲးဘဲၫယီၩ ဆၧဖ့ၪလၫ့ၥၭ မုဆံၫ့ဎံၪဒံၭအ့ၬ. အဂဲးဘဲၫယီၩယ့ၫၡုၬဘၪဒံၭအလၩ အဖၩ့ဒံၭအ့ၬ.",
			"40": "<sup>40</sup> မၩအၥၭဘဲၫနီၪတၭ, ၦနါဂၧၫ့အလူအထၫ လၧၦခ မျၧးအကျၩအၪဂၩစံၭဝ့ၫ, အယီၩမွဲမၬမီၪလဂၩလၩ့",
			"41": "<sup>41</sup> ထံးလၩ့ဆ့ၭလီၫ.- ၦဂူၫဂၩစံၭဝ့ၫ, အယီၩမွဲဎရံၬနီၪ လီၫ.အ့ၪမွဲအဂူၫဂၩ လနၩ့နၩ့စံၭဝ့ၫ, ဎရံၬနီၪမွဲအဂဲၫ",
			"42": "<sup>42</sup> လၧဂၫလလံၫနီၪဆ့ဧၪ.- ဆၧကွ့ၭအၥၭစံၭဝ့ၫ, ဎရံၬ နီၪဂဲၫလၧစဒၫဝံၭအချံၫအၥၪ, ဒဲလၧစဒၫဝံၭအတဝၫ့",
			"43": "<sup>43</sup> ဘ့ၭၥလံၫဟံၫ့နီၪ,မွဲအ့ၬဧၪ.- မၩအၥၭဘဲၫနီၪတၭ, ၦခမျၧးၥံၪမၩအၥၭ ဖၨၪထံဖၨၪထီၫလိၬအၥၭ လၧဆၧ",
			"44": "<sup>44</sup> နီၪအဂဲးလီၫ.- ၦလၧအကျၩလနၩ့နၩ့နီၪမိဖီၪ့ထၬဘၪ အၥၭလၧအဝ့ၫဒၪ လါနၫ့ဘိၩ, အီၪက့ၪအစူၪလၧအ လီၩ့နးဂၩအ့ၬ.",
			"45": "<sup>45</sup> မၩအၥၭဘဲၫနီၪတၭ, ဆၧအခ့ၫအၡၩလဖၪ ထဲၩ့ လၧၦလုဆၧအဒိၪၥံၪ, ဒဲလၧၦဖၫရစံၫၥံၪ အအီၪတၭ, အဝ့ၫၥံၪစံၭဝ့ၫ, အဝ့ၫနီၪလဂၩမွဲဘၪနီၫလၧနၥံၪလဂဲၫ",
			"46": "<sup>46</sup> ထဲၩ့မီၩ့ဘၪလဲၪ.- အခ့ၫအၡၩချဲၩ့ဆၧၫ့ဝ့ၫ, ၦချဲၩ့ဆၧ",
			"47": "<sup>47</sup> ဘဲၫၦလဂၩယီၩအၥိၭနးဆိၭအ့ၬ.- မၩအၥၭဘဲၫနီၪ တၭ,ၦဖၫရစံၫၥံၪ ချဲၩ့ဆၧၫ့အဝ့ၫၥံၪ, မွဲနၥံၪဘၪဆၧ",
			"48": "<sup>48</sup> အၪ့လီၫန့နၥံၪဆ့ဧၪ.- ၦဒိၪၦၡါမွဲဂ့ၩ, ၦဖၫရစံၫၥံၪမွဲ",
			"49": "<sup>49</sup> ဂ့ၩ,မွဲအနဲၩထဲၩ့အဝ့ၫနီၪလဂၩဂၩဆ့ဧၪ.- အ့ၪမွဲ ၦခမျၧးယီၩလၧအလၥ့ၪယၫဘၪ ဆၧမၪလူၬလဖၪ ဘၪဆၧဆိၪအၧၩ့ဝ့ၫဒၪလီၫ.",
			"50": "<sup>50</sup> ၦလၧအဂဲၫလၧအအီၪ လၧမုနၩလခီၫစနံၭကဒံမၧၭ လဂၩအီၪဝ့ၫလၧအကျၩတၭ, စံၭအဝ့ၫၥံၪ, ၦအ့ၪလ",
			"51": "<sup>51</sup> နါဂၧၫ့ဆိၫဘၪ ဆၧလၧအဂဲးတၭ,- အ့ၪလၥ့ၪယၫဘၪ လၧအမၩဆၧနီၫလဲၪနီၪ မွဲပဆၧမၪလူၬစ့ၩရၫ့ ၦလဂၩ",
			"52": "<sup>52</sup> ဂၩဆ့ဧၪ.- အဝ့ၫၥံၪချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭအဝ့ၫနီၪ, နမွဲၦဂၫလလံၫဖိၪဆ့ဧၪ. ယိလၩ့ထံးလၩ့ဆ့ၭတၭ, ၥ့ၪ ယၫလၧမီၪအီၪထၪ့ လၧဂၫလလံၫအဖၧၩ့နီၪနးဂၩ",
			"53": "<sup>53</sup> အ့ၬ.- ဎၦထဲၩ့ဝ့ၫလဂၩလၧအဂံၪ့ဒၪဝ့ၫလဂၩလၧအဂံၪ့ ဒၪဝ့ၫလီၫ.ၭ"
		},
		"8": {
			"1": "<sup>1</sup> ယ့ၫၡုၬလ့ၩစိၩဝ့ၫလၧခိၪလီၩ့ အလဲအိၫ့နီၪလီၫ.",
			"2": "<sup>2</sup> လၧဂီၩနၪခုၬနီၪ ဂဲၫဒီၭဝ့ၫ လၧဆၧလုအဂံၪ့ဖၧၩ့တၭ, ၦခမျၧးဂဲၫလၧအအီၪ ထီးအလူၬတၭ, အဝ့ၫဒၪဆၧၫ့",
			"3": "<sup>3</sup> နၩ့ၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့အဝ့ၫၥံၪလီၫ.- ၦကွ့ၭလံၬၥံၪ, ဒဲၦဖၫ ရစံၫၥံၪဂဲၫၥိၫ့ ၦမုၪလၧၦဖီၪ့န့ဝ့ၫ လၧအအဲၪဘိၩ့ဆၧ",
			"4": "<sup>4</sup> အဘိၩ့ဘၭနီၪ, အီၪက့ၪဝ့ၫလၧအၥၭကျၩ,- စံၭဝ့ၫ, ဆရၫဧ့,ၦမုၪလဂၩယီၩ, ၦဖီၪ့န့ဝ့ၫလၧအအဲၪဘိၩ့ဆၧ",
			"5": "<sup>5</sup> အဘိၩ့ဘၭလီၫ.- စမိစ့ၭမၪလူၬဝ့ၫလၧဆၧမၪလူၬအ ဖၧၩ့,ၦဘဲၫနီၪလဖၪမိဘၪဆၧခွံၬဝ့ၫလၧလိးလီၫ. မၩ",
			"6": "<sup>6</sup> အၥၭဘဲၫနီၪတၭ, မွဲနမိစံၭနဝ့ၫဘဲၫၥ့ၪလဲၪ.- အဝ့ၫၥံၪ ကျဲၩ့ဖစီၩ့အဝ့ၫနီၪ, စံၭဆၧနီၪဘဲၫၥိၭ အမိအီၪက့ၪဆၧ မၪလၧအလီၩ့ အလးမိအီၪဝ့ၫလီၫ. ယ့ၫၡုၬၡီၫ့လၩ့ အၥၭတၭ, ကွ့ၭလၩ့ဆၧလၧဂၪ့ခိၪအလီၩ့ လၧအစူၪ",
			"7": "<sup>7</sup> နိၩ့လီၫ.- ၦလဖၪနီၪအၪ့စၪ့ဒီၭဝ့ၫတၭ, အဝ့ၫဘိၭထၪ့ အၥၭနီၪ, စံၭအဝ့ၫၥံၪ, ၦလၧနၥံၪအကျၩလၧအဆၧ ဒဲၩဘၭလအီၪဘၪ လဂၩနီၪခွံၬဆိၫအဝ့ၫ လၧလိး",
			"8": "<sup>8</sup> လဖျိၪ့ဆံၭ.- ၡီၫ့လၩ့ဒီၭအၥၭတၭ, ကွ့ၭလၩ့ထဲၩ့ဆၧ",
			"9": "<sup>9</sup> လၧဂၪ့ခိၪအလီၩ့နီၪလီၫ.- ၦလၧအနါဂၧၫ့ဆၧလဖၪ နီၪ,အကၪ့ၡၧၫ့အီၪက့ၪဆၧမၪလၧအလီၩ့တၭ, လၧအ ၥၭၡါထုၬလဂၩ, ထီၩ့လၩ့လၧအၥၭဘၪ့ထုၬ လဂၩ နီၪ,စဲၪ့ထၪ့ခွံၬဝ့ၫ လဂၩဘၪလဂၩ, လဂၩဘၪလဂၩ လီၫ.ယ့ၫၡုၬအီၪလၩ့ထးလဂၩဎး, ဒဲၦမုၪနီၪဆၧၫ့ထုၪ့",
			"10": "<sup>10</sup> လၧဆၧၥၭကျၩလီၫ.- ယ့ၫၡုၬဘိၭထၪ့ဒီၭအၥၭတၭ, ဒၪဘၪၦနးဂၩအ့ၬ. ဒၪန့ၫၦမုၪလဂၩနီၪ, စံၭအဝ့ၫ, ၦမုၪ ဧ့,ၦလၧအအီၪက့ၪဆၧမၪလၧနလီၩ့လဖၪနီၪ, မွဲအအီၪ",
			"11": "<sup>11</sup> ခီၫခီၫလဲၪ. မွဲအစ့ၩရၫ့စၪနၧၩနးဂၩအ့ၬဧၪ.- အဝ့ၫဒၪ စံၭဝ့ၫ,နးဂၩအ့ၬ, ကဆါဧ့, တၭယ့ၫၡုၬစံၭဝ့ၫ, ယဝ့ၫ ဒၪယီၩယစ့ၩရၫ့စၪနၧၩဆ့အ့ၬ.ဎထဲၩ့ထဲၩ့တၭထီးမၩ လၧၩ့ဆၧဒဲၩဘၭလၧခဲၫ့လဂ့ၩ.ၭ",
			"12": "<sup>12</sup> မၩအၥၭဘဲၫနီၪတၭ, ယ့ၫၡုၬလီၩဘၪဒီၭအဝ့ၫၥံၪ, စံၭဝ့ၫ,ယဝ့ၫဒၪယီၩယမွဲဂၪ့ခိၪအဆၧဖၩ့လီၫ. ၦလၧ အဖိၬယခဲၫ့လဖၪနီၪ မိလ့ၩလၧဆၧခံၭအကျၩအ့ၬ.",
			"13": "<sup>13</sup> မိန့ဘၪဆၧမၧၫ့အဆၧဖၩ့လီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ၦဖၫရစံၫၥံၪစံၭအဝ့ၫ နထိးနၥၭလၧနဂးဒၪနဝ့ၫလီၫ.",
			"14": "<sup>14</sup> နဆၧထိးနၥၭနီၪတီၩအ့ၬ.- ယ့ၫၡုၬချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭအဝ့ၫၥံၪ, ယထိးယၥၭလၧယဂးဒၪယဝ့ၫလါနၫ့ ဘိၩ,ယဆၧထိးယၥၭနီၪမွဲအတီၩလီၫ. အဂဲးဘဲၫယီၩ မွဲယဂဲၫဝ့ၫခီၫခီၫလဲၪ, ယမိထဲၩ့ထဲၩ့ခီၫခီၫလဲၪနီၪ,ယ ၥ့ၪယၫယဝ့ၫလီၫ. အ့ၪမွဲနၥံၪဝ့ၫယီၩ မွဲယဂဲၫဝ့ၫခီၫခီၫ လဲၪ,ယမိထဲၩ့ထဲၩ့ခီၫခီၫလဲၪနီၪ, နၥံၪၥ့ၪယၫအ့ၬ.",
			"15": "<sup>15</sup> နၥံၪဝ့ၫဒၪလဖၪယီၩ, နၥံၪစ့ၩရၫ့ဆၧဘဲၫဆၧယၪအၥိၭ",
			"16": "<sup>16</sup> နီၪတၭ,ယဝ့ၫဒၪယီၩယစ့ၩရၫ့ၦနးဂၩအ့ၬ.- ယအ့ၪ စ့ၩရၫ့ဆၧတၭ, ယဆၧစ့ၩရၫ့နီၪမွဲအတီၩလီၫ. အဂဲး ဘဲၫယီၩယဝ့ၫဒၪယီၩ, ယအီၪလဂၩဎးမွဲအ့ၬ, ယအီၪလၧယဖါလၧ အအၪ့မၧၫ့လၩ့န့ယၧၩအၥိၭလီၫ.",
			"17": "<sup>17</sup> ဆၧကွ့ၭအၥၭ လၧနၥံၪအဆၧမၪလူၬအဖၧၩ့လၧၦ",
			"18": "<sup>18</sup> နံၫဂၩအဆၧထိးအၥၭနီၪ, မွဲအတီၩလီၫ.- ယဝ့ၫဒၪ ယီၩယထိးယၥၭလၧယဂးဒၪယဝ့ၫတၭ, ဖါလၧအ အၪ့မၧၫ့လၩ့န့ယၧၩလဂၩနီၪ, ထိးအၥၭလၧယဂးဆ့",
			"19": "<sup>19</sup> လီၫ.- မၩအၥၭဘဲၫနီၪတၭ,အဝ့ၫၥံၪစံၭအဝ့ၫ, မွဲနဖါ နီၪအီၪခီၫခီၫလဲၪ. ယ့ၫၡုၬချဲၩ့ဆၧၫ့ဝ့ၫ, ယဝ့ၫဒၪမွဲဂ့ၩ, ယဖါမွဲဂ့ၩ,နၥံၪၥ့ၪယၫအ့ၬ. နၥံၪအ့ၪၥ့ၪယၫယၧၩ တၭ,နၥံၪမိၥ့ၪယၫယဖါဆ့လီၫ.",
			"20": "<sup>20</sup> ယ့ၫၡုၬၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ဆၧလၧဆၧလုအဂံၪ့ဖၧၩ့အ ဘိၩ့ဘၭနီၪ, လီၩလၩ့လၬလၩ့ဆၧလဖၪယီၩ, အီၪဝ့ၫ လၧစ့ၩအီၪက့ၪကီၪ့အလးလီၫ. ၦလအီၪက့ၪဘၪအ စူၪလၧအလီၩ့နးဂၩနီၪ, အဂဲးဘဲၫယီၩအဆၧၫ့အထီဘၪဒံၭအ့ၬ.",
			"21": "<sup>21</sup> မၩအၥၭဘဲၫနီၪတၭ, ယ့ၫၡုၬစံၭဒီၭအဝ့ၫၥံၪ, ယ လ့ၩဆၧတၭ,နၥံၪမိအၪ့ဎၬယၧၩနီၪ, နၥံၪမိၥံၫလၧ နၥံၪအဆၧဒဲၩဘၭအဖၧၩ့တၭ, ထီးဒၪယလ့ၩဆၧ",
			"22": "<sup>22</sup> အလးနီၪ,နၥံၪလ့ၩထီၩ့နၥံၪဝ့ၫၥ့ၪအ့ၬ.- မၩအၥၭ ဘဲၫနီၪတၭ,ၦယုဒၫဖိၪလဖၪစံၭဝ့ၫဒၪ, အဝ့ၫနီၪစံၭဝ့ၫ, ထီးဒၪယလ့ၩဆၧအလးနီၪ, နၥံၪလ့ၩထီၩ့ၥ့ၪအ့ၬ, တၭ",
			"23": "<sup>23</sup> မွဲအမိမၩၥံၫလၩ့ဒၪအၥၭဆ့ဧၪ.- အဝ့ၫဒၪစံၭအဝ့ၫၥံၪ, နၥံၪဝ့ၫယီၩ, နၥံၪဘၪဆဲၫ့လၧလၬလခီၫတၭ,ယဝ့ၫဒၪ ယီၩ,ယဘၪဆဲၫ့လၧထၭလခီၫး နၥံၪဝ့ၫယီၩနၥံၪဘၪ ဆဲၫ့လၧဂၪ့ခိၪတၭ, ယဝ့ၫဒၪယီၩ,ယဘၪဆဲၩ့လၧဂၪ့",
			"24": "<sup>24</sup> ခိၪအ့ၬ.-မၩအၥၭဘဲၫနီၪတၭ, ယစံၭလၧနၥံၪမိၥံၫ လၧနၥံၪအဆၧဒဲၩဘၭအဖၧၩ့လီၫ. အဂဲးဘဲၫယီၩ ယမွဲ ၦလဂၩနီၪ, နၥံၪအ့ၪလနဲၩဘၪတၭ,နၥံၪမိၥံၫလၧနၥံၪ",
			"25": "<sup>25</sup> အဆၧဒဲၩဘၭအဖၧၩ့လီၫ.- မၩအၥၭဘဲၫနီၪတၭ, အဝ့ၫၥံၪစံၭအဝ့ၫ, နဝ့ၫဒၪယီၩနမွဲပလၫလဂၩလဲၪ.ယ့ၫ ၡုၬစံၭအဝ့ၫၥံၪ, ယဝ့ၫဒၪယီၩယမွဲဘဲၫယလီၩဘၪနၥံၪ",
			"26": "<sup>26</sup> လၧအၥၫ့အၥိၭနီၪလီၫ.- ယဝ့ၫဒၪယီၩယချဲၩ့ဆၧ,ဒဲစ့ၩ ရၫ့ဆၧလၧနၥံၪအဂဲးအကၠီၪ့အလးအီၪအၪမၬ, လါနၫ့ ဘိၩးၦလၧအအၪ့မၧၫ့လၩ့န့ယၧၩလဂၩနီၪ,မွဲၦအ တီၩအလီၩ့တၭ,ဆၧလၧယနါဂၧၫ့လၧအဝ့ၫနီၪ, ယလီၩ ဘၪၦဂၪ့ခိၪဖိၪၥံၪလီၫ.",
			"27": "<sup>27</sup> အဝ့ၫဒၪစံၭဆၧလၧဖါအဂဲးနီၪ အဝ့ၫၥံၪၥ့ၪယၫဝ့ၫ",
			"28": "<sup>28</sup> အ့ၬ.- မၩအၥၭဘဲၫနီၪတၭ,ယ့ၫၡုၬစံၭအဝ့ၫၥံၪ, ထီး နၥံၪအ့ၪဘီၩ့ထၪ့ၦၡၩအဖိၪခွၫတၭ, ယမွဲပလၫလ ဂၩလဲၪနီၪ,နၥံၪမိၥ့ၪယၫတၭ, ယမၩဘၪဆၧလၧယနၫ့ ဆါဒၪယဝ့ၫနးမံၩ့အ့ၬ. ဘဲၫယဖါၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ယၧၩ",
			"29": "<sup>29</sup> အၥိၭနီၪ, ယလီၩဘၪဆၧယီၩလဖၪလီၫ.- ၦလၧအအၪ့ မၧၫ့လၩ့ယၧၩလဂၩနီၪ, အီၪလၧယၥိၭလီၫ. ဘဲၫယမိ အီၪလဂၩဎးအၥိၭ ဖါနီၪစဲၪ့ဒၪယၧၩအ့ၬ. အဂဲးဘဲၫ ယီၩဆၧလၧအဘၪအဝ့ၫအၥၭလဖၪနီၪ, ယမၩယဝ့ၫ ထံၪဎးလီၫ.",
			"30": "<sup>30</sup> အဝ့ၫဒၪချဲၩ့ဆၧလဖၪနီၪအဘိၩ့ဘၭတၭ, ၦနဲၩထဲၩ့ ဝ့ၫအၪဂၩလီၫ.",
			"31": "<sup>31</sup> မၩအၥၭဘဲၫနီၪတၭ, ယ့ၫၡုၬစံၭ ၦယုဒၫဖိၪလၧအ နဲၩထဲၩ့ဝ့ၫလဖၪနီၪ နၥံၪအ့ၪအီၪဂုးအီၪခၧၫ့ လၧယလူ ယထၫအဖၧၩ့တၭ, နၥံၪမွဲယထံၩယဖျဲလၩ့ထံးလၩ့",
			"32": "<sup>32</sup> ဆ့ၭလီၫ.- နၥံၪမိၥ့ၪယၫဆၧမွဲဆၧတီၩတၭ, ဆၧမွဲ",
			"33": "<sup>33</sup> ဆၧတီၩနီၪမိကွဲၪဖျါခွံၬနၥံၪလီၫ.- အဝ့ၫၥံၪချဲၩ့ဆၧၫ့ ဝ့ၫ,ပဝ့ၫဒၪယီၩ ပမွဲစအၫဘြဟၫ့ အချံၫအၥၪတၭ, ပ ကဲၪဎီးလၧ ၦၡၩလဂၩဂၩ အစူၪဖၧၩ့နးဆိၭအ့ၬ. တၭနစံၭလၧဆၧမိကွဲၪဖျါခွံၬ နၥံၪနီၪ မွဲဘဲၫၥ့ၪလဲၪ.",
			"34": "<sup>34</sup> ယ့ၫၡုၬချဲၩ့ဆၧၫ့အဝ့ၫၥံၪ, ယလီၩဘၪ နၥံၪတီၩတီၩ လီၩ့လီၩ့လၧကယဲၦလၧအမၩဆၧဒဲၩဘၭနီၪ, မွဲဆၧ",
			"35": "<sup>35</sup> ဒဲၩဘၭအဎီးလီၫ.- ဎီးနီၪအီၪဘၪ လၧဂံၪ့ဖၧၩ့အ ဆိၩဆိၩအကၠၪကၠၪအ့ၬ. အ့ၪမွဲဖိၪခွၫနီၪအီၪဝ့ၫလၧ",
			"36": "<sup>36</sup> ဂံၪ့ဖၧၩ့အဆိၩဆိၩအကၠၪကၠၪလီၫ.- မၩအၥၭဘဲၫနီၪ တၭ,ဖိၪခွၫအ့ၪကွဲၪဖျါခွံၬနၥံၪတၭ, နၥံၪမိအီၪပျီၩဖျ့ၭ",
			"37": "<sup>37</sup> လၩ့ထံးလၩ့ဆ့ၭလီၫ.- ယၥ့ၪယၫလၧနၥံၪမွဲစအၫ ဘြဟၫ့အချံၫအၥၪ မွဲလါနၫ့ဘိၩ နၥံၪအၪ့ဎၬ မၩၥံၫ ယၧၩလီၫ.အဂဲးဘဲၫယီၩ ယလူယထၫအီၪလၧနၥံၪအ",
			"38": "<sup>38</sup> ဖၧၩ့အ့ၬ.- ဆၧလၧယဒၪဘၪ လၧယဖါအအီၪနီၪယ လီၩဘၪယဝ့ၫတၭ, ဆၧလၧနၥံၪဒၪဘၪလၧနၥံၪအ ဖါအအီၪနီၪ, မွဲနၥံၪမၩနၥံၪဝ့ၫဆ့လီၫ.",
			"39": "<sup>39</sup> အဝ့ၫၥံၪချဲၩ့ဆၧၫ့ဆၧတၭစံၭအဝ့ၫဒၪ, စအၫဘြဟၫ့ မွဲပဖါလီၫ. ယ့ၫၡုၬစံၭအဝ့ၫၥံၪ, နၥံၪအ့ၪမွဲစအၫ ဘြဟၫ့အဖိၪတၭ,နၥံၪမိမၩစအၫဘြဟၫ့အဆၧမၩ",
			"40": "<sup>40</sup> လီၫ.- ဘိၩ့နဲၪ့ယီၩနၥံၪအၪ့ဎၬမၩၥံၫယၧၩ, ၦလၧအ လီၩဘၪနၥံၪ ဆၧမွဲဆၧတီၩ လၧယနါဂၧၫ့ယဝ့ၫလၧ",
			"41": "<sup>41</sup> ယွၩလီၫ.- စအၫဘြဟၫ့မၩဝ့ၫဘဲၫနီၪၥိၭအ့ၬ.နၥံၪ မၩနၥံၪအဖါအဆၧမၩလီၫ. မၩအၥၭဘဲၫနီၪတၭ, အဝ့ၫ ၥံၪစံၭဝ့ၫ, ပဝ့ၫဒၪယီၩပအီၪဖျဲၪ လၧၦအဲၪဘိၩ့ဆၧအ ဖၧၩ့မွဲအ့ၬ, ပအီၪလၧပဖါ လဂၩဎးယွၩနီၪလီၫ.",
			"42": "<sup>42</sup> မၩအၥၭဘဲၫနီၪတၭ, ယ့ၫၡုၬစံၭအဝ့ၫၥံၪ, ယွၩအ့ၪမွဲ နၥံၪအဖါတၭ, နၥံၪမိအဲၪယၧၩလီၫ. အဂဲးဘဲၫယီၩ ယအီၪယဝ့ၫလၧယွၩအၥိၭနီၪ, ယစဲၪ့ထၪ့တၭ, ယဂဲၫ လၩ့ယဝ့ၫလီၫ. အဂဲးဘဲၫယီၩ ယဂဲၫဒၪယဝ့ၫအ့ၬ.အ",
			"43": "<sup>43</sup> ဝ့ၫအၪ့မၧၫ့လၩ့ယၧၩလီၫ.- ယဆၧချဲၩ့ယီၩမွဲဘၪ နီၫလၧနၥံၪနၪလၥ့ၪဘၪလဲၪ. မွဲနၥံၪခိၭနၪယလူယထၫ",
			"44": "<sup>44</sup> လၥ့ၪဘၪအဂဲးလီၫ.- နၥံၪဝ့ၫဒၪယီၩ နၥံၪဘၪဆဲၫ့ လၧနၥံၪအဖါမုၪခီၩလဲးတၭ, ထီးဒၪနၥံၪအဖါအၥၭ လဲးၥၭဘျၪနီၪ, ဆၧမိမၩဘၪနၥံၪအၥၭလီၫ. အဝ့ၫနီၪ လၧအၥၫ့လံၩလံၩ, မွဲၦလၧအမၩၥံၫၦၡၩတၭ, အီၪ ဝ့ၫလၧဆၧမွဲဆၧတီၩ အဖၧၩ့အ့ၬ. အဂဲးဘဲၫယီၩ ဆၧမွဲဆၧတီၩအီၪလၧအဖၧၩ့အ့ၬ. ထီးဒၪအစံၭဆၧ ချဲၩ့အဘျံၭအဘျၪတၭ, မွဲအစံၭအဆၧဒၪဝ့ၫလီၫ. အ ဂဲးဘဲၫယီၩ မွဲၦလၧအချဲၩ့ဆၧ အဘျံၭအဘျၪတၭ, မွဲ",
			"45": "<sup>45</sup> ဆၧချဲၩ့ဘျံၭချဲၩ့ဘျၪအဖါလီၫ.- ယဝ့ၫဒၪယီၩမွဲယလီၩ",
			"46": "<sup>46</sup> ဘၪဆၧမွဲဆၧတီၩတၭ,နၥံၪနဲၩယၧၩအ့ၬ.- မွဲပလၫ လၧနၥံၪအကျၩ မိဒုၭနဲၪယဆၧအမၪ လဂၩလဲၪ.ယ အ့ၪလီၩဘၪ ဆၧမွဲဆၧတီၩတၭ, မွဲဘၪနီၫနၥံၪလနဲၩ",
			"47": "<sup>47</sup> ဘၪလဲၪ.- ၦဘၪဆဲၫ့လၧယွၩနီၪ မိခိၭနၪယွၩအလူအ ထၫလီၫ.အနီၪတၭ, နၥံၪဝ့ၫဒၪလဖၪယီၩ, နၥံၪလဘၪ ဆဲၫ့ဘၪလၧယွၩတၭ, နၥံၪခိၭနၪနၥံၪဝ့ၫအ့ၬ.",
			"48": "<sup>48</sup> မၩအၥၭဘဲၫနီၪတၭ, ၦယုဒၫဖိၪချဲၩ့ဆၧၫ့ဆၧ,စံၭအ ဝ့ၫ,နဝ့ၫဒၪယီၩပစံၭလၧနမွဲၦစမ့ရအၫဖိၪ, ဆၧနၪအီၪ",
			"49": "<sup>49</sup> လၧနလီၩ့နီၪမွဲအဘၪအ့ၬဧၪ.- ယ့ၫၡုၬချဲၩ့ဆၧၫ့ဝ့ၫ, ဆၧနၪလအီၪဘၪ လၧယလီၩ့,အ့ၪမွဲယဝ့ၫဒၪယီၩ ယ ယူၭယယၪ့ယဖါတၭ, နၥံၪဝ့ၫဒၪယီၩ နၥံၪယူၭယၪ့",
			"50": "<sup>50</sup> ယၧၩအ့ၬ.- ယဝ့ၫဒၪယီၩယအၪ့ဎၬယလၩယဖၩ့ ဒၪယဝ့ၫလမွဲဘၪး ၦလၧအအၪ့ဎၬ ဒဲအစ့ၩရၫ့ဆၧနီၪ",
			"51": "<sup>51</sup> အီၪဝ့ၫလဂၩလီၫ.- ယလီၩဘၪနၥံၪတီၩတီၩလီၩ့လီၩ့, ၦအ့ၪထီးန့ ယလူယထၫလဂၩဂၩနီၪ, အဆိၩဆိၩအ",
			"52": "<sup>52</sup> ကၠၪကၠၪၥံၫလၧၩ့နးဆိၭအ့ၬ.- ၦယုဒၫဖိၪၥံၪစံၭအဝ့ၫဒၪး ဘိၩ့နဲၪ့ယီၩပၥ့ၪယၫဆၧနၪ အီၪလၧနလီၩ့လီၫ. စအၫဘြဟၫ့ဒဲမီၪၥံၪၥံၫယူၭတၭ, နဝ့ၫဒၪယီၩနစံၭ, ၦလဂၩဂၩအ့ၪထီးန့ယလူယထၫနီၪ, အဆိၩဆိၩအ",
			"53": "<sup>53</sup> ကၠၪကၠၪမိထဲးယိဘၪဆၧၥံၫနးဆိၭအ့ၬ.- နဝ့ၫဒၪယီၩ မွဲနဒိၪနဲၪ့ပဖါစအၫဘြဟၫ့လၧအၥံၫယူၭနီၪဆ့ဧၪ. မီၪ ၥံၪၥံၫယူၭတၭ, နဝ့ၫဒၪယီၩနအီၪက့ၪနၥၭလၧနမွဲပ",
			"54": "<sup>54</sup> လၫလဂၩလဲၪ.- ယ့ၫၡုၬစံၭဆၧၫ့ဝ့ၫ, ယအ့ၪအၪ့အူၭ လၩ့ယၥၭဒၪယဝ့ၫတၭ, ယဆၧအၪ့အူၭနီၪ မွဲဆၧပျီၩ ပျီၩလီၫ. ၦလၧအစံၭထၪ့အၪ့အူၭယၧၩ, မွဲယဖါလၧ",
			"55": "<sup>55</sup> နၥံၪစံၭ, မွဲနၥံၪအယွၩနီၪလီၫ.- နၥံၪၥ့ၪယၫအဝ့ၫ အ့ၬ.အ့ၪမွဲယဝ့ၫဒၪယီၩ ယၥ့ၪယၫအဝ့ၫတၭ, ယအ့ၪ စံၭလၧယလၥ့ၪယၫဘၪနီၪ, ယကဲၪထၪ့ၦချဲၩ့ဘျံၭချဲၩ့ ဘျၪဆၧဘဲၫနၥံၪအၥိၭလီၫ. မွဲလါနၫ့ဘိၩ, ယၥ့ၪယၫ",
			"56": "<sup>56</sup> အဝ့ၫနီၪတၭ, ယထီးန့အလူအထၫလီၫ.- နၥံၪအဖါ စအၫဘြဟၫ့ ယိလါဝ့ၫလၧအမိဒၪဘၪ ယနံၩယၥၫ့",
			"57": "<sup>57</sup> တၭ,ဒၪဘၪဝ့ၫနီၪၥုၪ့ထိၬၥၭထိၬဝ့ၫဒၪလီၫ.- မၩအ ၥၭဘဲၫနီၪတၭၦယုဒၫဖိၪၥံၪစံၭအဝ့ၫ, နဝ့ၫဒၪနၥၭအီၪ ဝါအနံၪ့ယဲဆံၫဒံၭအ့ၬတၭ, မွဲနဒၪဘၪယူၭစအၫဘြ",
			"58": "<sup>58</sup> ဟၫ့ဆ့ဧၪ.- ယ့ၫၡုၬစံၭအဝ့ၫၥံၪ, ယလီၩဘၪနၥံၪတီၩ တီၩလီၩ့လီၩ့, လၧစအၫဘြဟၫ့လချႃၭအီၪဒံၭဘၪနီၪ,",
			"59": "<sup>59</sup> ယအီၪယဝ့ၫလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ဘဲၫၥိၭအ ဝ့ၫၥံၪမိခွံၬဘၪအဝ့ၫနီၪတၭ,အၪ့ထုၫ့န့လိးလီၫ. ယ့ၫ ၡုၬမၩလၩ့မါအၥၭ ခၫ့ဂၬဝ့ၫလၧအကျၩတၭ, စဲၪ့ထၪ့ ခွံၬဝ့ၫလၧဆၧလုအဂံၪ့ဖၧၩ့နီၪလီၫ."
		},
		"9": {
			"1": "<sup>1</sup> လၧအလ့ၩဆၧအဘိၩ့ဘၭတၭ, ဒၪဘၪၦအမ့ၬဘျီၪ",
			"2": "<sup>2</sup> ခီၫလၧအအီၪဖျဲၪဝ့ၫလံၩလံၩလဂၩနီၪလီၫ.- အထံၩအ ဖျဲၥံၪအၪ့စၪ့အဝ့ၫတၭ, စံၭဝ့ၫ, ရၭဘံၫဧ့, ၦလဂၩအီၪ ဖျဲၪဝ့ၫလၧအမ့ၬဘျီၪယီၩ, မွဲလၧပလၫ အဆၧဒဲၩဘၭ အကၠီၩ့လဂၩလဲၪးမွဲၦလဂၩယီၩဧၪ,မွဲအမိအဖါလဲၪ.",
			"3": "<sup>3</sup> ယ့ၫၡုၬချဲၩ့ဆၧၫ့ဝ့ၫ,ၦလဂၩယီၩမွဲဂ့ၩ,အမိအဖါမွဲဂ့ၩ, မၩဆၧဒဲၩဘၭအ့ၬ. မွဲဘဲၫၥိၭယွၩအဆၧမၩမိအီၪဖျီၪ",
			"4": "<sup>4</sup> လၧအလီၩ့လီၫ.- ၦလၧအအၪ့မၧၫ့လၩ့ယၧၩ အဆၧ မၩနီၪ, ယဘၪမၩလၧမုဆၫလခီၫလီၫ. မုနၩလၧၦမၩ",
			"5": "<sup>5</sup> ဆၧလၥ့ၪဘၪနးဂၩမိထီၩ့ဝ့ၫလီၫ.- ယအီၪလၧဂၪ့ခိၪ ချိၫ့ယီၩအဘိၩ့ဘၭတၭ, ယမွဲဂၪ့ခိၪအဆၧဖၩ့လီၫ.",
			"6": "<sup>6</sup> စံၭဆၧနီၪဂီၩ့တၭ, ထိၪဖျံၭလၩ့ဂၪ့ခိၪနီၪ, မၩကဲၪ ထၪ့ဖံၬလၧအထိၪဖျံၭထံၫနီၪ,ဂုၪလၩ့ၦမ့ၬဘျီၪအမ့ၬၥၪ",
			"7": "<sup>7</sup> လဖၪ.- စံၭအဝ့ၫ, လ့ၩလၧကမၫစံလိၫအၫ့(ဘဲၫၦစံၭဆၧအၥိၭ ဆၧအၪ့မၧၫ့လၩ့) အၪ့ဖျါခွံၬဆံၭ. မၩအ ၥၭဘဲၫနီၪတၭ, အဝ့ၫဒၪလ့ၩအၪ့ဖျါခွံၬဝ့ၫနီၪ, ဒၪထၪ့",
			"8": "<sup>8</sup> ဆၧတၭဂဲၫထဲၩ့ထဲၩ့ဝ့ၫလီၫ.- ၦအီၪလၧအနဲၩ့ထံၭ, ဒဲ ၦလၧအဒၪဘၪအဝ့ၫလၧအၥၫ့လၧ အမွဲၦအၪ့ကံၩ့ဆၧ တၭ, စံၭဝ့ၫ, အယီၩမွဲၦလၧအဆၧၫ့နၩ့ အၪ့ကံၩ့ဆၧလ",
			"9": "<sup>9</sup> ဂၩနီၪမွဲအ့ၬဧၪ.- ၦလနၩ့နၩ့စံၭဝ့ၫ, မွဲအဝ့ၫနီၪ, အဂူၫ ဂၩလနၩ့နၩ့, လၩ့ဂၬမၬလၧအဝ့ၫနီၪကၨ. အနၫ့ဆါ",
			"10": "<sup>10</sup> ဒၪဝ့ၫစံၭ,မွဲယၧၩလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, အဝ့ၫၥံၪ",
			"11": "<sup>11</sup> စံၭအဝ့ၫ, နမ့ၬၥၪနီၪဖၩ့ထၪ့ထဲၩ့ဝ့ၫဘဲၫၥ့ၪလဲၪ.- အဝ့ၫ ဒၪချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭဝ့ၫ, ၦကိၭဝ့ၫအမံၩ့ယ့ၫၡုၬလ ဂၩနီၪ,မၩကဲၪထၪ့ဖံၬဂုၪလၩ့ယမ့ၬၥၪလဖၪတၭ, စံၭ ယၧၩ,လ့ၩလၧကမၫစံလိၫအၫ့နီၪ အၪ့ဖျါခွံၬဆံၭ. ယ",
			"12": "<sup>12</sup> လ့ၩအၪ့ဖျါခွံၬတၭ, ယဒၪထၪ့ထဲၩ့ဆၧလီၫ.- မၩအၥၭ ဘဲၫနီၪတၭ, အဝ့ၫၥံၪစံၭဝ့ၫ,မွဲအအီၪခီၫခီၫလဲၪ. အဝ့ၫ ဒၪချဲၩ့ဆၧၫ့ဝ့ၫ, ယၥ့ၪယၫအ့ၬ.",
			"13": "<sup>13</sup> အဝ့ၫၥံၪလ့ၩၥိၫ့ၦလၧအမ့ၬဘျီၪ လၧအခီၫလဂၩနီၪ",
			"14": "<sup>14</sup> လၧၦဖၫရစံၫၥံၪအအီၪလီၫ.- လၧယ့ၫၡုၬမၩကဲၪထၪ့",
			"15": "<sup>15</sup> ဖံၬမၩဖၩ့ထၪ့ၦအမ့ၬၥၪနီၪ, မွဲမးၥံၫအနံၩလီၫ.- မၩအ ၥၭဘဲၫနီၪတၭ, ၦဖၫရစံၫၥံၪအၪ့စၪ့ဒီၭအဝ့ၫ, မွဲနဒၪထၪ့ ထဲၩ့ဆၧဘဲၫၥ့ၪလဲၪ. အဝ့ၫဒၪစံၭအဝ့ၫၥံၪ, ၦလဂၩနီၪ ဂုၪလၩ့ယမ့ၬၥၪလဖၪ, ယအၪ့ဖျါခွံၬနီၪယဒၪထၪ့ထဲၩ့",
			"16": "<sup>16</sup> ဆၧလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ၦဖၫရစံၫၥံၪလနၩ့နၩ့ စံၭဝ့ၫ,ၦလဂၩနီၪအ့ၪလထီးနဲၪ့ဘၪမးၥံၫအနံၩတၭ, ဘၪဆဲၫ့လၧယွၩအ့ၬ. အဂူၫဂၩလနၩ့နၩ့စံၭဝ့ၫ, ၦဆၧ ဒဲၩဘၭဖိၪ မၩဆၧလၩ့လၭန့ၫယီၩ မိၥ့ၪဘဲၫၥ့ၪလဲၪ. အဝ့ၫၥံၪဖၨၪထံဖၨၪထီၫတၭ လၩ့ဖၭလိၬအၥၭလီၫ.",
			"17": "<sup>17</sup> အဝ့ၫၥံၪစံၭဒီၭၦမ့ၬဘျီၪလဂၩနီၪ, ၦလၧအမၩဖၩ့ထၪ့ ထဲၩ့နမ့ၬၥၪလဖၪနီၪ, နစံၭနဝ့ၫလၧအဂဲးအကၠီၪ့ဘဲၫၥ့ၪ လဲၪ.တၭအဝ့ၫဒၪစံၭဝ့ၫ, မွဲမီၪလဂၩလီၫ.",
			"18": "<sup>18</sup> ၦယုဒၫဖိၪၥံၪဘိၩ့အလချႃၭကိၭဒံၭဘၪ ၦလၧအဒၪ ထၪ့ထဲၩ့ဆၧအမိအဖါနီၪ အဝ့ၫဒၪအမ့ၬဘျီၪတၭ,",
			"19": "<sup>19</sup> ဒၪထၪ့ထဲၩ့ဆၧနီၪနဲၩဝ့ၫအ့ၬ.- အၪ့စၪ့အဝ့ၫၥံၪ, စံၭဝ့ၫ, အယီၩမွဲနၥံၪအဖိၪခွၫလၧနၥံၪစံၭ အအီၪဖျဲၪလၧအမ့ၬ ဘျီၪနီၪဆ့ဧၪ. အ့ၪမွဲဘဲၪနီၪတၭ, မွဲအဒၪထၪ့ထဲၩ့ဆၧ",
			"20": "<sup>20</sup> ဘိၩ့နဲၪ့ယီၩဘဲၫၥ့ၪလဲၪ.- အမိအဖါချဲၩ့ဆၧၫ့အဝ့ၫၥံၪ, စံၭဝ့ၫ,ပၥ့ၪယၫလၧအဝ့ၫယီၩ မွဲပဖိၪခွၫလၧအအီၪဖျဲၪ",
			"21": "<sup>21</sup> နီၪအမ့ၬဘျီၪလီၫ.- မွဲလါနၫ့ဘိၩ မွဲအဒၪထၪ့ထဲၩ့ဆၧ ဘိၩ့နဲၪ့ယီၩဘဲၫၥ့ၪလဲၪနီၪပၥ့ၪယၫအ့ၬ. မွဲပလၫမၩဖၩ့ ထၪ့ထဲၩ့အမ့ၬၥၪ လဂၩလဲၪနီၪ, ပၥ့ၪယၫအ့ၬ. အဝ့ၫ နီၪဒိၪထၪ့ဎွ့ၩထၪ့ယူၭ, အၪ့စၪ့ဒၪခလူၬအနၫ့ဆါဘီၪ. မိလီၩလၩ့အၥၭဒၪဝ့ၫလီၫ.",
			"22": "<sup>22</sup> အမိအဖါၥၭမဲၪၦယုဒၫဖိၪၥံၪအကၠီၩ့တၭ,စံၭဆၧ လဖၪနီၪလီၫ. အဂဲးဘဲၫယီၩ ၦယုဒၫဖိၪၥံၪနီၪ,ကိၪ့လိၬ အၥၭလၧၦလဂၩဂၩ အ့ၪအုၩ့လၩ့အၥၭလၧအဝ့ၫနီၪမွဲ ဎရံၬတၭ, မိဘၪဆၧနၫ့ထၪ့ခွံၬလၧၥရိၬဖၧၩ့လီၫ.",
			"23": "<sup>23</sup> မွဲဘဲၫနီၪတၭ, အမိအဖါစံၭဝ့ၫ, အဝ့ၫဒၪဒိၪထၪ့ဎွ့ၩ ထၪ့ယူၭတၭ, အၪ့စၪ့ဒၪခလူၬအနၫ့ဆါဘီၪ.",
			"24": "<sup>24</sup> မၩအၥၭဘဲၫနီၪတၭ, အဝ့ၫၥံၪကိၭဒီၭ ၦလၧအမ့ၬ ဘျီၪနံၫဖၧၫ့လဖၧၫ့တၭ, စံၭအဝ့ၫ, မၩလၩမၩဖၩ့ထၪ့ ယွၩဆံၭ. ၦၥ့ၪယၫၦလဂၩနီၪ မွဲၦဆၧဒဲၩဘၭဖိၪ",
			"25": "<sup>25</sup> လီၫ.- အဝ့ၫချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭဝ့ၫၦလဂၩနီၪ မွဲၦ ဆၧဒဲၩဘၭဖိၪဧၪ, ယၥ့ၪယၫအ့ၬ. ဆၧလမံၩ့ လၧယ မွဲၦမ့ၬဘျီၪတၭ, ဘိၩ့နဲၪ့ယီၩယဒၪထၪ့ထဲၩ့ဆၧနီၪယ",
			"26": "<sup>26</sup> ၥ့ၪယၫယဝ့ၫလီၫ.- အခိးမွဲအဝ့ၫၥံၪစံၭဒီၭအဝ့ၫနီၪ, မွဲ အမၩနၧၩလၧဆၧနီၪလဲၪး မၩဖၩ့ထၪ့နမ့ၬၥၪဘဲၫၥ့ၪ",
			"27": "<sup>27</sup> လဲၪ.- အဝ့ၫချဲၩ့ဆၧၫ့အဝ့ၫၥံၪ,ယလီၩဘၪယူၭနၥံၪလ ဖၧၫ့တၭ, နၥံၪခိၭနၪအ့ၬ. ဆၧမိနါဂၧၫ့ဘၪဒီၭ နၥံၪအ ၥၭမွဲဘၪလဲၪ. ဆၧမိကဲၪထၪ့ဘၪနၥံၪအၥၭလၧအထံၩ",
			"28": "<sup>28</sup> အဖျဲဆ့ဧၪ.- မၩအၥၭဘဲၫနီၪတၭ, အဝ့ၫၥံၪဒုၪဒွ့ၪအ ဝ့ၫနီၪ,စံၭဝ့ၫ, နဝ့ၫဒၪနမွဲအဝ့ၫလဂၩနီၪအထံၩအဖျဲ,",
			"29": "<sup>29</sup> အ့ၪမွဲပဝ့ၫဒၪယီၩ,ပမွဲစမိစ့ၭအထံၩအဖျဲၥံၪလီၫ.- ပ ၥ့ၪယၫလၧယွၩချဲၩ့ဒုၪ့လိၬအၥၭလၧစမိစ့ၭတၭ,အ့ၪမွဲ အဝ့ၫဒၪလဂၩနီၪ မွဲအအီၪထၪ့အထံၭခီၫခီၫလဲၪနီၪ, ပ",
			"30": "<sup>30</sup> ၥ့ၪယၫအ့ၬ.- ၦလဂၩနီၪချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭအဝ့ၫ ၥံၪ,အဝ့ၫနီၪမၩဖၩ့ထၪ့လါနၫ့ယမ့ၬၥၪတၭ, မွဲအအီၪ ထၪ့ခီၫခီၫလဲၪနီၪ, နၥံၪလၥ့ၪယၫဘၪတၭ, မွဲဆၧထီၫမံၫ",
			"31": "<sup>31</sup> ထီၫမၪအလးလီၫ.- မွဲလါနၫ့ဘိၩပၥ့ၪယၫလၧပဆၧ ဒဲၩဘၭဖိၪလဖၪနီၪ, ယွၩခိၭနၪအလူအ့ၬ. အ့ၪမွဲၦလ ဂၩဂၩလၧအယူၭယၪ့ယွၩနီၪ, မၩဝ့ၫထီးအဘၪအ",
			"32": "<sup>32</sup> ဝ့ၫအၥၭတၭ, မိခိၭနၪအလူလီၫ.- ၦအီၪဖျဲၪလၧအမ့ၬ ဘျီၪလဂၩတၭ, ဆၧမၩဖၩ့ထၪ့ထဲၩ့အမ့ၬၥၪနီၪ,လၧ ဖျိၩ့လံၩလံၩခီးဘိၩ့နဲၪ့ယီၩ, ပနါဂၧၫ့ဘၪနးဆိၭအ့ၬ.",
			"33": "<sup>33</sup> အဝ့ၫနီၪအ့ၪလဘၪဆဲၫ့ဘၪလၧယွၩနီၪ, မွဲအမၩဆၧၥ့ၪ နးမံၩ့အ့ၬ.",
			"34": "<sup>34</sup> အဝ့ၫၥံၪချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭအဝ့ၫနီၪ,နဝ့ၫဒၪယီၩ နအီၪဖျဲၪနဝ့ၫလၧဆၧဒဲၩဘၭအဖၧၩ့ထၧၫ့ဂၩယၫနီၪ, မွဲနၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ပၧၩဆ့ဧၪ. အဝ့ၫၥံၪနၫ့ထၪ့ခွံၬအဝ့ၫ ဒၪလၧခီၫ့လီၫ.",
			"35": "<sup>35</sup> ယ့ၫၡုၬနါဂၧၫ့လၧအဝ့ၫၥံၪ နၫ့ထၪ့ခွံၬအဝ့ၫဒၪလၧခီၫ့ တၭ,ထီးအဒၪဘၪဝ့ၫနီၪ, စံၭအဝ့ၫဒၪ, ယွၩအဖိၪခွၫနီၪ",
			"36": "<sup>36</sup> မွဲနနဲၩဆ့ဧၪ.- အဝ့ၫဒၪချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭဝ့ၫ ကဆါဧ့,ဘဲၫၥိၭယမိနဲၩအဝ့ၫဒၪတၭ, မွဲပလၫလဂၩ",
			"37": "<sup>37</sup> လဲၪ.- ယ့ၫၡုၬစံၭအဝ့ၫ, နဒၪဘၪယူၭအဝ့ၫယူၭ,ၦလၧ",
			"38": "<sup>38</sup> အချဲၩ့ဒုၪ့နၧၩလဂၩယီၩမွဲအဝ့ၫနီၪလီၫ.- အဝ့ၫဒၪ စံၭဝ့ၫ,ကဆါဧ့, ယနဲၩယူၭးထွံၩလၩ့အခၪ့ဘိၪ့ထၪ့",
			"39": "<sup>39</sup> ဘၩထၪ့အဝ့ၫလီၫ.- ယ့ၫၡုၬစံၭအဝ့ၫ, ၦလၧအလဒၪ ဘၪဆၧလဖၪနီၪဘဲၫၥိၭအမိဒၪထၪ့ဆၧတၭ, ၦလၧအဒၪ ဆၧလဖၪနီၪဘဲၫအမ့ၬမိဘျီၪအၥိၭ, ယဂဲၫလၩ့လၧဂၪ့",
			"40": "<sup>40</sup> ခိၪချိၫ့ယီၩလၧဆၧစ့ၩရၫ့အဂဲးလီၫ.- ၦဖၫရစံၫၥံၪလၧ အအီၪလၧအၥိၭလနၩ့နၩ့နါဂၧၫ့ဝ့ၫတၭ, စံၭအဝ့ၫနီၪ,",
			"41": "<sup>41</sup> ပဝ့ၫဒၪယီၩမွဲပမ့ၬဘျီၪဆ့ဧၪ.- ယ့ၫၡုၬစံၭအဝ့ၫၥံၪ, နၥံၪအမ့ၬအ့ၪဘျီၪနီၪ, နၥံၪအဆၧဒဲၩဘၭအီၪအ့ၬ. အ့ၪမွဲဘိၩ့နဲၪ့ယီၩနၥံၪစံၭ, ပဝ့ၫဒၪယီၩပဒၪဆၧလီၫ. မၩအၥၭဘဲၫနီၪတၭ, နၥံၪအဆၧဒဲၩဘၭအီၪဒံၭလီၫ."
		},
		"10": {
			"1": "<sup>1</sup> ယလီၩဘၪနၥံၪတီၩတီၩလီၩ့လီၩ့ယီၩ,ၦလၧအ ဂဲၫနုၬဝ့ၫ လၧၥိၪအဖီၩ့ဖၧၩ့ လၧအလမွဲဘၪ လၧတရၫ့ အဖၧၩ့နီၪတၭ,အ့ၪဂဲၫခၫ့ဖၬ လၧအလးလစီၪ့ဒၪနီၪ,",
			"2": "<sup>2</sup> မွဲဆၧဂူၪဆၧဘျၪ,ဒဲထမျိၭထမျၬလီၫ.- အ့ၪမွဲၦလၧ အဂဲၫနုၬဝ့ၫလၧတရၫ့လဂၩနီၪ မွဲၥိၪအၡၩယူၬၥိၪလီၫ.",
			"3": "<sup>3</sup> ၦအီၪခိၭတရၫ့လဂၩနီၪဝဲထၪ့န့ဝ့ၫအဂးတၭ, အၥိၪ လဖၪခိၭနၪအလူတၭ, ကိၭထၪ့အၥိၪဒၪဝ့ၫလၧအမံၩ့",
			"4": "<sup>4</sup> တၭ,စဲၪ့ထၪ့ဂၧၩ့အဝ့ၫၥံၪလီၫ.- ထီးအဒုၭစဲၪ့ထၪ့ အၥိၪဒၪဝ့ၫထီးအလူၬနီၪ,လ့ၩထၪ့လၧယၫတၭၥိၪလ ဖၪဖိၬထၪ့အခဲၫ့လီၫ. အဂဲးဘဲၫယီၩ ၥ့ၪယၫဝ့ၫအလူ",
			"5": "<sup>5</sup> လီၫ.- အ့ၪမွဲၦမွံၩနီၪဖိၬဝ့ၫအခဲၫ့အ့ၬ. မွဲအစဲၪ့ခွံၬဒၪဝ့ၫ လၧအအီၪလီၫ. အဂဲးဘဲၫၫယီၩၥ့ၪယၫၦမွံၩအလူအ့ၬ.",
			"6": "<sup>6</sup> ယ့ၫၡုၬလီၩလၩ့လၬလၩ့ၦလဖၪနီၪလၧ ဆၧချဲၩ့အဒီၩ့ ယီၩလါနၫ့ဘိၩ့, ဆၧလၧအလီၩဘၪအဝ့ၫၥံၪနီၪ မွဲအနၪ ဝ့ၫၥ့ၪအ့ၬ.",
			"7": "<sup>7</sup> မၩအၥၭဘဲၫနီၪတၭ, ယ့ၫၡုၬစံၭဒီၭဝ့ၫ, ယလီၩဘၪ နၥံၪတီၩတီၩလီၩ့လီၩ့ယီၩ, ယဝ့ၫဒၪယီၩယမွဲၥိၪဖီၩ့",
			"8": "<sup>8</sup> အတရၫ့လီၫ.- ကယဲၦလၧအဂဲၫဆိၫဝ့ၫလၧယမ့ၬယၫ လဂၩဂၩနီၪ, မွဲဆၧဂူၪ ဆၧဘျၪ ဒဲထမျိၭ ထမျၬလီၫ.",
			"9": "<sup>9</sup> အ့ၪမွဲၥိၪလဖၪခိၭနၪအလူအ့ၬ.- ယဝ့ၫဒၪယီၩယမွဲ တရၫ့လီၫ.မွဲလၧယကၠီၩ့ယီၩ ၦအ့ၪဂဲၫနုၬဝ့ၫနီၪ, မိထီၩ့ လၧဆၧထိးထဲၩ့တၩ့ထဲၩ့ဝ့ၫတၭ, မိနုၬစဲၪ့ထၪ့နုၬစဲၪ့",
			"10": "<sup>10</sup> ထၪ့ဝ့ၫတၭ, မိဒၪန့ဆၧအၪ့ဆၧအီၩလီၫ.- ဆၧလၧဆၧ ဂူၪဆၧဘျၪနီၪ, အ့ၪလမွဲဘၪဘဲၫၥိၭအမိအၪ့ဂူၪဆၧဒဲ မၩၥံၫဆၧ, ဒဲမၩဂၭဂီၩ့ဆၧအကၠီၩ့တၭ, ဂဲၫဝ့ၫအ့ၬ. အ့ၪမွဲယဝ့ၫဒၪယီၩဘဲၫၥိၭအဝ့ၫၥံၪမိန့ဘၪ ဆၧမၧၫ့ဒဲန့ ဘၪဝ့ၫအၪအၪလ့ၬတၭ, ယဂဲၫယဝ့ၫဒၪလီၫ.",
			"11": "<sup>11</sup> ယဝ့ၫဒၪယီၩ ယမွဲၦယူၬၥိၪလၧအဂ့ၩလဂၩလီၫ. ၦယူၬၥိၪလၧအဂ့ၩလဂၩယီၩ, အီၪက့ၪလၩ့ခွံၬအၥၭ",
			"12": "<sup>12</sup> လၧၥိၪအဂးလီၫ.- အ့ၪမွဲၦလၧအလမွဲဘၪၦယူၬၥိၪ, လမွဲဘၪၥိၪအကဆါတၭ, ဒိၭအၪ့လံၩ့လၩ့အၥၭလ ဂၩနီၪ,ထီးအဒၪဘၪ ထွံၪမံၩ့ ဂဲၫဝ့ၫတၭ, စဲၪ့ဒၪခွံၬၥိၪ တၭ,စဲၪ့ဖျိၭဝ့ၫလီၫ. ထွံၪမံၩ့နီၪအၪ့ဂူၬအဲၪ့အဝ့ၫၥံၪ",
			"13": "<sup>13</sup> တၭ,မၩလၩ့မုလၩ့ဖၭၥိၪလဖၪလီၫ.- ၦဒိၭအၪ့လံၩ့ လၩ့အၥၭလဂၩနီၪ, မွဲလၧအဒိၭအၪ့လံၩ့လၩ့အၥၭအ ကၠီၩ့နီၪ အၥၭလအီၪဘၪလၧၥိၪတၭ, စဲၪ့ဒၪခွံၬဝ့ၫလီၫ.",
			"14": "<sup>14</sup> ယဝ့ၫဒၪယီၩ ယမွဲၦယူၬၥိၪလၧအဂ့ၩတၭးယၥ့ၪ",
			"15": "<sup>15</sup> ယၫယဆၧ,ဒဲယဆၧၥ့ၪယၫယၧၩဆ့,- ဘဲၫဖါၥ့ၪ ယၫယၧၩ,ဒဲယၥ့ၪယၫဖါအၥိၭနီၪဆ့လီၫ. ယအီၪက့ၪ",
			"16": "<sup>16</sup> လၩ့ယၥၭမၧၫ့လၧၥိၪအဂးလီၫ.- ယၥိၪလၧအဂူၫ ဂၩလဖၪနီၪ,လၧအလမွဲဘၪလၧဖီၩ့ယီၩ အီၪဒံၭဝ့ၫ လီၫ.အဝ့ၫၥံၪနီၪယဘၪဂဲၫၥိၫ့ထဲၩ့ဝ့ၫတၭ, အဝ့ၫၥံၪမိ ခိၭနၪယလူတၭ, မိအီၪဝ့ၫဘဲၫၥိၪလဒီၪ့ဎးဒဲၦယူၬၥိၪ",
			"17": "<sup>17</sup> လဂၩဎးလီၫ.- မွဲယဖ့ၪလၫ့ခွံၬယၥၭမၧၫ့ ဘဲၫၥိၭယမိ မၩန့ထဲၩ့ဒီၭဝ့ၫ အကၠီၩ့နီၪတၭ, ယဖါအဲၪယၧၩ",
			"18": "<sup>18</sup> လီၫ.- ၦအၪ့ဂူၬန့ဝ့ၫလၧယၧၩနးဂၩအ့ၬ. မွဲယဖ့ၪလၫ့ ခွံၬဒၪယဝ့ၫတၭး ယဖ့ၪလၫ့ခွံၬၥ့ၪ,ဒဲယအၪ့မၩန့ ထဲၩ့ဒီၭၥ့ၪလီၫ. ဆၧမၪလူၬယီၩယဒိၭန့လၧယဖါလီၫ.",
			"19": "<sup>19</sup> မၩအၥၭဘဲၫနီၪတၭ, လၧဆၧချဲၩ့လဖၪနီၪအကၠီၩ့, ၦယုဒၫဖိၪၥံၪမၩထၪ့ဒီၭအၥၭ, ဖၨၪထံဖၨၪထီၫလီၫ.",
			"20": "<sup>20</sup> တၭၦလၧအကျၩအၪဂၩစံၭဝ့ၫ, မွဲဆၧနၪအီၪလၧ အလီၩ့တၭ,မွဲၦအဖျႃလီၫ. မွဲဘၪနီၫနၥံၪခိၭနၪအလူနီၪ",
			"21": "<sup>21</sup> လဲၪ.- တၭအဂူၫဂၩလနၩ့နၩ့စံၭဝ့ၫ, ဆၧချဲၩ့လဖၪယီၩ မွဲၦလၧဆၧနၪအီၪလၧ အလီၩ့အဆၧချဲၩ့အ့ၬ. ဆၧနၪ နီၪမၩဖၩ့ထၪ့ၦမ့ၬဘျီၪအမ့ၬၥၪဘၪမိၥ့ၪဧၪ.",
			"22": "<sup>22</sup> ဘၪလၧဆၧဂီးခၫနီၪ, ၦမၩဘိၪ့ဖလါဆၧလၧယရု",
			"23": "<sup>23</sup> စလံၫ့အဖၧၩ့,- ယ့ၫၡုၬစဲၪ့လဲးလီၩ့လၧဆၧလုအဂံၪ့",
			"24": "<sup>24</sup> စစီလမၧၫ့အထိၬချိၫ့နီၪလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ၦယုဒၫဖိၪၥံၪ ဂဲၫအီၪဝၬဖီၩ့အဝ့ၫတၭ, စံၭဝ့ၫ,နဝ့ၫဒၪ ယီၩနမိမၩဂံၩ့ဂၩ့ပၥၭဆံၭယံၬလဲၪ. နအ့ၪမွဲဎရံၬနီၪ လီၩဘၪပၧၩလၩ့ထံးလၩ့ဆ့ၭဆံၭ.",
			"25": "<sup>25</sup> ယ့ၫၡုၬချဲၩ့ဆၧၫ့အဝ့ၫၥံၪ, ယလီၩဘၪယူၭနၥံၪယူၭ တၭ,နၥံၪနဲၩနၥံၪဝ့ၫအ့ၬ. ဆၧမၩလၧယမၩလၧယဖါ အမံၩ့လဖၪနီၪ, ထိးအၥၭလၧယဂဲးယကၠီၪ့လီၫ.",
			"26": "<sup>26</sup> မွဲလါနၫ့ဘိၩ နၥံၪဝ့ၫဒၪယီၩနၥံၪနဲၩနၥံၪဝ့ၫအ့ၬ. အ ဂဲးဘဲၫယီၩဘဲၫယစံၭနၥံၪအၥိၭနီၪ နၥံၪဘၪဆဲၫ့လၧယ",
			"27": "<sup>27</sup> ၥိၪအ့ၬ.- ယၥိၪလဖၪမိခိၭနၪယလူတၭ, ယၥ့ၪယၫ",
			"28": "<sup>28</sup> အဝ့ၫၥံၪတၭ, အဝ့ၫၥံၪဖိၬယခဲၫ့လီၫ.- ယဖ့ၪလၫ့အဝ့ၫ ၥံၪလၧဆၧမၧၫ့လၩ့ဆိၩလၩ့ကၠၪတၭ, အဝ့ၫၥံၪမိဘၪ ဆၧဂၭဂီၩ့ဂၭစၪနးဆိၭအ့ၬး ၦအၪ့ဂူၬမၩန့ဆီၪ့",
			"29": "<sup>29</sup> အဝ့ၫၥံၪလၧယစူၪဖၧၩ့ယီၩၥ့ၪနးဂၩအ့ၬ.- ယဖါလၧအ ဖ့ၪလၫ့အဝ့ၫၥံၪလၧယစူၪဖၧၩ့လဂၩနီၪ, ဒိၪနဲၪ့ကယဲ ဆၧထီးအလူၬတၭ, ၦအၪ့ဂူၬန့ဆီၪ့ အဝ့ၫၥံၪလၧယဖါ",
			"30": "<sup>30</sup> အစူၪဖၧၩ့ၥ့ၪနးဂၩအ့ၬ.- ယဝ့ၫဒၪဒဲယဖါနီၪ မွဲဆၧ",
			"31": "<sup>31</sup> လမံၩ့ဎးလီၫ.- မၩအၥၭဘဲၫနီၪတၭ,ၦယုဒၫဖိၪလဖၪ ဘဲၫၥိၭအမိခွံၬဘၪအဝ့ၫလၧလိးတၭ, အၪ့ထုၫ့ထၪ့",
			"32": "<sup>32</sup> ဒီၭလိးလဖၪနီၪလီၫ.- တၭယ့ၫၡုၬစံၭဆၧၫ့အဝ့ၫၥံၪ, ယဒုၭနဲၪနၥံၪဆၧမၩလၧအဂ့ၩလၧယဖါအၪမံၩ့တၭ, မွဲနၥံၪမိခွံၬယၧၩလၧလိးလၧ ဆၧလဖၪနီၪအကၠီၩ့လမံၩ့",
			"33": "<sup>33</sup> မံၩ့လဲၪ.- ၦယုဒၫဖိၪၥံၪချဲၩ့ဆၧၫ့ဝ့ၫတၭ, စံၭဝ့ၫ, ပမိခွံၬ နၧၩလၧလိးနီၪလၧဆၧမၩဂ့ၩအကၠီၩ့မွဲအ့ၬ. မွဲလၧဆၧ ဒုၪဒွ့ၪကဆါနီၪ,နမွဲၦၡၩလါနၫ့ဘိၩ, နအီၪက့ၪနၥၭ လၧနမွဲယွၩနီၪအဂဲးလီၫ.",
			"34": "<sup>34</sup> ယ့ၫၡုၬချဲၩ့ဆၧၫ့အဝ့ၫၥံၪ, ဆၧကွ့ၭအၥၭလၧနၥံၪ အဆၧမၪလူၬအဖၧၩ့, ယ စံၭ န ၥံၪ မွဲ က ဆါ ၥံၪ",
			"35": "<sup>35</sup> မွဲ အ့ၬ ဧၪ.- ၦလၧအထီးန့ကဆါအလူအထၫလဖၪ နီၪ, ဆၧအ့ၪကိၭအဝ့ၫၥံၪ လၧကဆါတၭ, လံၬအဆၧ",
			"36": "<sup>36</sup> ချဲၩ့နီၪအ့ၪလဂၭဂီၩ့ဘၪတၭ,- ၦလၧဖါအီၪက့ၪဆံၫ့ဎံၪ ဝ့ၫ,ဒဲအၪ့မၧၫ့လၩ့န့ဝ့ၫလၧဂၪ့ခိၪချိၫ့ယီၩလဂၩနီၪ, လၧအစံၭဝ့ၫ, ယဝ့ၫဒၪယီၩယမွဲယွၩအဖိၪခွၫအကၠီၩ့ တၭ,မွဲနၥံၪစံၭ,နဒုၪဒွ့ၪယွၩနီၪဆ့ဧၪ.",
			"37": "<sup>37</sup> ယဖါအဆၧမၩနီၪ,ယအ့ၪလမၩဘၪတၭ,နဲၩလ",
			"38": "<sup>38</sup> ဂ့ၩ.- ယအ့ၪမၩတၭ, နၥံၪအ့ၪလနဲၩဘၪလါနၫ့ယၧၩ တၭ,ဘဲၫၥိၭနၥံၪမိၥ့ၪယၫ, ဒဲနဲၩလၧဖါအီၪ လၧယ ဖၧၩ့,ဒဲယအီၪလၧယဖါအဖၧၩ့နီၪ, နဲၩယဆၧမၩလ ဖၪယီၩဆံၭ.",
			"39": "<sup>39</sup> မၩအၥၭဘဲၫနီၪတၭ, အဝ့ၫၥံၪအၪ့ဎၬဖီၪ့ထၬဒီၭအ ဝ့ၫဒၪတၭ, မွဲအဂၭထၪ့ခွံၬလၧအဝ့ၫၥံၪအစူၪဖၧၩ့လီၫ.",
			"40": "<sup>40</sup> လ့ၩဒီၭလၧယီၫဒၫ့အဝါလခီၫ, ထီးစယီဟၫ့ဘၭတံၫ ဇၫ့ဆၧလၧအခၪ့ထံၭအလးတၭ, အီၪဝ့ၫထီးနီၪလီၫ.",
			"41": "<sup>41</sup> ၦအၪဂၩဂဲၫလၧအအီၪတၭ, စံၭဝ့ၫဒၪ,စယီဟၫ့မၩလၩ့ လၭဆၧနးမံၩ့အ့ၬ. အ့ၪမွဲကယဲစယီဟၫ့ ချဲၩ့ဆၧလၧ အယီၩလဂၩအဂဲးအကၠီၪ့ထီးအလူၬနီၪ, မွဲဆၧအတီၩ",
			"42": "<sup>42</sup> အလီၩ့လီၫ.- ၦအၪဂၩနဲၩထဲၩ့အဝ့ၫထီးနီၪလီၫ."
		},
		"11": {
			"1": "<sup>1</sup> ၦဘၪဆၧဆၫလဂၩ, မွဲစလၭဇရၧၭ လၧဘ့ၭၥနံၫ, အထၧၫ့ဖုဝဲမုၪ နးမၫရံၫဒဲနးမၫၥၫ အတဝၫ့ဖၧၩ့နီၪ",
			"2": "<sup>2</sup> လီၫ.- ၦလၧအဘၪဆၧဆၫစလၭဇရၧၭလဂၩနီၪ,မွဲအ ထၧၫ့ဖုဝဲလၧနးမၫရံၫလဂၩလၧအဂုၪကဆါလၧၥိၪနၧၫ့",
			"3": "<sup>3</sup> မၧၫ့နီၪ,ထူၭခွံၬဝ့ၫအခၪ့လၧအခိၪၥူၫလီၫ.- မၩအၥၭ ဘဲၫနီၪတၭ, အထၧၫ့ဖုဝဲမုၪလဖၪအၪ့မၧၫ့ၦလ့ၩလၧအ အီၪတၭ,စံၭဝ့ၫ,ကဆါဧ့,ယိခွါ, ၦလၧနအဲၪဝ့ၫလဂၩ",
			"4": "<sup>4</sup> နီၪ,ဘၪဆၧဆၫလီၫ.- ယ့ၫၡုၬနါဂၧၫ့ဝ့ၫတၭ,စံၭဝ့ၫ, ဆၧဆၫနီၪလမွဲဘၪဆၧဆၫ ထီးအမိၥံၫဝ့ၫတၭ, မွဲလၧ ယွၩအလၩအဖၩ့အဂး, ဘဲၫၥိၭယွၩအဖိၪခွၫအလၩ အဖၩ့မိအီၪဖျီၪထၪ့လၧအဝ့ၫနီၪအကၠီၩ့လီၫ.",
			"5": "<sup>5</sup> ယ့ၫၡုၬအဲၪနးမၫၥၫ, ဒဲအထၧၫ့ဖုဝဲမုၪ, ဒဲစလၭဇ",
			"6": "<sup>6</sup> ရၧၭနီၪလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ထီးအနါဂၧၫ့ဝ့ၫ",
			"7": "<sup>7</sup> လၧအဆၫတၭ, အီၪဝ့ၫထီးအလးနီၪနံၫနံၩလီၫ.- လၧ ခဲၫ့ထဲၩ့တၭ, စံၭအထံၩအဖျဲၥံၪ, မွဲပထဲၩ့ထဲၩ့ၡီၩ့လၧ",
			"8": "<sup>8</sup> ခးယုဒၫအဖၧၩ့ဘီၪ.- အထံၩအဖျဲၥံၪစံၭအဝ့ၫ,ရၭဘံၫ ဧ့,ဘိၩ့လမီခိၬဒၪလ့ၬ ၦယုဒၫဖိၪၥံၪအၪ့ဎၬနၧၩဘဲၫၥိၭ အမိခွံၬနၧၩလၧလိးတၭ, မွဲနမိထဲၩ့ထဲၩ့ဒီၭလၧနီၪဆ့",
			"9": "<sup>9</sup> ဧၪ.-ယ့ၫၡုၬချဲၩ့ဆၧၫ့ဝ့ၫ, ဆၧလၧမုဆၫနီၪအီၪလဆံၫ နံၫနၩရံၫမွဲအ့ၬဧၪ. ၦအ့ၪစဲၪ့လၧမုဆၫလခီၫတၭ, ဘၪ ဆၧနးမံၩ့အ့ၬ. အဂဲးဘဲၫယီၩဒၪဘၪဂၪ့ခိၪယီၩ အဆၧ",
			"10": "<sup>10</sup> ဖၩ့လီၫ.- မွဲလါနၫ့ပအ့ၪစဲၪ့လၧမုနၩလခီၫတၭ,မွဲလၧ ဆၧဖၩ့လအီၪဘၪ လၧအဖၧၩ့အကၠီၩ့နီၪ, အခၪ့မိဘၪ ထၧၩ့ဝ့ၫလီၫ.",
			"11": "<sup>11</sup> ချဲၩ့ဆၧလဖၪနီၪဂီၩ့တၭ,စံၭအဝ့ၫၥံၪ,ပတခွၫစလၭ ဇရၧၭမံၫမၪဝ့ၫဒၪလီၫ.- မွဲလါနၫ့ဘိၩယမိလ့ၩထိၪဂဲ",
			"12": "<sup>12</sup> ထုၪ့အဝ့ၫလီၫ.-မၩအၥၭဘဲၫနီၪတၭ, အထံၩအဖျဲၥံၪ စံၭဝ့ၫ,ကဆါဧ့, အဝ့ၫဒၪအ့ၪမံၫမၪဝ့ၫတၭ, မိနၪ့ထၪ့အ",
			"13": "<sup>13</sup> ၥၭလီၫ.- ယ့ၫၡုၬစံၭဆၧလၧအၥံၫဝ့ၫ အဂဲးလါနၫ့တၭ, အဝ့ၫၥံၪဆီၫ့မီၪ့လၧအစံၭ, အဝ့ၫအီၪပွံၭမံၫမၪဝ့ၫအဂဲး",
			"14": "<sup>14</sup> လီၫ.- ထီးနီၪလဖၧၫ့ယ့ၫၡုၬလီၩဘၪအဝ့ၫၥံၪလၩ့ထံး",
			"15": "<sup>15</sup> လၩ့ဆ့ၭ, လၧစလၭဇရၧၭနီၪၥံၫယူၭဝ့ၫယူၭ.- မွဲယလ အီၪဘၪထီးနီၪအကၠီၩ့, ယၥၭထိၬလၧနၥံၪအဂး, ဘဲၫ ၥိၭနၥံၪမိနဲၩဆၧလီၫ. မွဲလါနၫ့ဘိၩ, မွဲပလ့ၩၡီၩ့လၧ",
			"16": "<sup>16</sup> အအီၪဘီၪ.- မၩအၥၭဘဲၫနီၪတၭ,စထီမၭကိၭထဲၩ့ဝ့ၫ လၧစဒံဒမၧၭလဂၩ, စံၭအထံၩအဖျဲၥံၪ လၧအဂူၫဂၩ လဖၪနီၪ, မွဲပလ့ၩၥံၫၡီၩ့လၧအဝ့ၫနီၪဘီၪ.",
			"17": "<sup>17</sup> မၩအၥၭဘဲၫနီၪတၭ, ယ့ၫၡုၬလ့ၩထီၩ့တၭ,ဒၪဘၪ အဝ့ၫနီၪ အီၪလၧဆၧၥွၪခိၪအဖၧၩ့ လံၥၫ့ယူၭ.-",
			"18": "<sup>18</sup> တၭ ဘ့ၭၥနံၫအီၪယဲၩ့လၧယရုစလံၫ့ ဘူၭထၪ့လဆံၫယဲစ",
			"19": "<sup>19</sup> တ့ဒအၧၫ့တၭ,- ၦယုဒၫဖိၪအၪဂၩ ဂဲၫဝ့ၫဘဲၫၥိၭအမိ ချဲၩ့မုၬချဲၩ့လၩနးမၫၥၫ,ဒဲနးမၫရံၫလၧအထၧၫ့ဖုဝဲ ခွၫအကၠီၩ့လီၫ.",
			"20": "<sup>20</sup> မၩအၥၭဘဲၫနီၪတၭ, ထီးနးမၫၥၫနါဂၧၫ့လၧယ့ၫၡုၬ ဂဲၫဝ့ၫနီၪ, လ့ၩအၪ့ဂၬအဝ့ၫတၭ, အ့ၪမွဲနးမၫရံၫလဂၩ",
			"21": "<sup>21</sup> ဆၧၫ့နၩ့အီၪဝ့ၫလၧဂံၪ့ဖၧၩ့နီၪလီၫ.- မၩအၥၭဘဲၫနီၪ တၭ,နးမၫၥၫစံၭယ့ၫၡုၬ, ကဆါဧ့, နအ့ၪအီၪထီးယီၩ",
			"22": "<sup>22</sup> ယထၧၫ့ဖုဝဲခွၫၥံၫဝ့ၫအ့ၬ.- မွဲလါနၫ့ဘိၩ့နဲၪ့ယီၩဒၪလ့ၬ, ယၥ့ၪယၫထီးဒၪနအၪ့ကံၩ့ဆၧလၧယွၩလမံၩ့မံၩ့နီၪ,",
			"23": "<sup>23</sup> ယွၩမိဖ့ၪလၫ့နၧၩလီၫ.- ယ့ၫၡုၬစံၭအဝ့ၫ,နထၧၫ့ဖုဝဲ",
			"24": "<sup>24</sup> ခွၫနီၪမိဂဲထုၪ့ထဲၩ့ဝ့ၫလီၫ.- နးမၫၥၫစံၭဆၧၫ့ဝ့ၫ,မွဲအမိ ဂဲထုၪ့ထဲၩ့ဝ့ၫလၧမုနံၩထုၬခိၬအဆၧဂဲထုၪ့ထဲၩ့နီၪ",
			"25": "<sup>25</sup> ယၥ့ၪယၫယဝ့ၫလီၫ.- ယ့ၫၡုၬစံၭဆၧၫ့အဝ့ၫ, ယဝ့ၫဒၪ ယီၩယမွဲဆၧဂဲထုၪ့ထဲၩ့ဒဲဆၧမၧၫ့လီၫ.ၦလၧအနဲၩ ထဲၩ့ယၧၩယီၩ, အ့ၪၥံၫလါနၫ့နီၪ, မိမၧၫ့ဝ့ၫဒၪလီၫ.",
			"26": "<sup>26</sup> ကယဲၦလၧအမၧၫ့ဝ့ၫ, ဒဲနဲၩထဲၩ့ယၧၩလဂၩဂၩ နီၪ,အဆိၩဆိၩအကၠၪကၠၪၥံၫလၧၩ့နးဆိၭအ့ၬ. အ",
			"27": "<sup>27</sup> ယီၩလမံၩ့မွဲနနဲၩဆ့ဧၪ.- အဝ့ၫဒၪစံၭဆၧၫ့ဝ့ၫ ယနဲၩ လီၫ,ကဆါဧ့းယနဲၩနၧၩလၧနမွဲၦလၧအဂဲၫလၩ့လၧ ဂၪ့ခိၪချိၫ့ယီၩ, ယွၩအဖိၪခွၫဎရံၬနီၪလီၫ.",
			"28": "<sup>28</sup> ချဲၩ့ဆၧနီၪဂီၩ့တၭ, နးမၫၥၫထဲၩ့ကိၭၥူၪအထၧၫ့ဖုဝဲ မုၪနးမၫရံၫတၭ, စံၭဝ့ၫ,ဆရၫဂဲၫထီၩ့ယူၭတၭ, ကိၭ",
			"29": "<sup>29</sup> နၧၩလီၫ.- ထီးအဝ့ၫဒၪနါဂၧၫ့ဝ့ၫနီၪဂဲထုၪ့ဝ့ၫချဲၫ့ချဲၫ့ လ့ၬတၭ,လ့ၩဝ့ၫလၧအအီၪလီၫ.",
			"30": "<sup>30</sup> ယ့ၫၡုၬဂဲၫလထီၩ့ဒံၭဘၪ လၧတဝၫ့ဖၧၩ့နီၪး အ့ၪမွဲ",
			"31": "<sup>31</sup> အီၪဝ့ၫထီးနးမၫၥၫအၪ့ဂၬဝ့ၫအလးနီၪလီၫ.- မၩအၥၭ ဘဲၫနီၪတၭ, ၦယုဒၫဖိၪၥံၪလၧအချဲၩ့မုၬချဲၩ့လၩအဝ့ၫ နီၪ,အီၪဝ့ၫလၧအၥိၭလၧဂံၪ့ဖၧၩ့တၭ, ဒၪဘၪနးမၫ ရံၫဂဲထုၪ့ချဲၫ့ချဲၫ့လ့ၬတၭ, စဲၪ့ထၪ့နီၪအဝ့ၫၥံၪဖိၬထၪ့ အခဲၫ့တၭ,စံၭဝ့ၫ, မွဲအလ့ၩလၧဆၧၥွၪခိၪနီၪ, ဘဲၫၥိၭ အမိဂၪ့ဝ့ၫထီးနီၪလီၫ.",
			"32": "<sup>32</sup> မၩအၥၭဘဲၫနီၪတၭ, ထီးနးမၫရံၫလ့ၩထီၩ့ဝ့ၫ ထီး ယ့ၫၡုၬအအီၪနီၪ, ဒၪဘၪဝ့ၫတၭ, ထိၪလၩ့ထံၩဖါအ ၥၭလၧအခၪ့ထံၭနီၪ, စံၭဝ့ၫဒၪ, ကဆါဧ့, နအ့ၪအီၪ",
			"33": "<sup>33</sup> ထီးယီၩယထၧၫ့ဖုဝဲခွၫၥံၫဘၪဝ့ၫအ့ၬ.- မၩအၥၭ ဘဲၫနီၪတၭ,ယ့ၫၡုၬဒၪဘၪဝ့ၫလၧအဂၪ့ဆၧနီၪ, ဒဲၦယု ဒၫဖိၪလၧအဂဲၫလၧအၥိၭ ဂၪ့ဝ့ၫဆ့တၭ, အဝ့ၫဒၪဂၪ့",
			"34": "<sup>34</sup> အုၩလၧအၥၭခံဖၧၩ့တၭ, အၥၭခိထၪ့ဝ့ၫ,- တၭစံၭဝ့ၫ, မွဲနၥံၪအီၪက့ၪဝ့ၫခီၫခီၫလဲၪ. အဝ့ၫၥံၪစံၭဝ့ၫ, ကဆါဧ့,",
			"35": "<sup>35</sup> ဂဲၫယိခွါ, နဝ့ၫဘီၪ.- ယ့ၫၡုၬအမ့ၬထံၫလၩ့ဝ့ၫဒၪ",
			"36": "<sup>36</sup> လီၫ.- မၩအၥၭဘဲၫနီၪတၭ,ၦယုဒၫဖိၪၥံၪစံၭဝ့ၫ,ယိခွါ,",
			"37": "<sup>37</sup> မွဲအအဲၪအဝ့ၫဒၪ လဂၩဆံၭဒိၪလဲၪ.- ၦလၧအဝ့ၫၥံၪအ ကျၩလနၩ့နၩ့စံၭဝ့ၫ, ၦလၧအမၩဒၪထၪ့ထဲၩ့ၦမ့ၬဘျီၪ ၥ့ၪဝ့ၫလဂၩယီၩ,ဘဲၫၥိၭအဝ့ၫနီၪထီးၥံၫလဂ့ၩတၭ, မွဲအမၩဝ့ၫၥ့ၪအ့ၬဧၪ.",
			"38": "<sup>38</sup> မၩအၥၭဘဲၫနီၪတၭ, ယ့ၫၡုၬဂၪ့အုၩလၧအၥၭခံဖၧၩ့ ဒီၭတၭ,လ့ၩဝ့ၫထီၩ့လၧဆၧၥွၪခိၪအအီၪနီၪ, မွဲလိးအိၩ ဖၧၩ့နီၪဆၧချႃၬဘံၭထၬဝ့ၫလၧလိးလီၫ.",
			"39": "<sup>39</sup> ယ့ၫၡုၬစံၭဝ့ၫ,ၥုၭခွံၬလိးနီၪဘီၪ. ၦလၧအၥံၫအ ထၧၫ့ဖုဝဲမုၪ, နးမၫၥၫလဂၩ,စံၭအဝ့ၫ, ကဆါဧ့,ဘိၩ့နဲၪ့ ယီၩမွဲအအီၪယူၭလံၥၫ့ယူၭတၭ,မိနၧၫ့အုၪဝ့ၫလီၫ.",
			"40": "<sup>40</sup> ယ့ၫၡုၬစံၭအဝ့ၫ, ယလီၩဘၪနၧၩ တီၩတီၩလီၩ့လီၩ့, နအ့ၪနဲၩဆၧတၭ, နမိဒၪဘၪယွၩအလၩအဖၩ့မွဲအ့ၬ",
			"41": "<sup>41</sup> ဧၪ.- မၩအၥၭဘဲၫနီၪတၭ, အဝ့ၫၥံၪၥုၭခွံၬလိးလီၫ. ယ့ၫၡုၬစၪ့ထၪ့အမ့ၬၥၪယိထၪ့ဆၧတၭ, စံၭဝ့ၫ, ဖါဧ့, ယစံၭထၪ့အၪ့အူၭနခိးနတၩလၧနခိၭနၪ ယလူအ",
			"42": "<sup>42</sup> ကၠီၩ့လီၫ.- ယၥ့ၪယၫလၧနခိၭနၪ ယလူထံၪဎးလီၫ.မွဲ လါနၫ့ဘိၩ ဘဲၫၥိၭၦခမျၧးလၧအအီၪဝၬဖီၩ့ယၧၩယီၩ မိနဲၩလၧနအၪ့မၧၫ့လၩ့န့ယၧၩတၭ, ယစံၭဆၧလၧ အဝ့ၫၥံၪအဂးလီၫ.",
			"43": "<sup>43</sup> စံၭဆၧနီၪလဖၪတၭ, ကိၭၡၭထၪ့လၧအလူဖၭဒိၪ,",
			"44": "<sup>44</sup> စလၭဇရၧၭဧ့,ဂဲထုၪ့ထၪ့ထဲၩ့ဆံၭ.- ၦလၧအၥံၫလဂၩ နီၪဂဲထုၪ့ထၪ့ထဲၩ့ဝ့ၫတၭ, အစူၪအခၪ့ဘၪဘီၪဘံၭ ထၬအၥၭလၧ ဆၧၥွၪခိၪအဆၧကီၩ့ဆၧၥိၭနီၪ, အမ့ၬ ဘၪချႃၬဘံၭထၬအၥၭလၧပဝၫလီၫ. ယ့ၫၡုၬစံၭအ ဝ့ၫၥံၪ,ကွဲၪလၩ့ခွံၬတၭ, ဖျါခွံၬအဝ့ၫဆံၭ.",
			"45": "<sup>45</sup> မၩအၥၭဘဲၫနီၪတၭ, ၦယုဒၫဖိၪၥံၪ လၧအဂဲၫလၧ နးမၫရံၫအအီၪနီၪ, ဒၪဘၪယ့ၫၡုၬမၩဆၧတၭ,နဲၩထဲၩ့",
			"46": "<sup>46</sup> ဝ့ၫဒၪအၪဂၩလီၫ.- အ့ၪမွဲလနၩ့နၩ့နီၪ, လ့ၩဝ့ၫလၧ ၦဖၫရစံၫၥံၪအအီၪတၭ, လီၩဘၪအဝ့ၫၥံၪဆၧလၧယ့ၫ ၡုၬမၩဝ့ၫနီၪလီၫ.",
			"47": "<sup>47</sup> မၩအၥၭဘဲၫနီၪတၭ,ၦလုဆၧအဒိၪၥံၪဒဲၦဖၫရစံၫ လဖၪနီၪ, ဒုၭအီၪကိၩ့အီၪကီၪ့ ၦကိၪ့လိၬအၥၭတၭ, စံၭဝ့ၫ,မွဲပမိမၩပဝ့ၫဘဲၫၥ့ၪလဲၪ,ၦလဂၩယီၩမၩလၩ့",
			"48": "<sup>48</sup> လၭဆၧအၪမံၩ့မၬကၨ.- ပအ့ၪဖ့ၪလၫ့အမၩဘဲၫနီၪ တၭ,ၦကိၭဂၩဒ့ၭမိနဲၩထဲၩ့ဝ့ၫနီၪ,ၦရိမၫဖိၪၥံၪမိဂဲၫ မၩဂၭဂီၩ့ခွံၬပလးဒဲပဆၨၩယီၩလီၫ.",
			"49": "<sup>49</sup> ၦလၧအဝ့ၫၥံၪအကျၩစက့အဖၭလဂၩ, ကဲၪၦလု ဆၧအခိၪလနံၪ့နီၪ, စံၭအဝ့ၫၥံၪ, နၥံၪဝ့ၫယီၩနၥံၪၥ့ၪ",
			"50": "<sup>50</sup> ယၫဆၧနးမံၩ့အ့ၬ.- နၥံၪလဆီၫ့မီၪ့ဘၪလၧၦလဂၩၥံၫ ဝ့ၫလၧၦခမျၧးၥံၪအဂးနီၪ, မွဲအဂ့ၩနဲၪ့ၦထၧၫ့ဆၨၩ",
			"51": "<sup>51</sup> ယၫဂၭဂီၩ့ခွံၬနီၪဒံၭလီၫ.- ဆၧနီၪမွဲအစံၭဒၪဝ့ၫအ့ၬ. အ့ၪမွဲလနံၪ့နီၪမွဲၦလုဆၧအခိၪတၭ, ချဲၩ့ဆၧလၧမီၪအ ချိၬနီၪလၧယ့ၫၡုၬမိဘၪၥံၫဝ့ၫ လၧၦလဆၨၩနီၪအခိၪ",
			"52": "<sup>52</sup> အကၠီၩ့လီၫ.- မွဲန့ၫၦလဆၨၩနီၪအခိၪအကၠီၩ့လကၭ လၧၩ့တၭ, မွဲဘဲၫၥိၭယွၩအဖိၪၥံၪလၧအလၩ့မုလၩ့ဖၭ လဖၪနီၪ,မိအီၪကိၩ့အီၪကီၪ့လၧအလးလစီၪ့ဎးလီၫ.",
			"53": "<sup>53</sup> မၩအၥၭဘဲၫနီၪတၭ,ခီၫလၧမုနံၩနီၪအလးခဲၫ့ အဝ့ၫ",
			"54": "<sup>54</sup> ၥံၪကိၪ့လိၬအၥၭဘဲၫၥိၭအမိမၩၥံၫအဝ့ၫလီၫ.- မၩ အၥၭဘဲၫနီၪတၭ, ယ့ၫၡုၬစဲၪ့အီၪဖျီၪလၧၦယုဒၫဖိၪၥံၪ အကျၩအ့ၬ. စဲၪ့ထၪ့ခွံၬဝ့ၫထီးနီၪ, လ့ၩထီၩ့လၧဒိၩ့ လၧအကိၭဝ့ၫအံဖြံၫ့လၧခးလဘံၪ့ဘူၭလၧမံၩ့လၬ ကျၩတၭ, အီၪဝ့ၫလၧအထံၩအဖျဲၥံၪ အၥိၭထီးနီၪလီၫ.",
			"55": "<sup>55</sup> ၦယုဒၫဖိၪၥံၪ အဘိၪ့လ့ၬဖၬလၩ့ဘူၭဝ့ၫနီၪ,ၦၡၩ စဲၪ့ထၪ့ခွံၬ လၧအတဝၫ့လဖၪအၪအၪလ့ၬတၭ, ဘဲၫၥိၭ အမိၥူၫဝၭဆံၫ့ခွံၬအၥၭ ဘိၩ့အလချႃၭမၩဒံၭဘၪ ဘိၪ့",
			"56": "<sup>56</sup> လ့ၩဖၬနီၪလ့ၩထီၩ့ လၧယရုစလံၫ့လီၫ.-မၩအၥၭ ဘဲၫနီၪတၭ, အဝ့ၫၥံၪအၪ့ဎၬယ့ၫၡုၬ,အီၪဆၧၫ့ထုၪ့လၧ ဆၧလုအဂံၪ့ဖၧၩ့နီၪချဲၩ့လိၬအၥၭ, နၥံၪဆီၫ့မီၪ့ဘဲၫၥ့ၪ",
			"57": "<sup>57</sup> လဲၪ.မွဲအမိဂဲၫလၧဘိၪ့ဖၧၩ့ယီၩအ့ၬဧၪ.- တၭၦလုဆၧ အဒိၪၥံၪ ဒဲၦဖၫရစံၫၥံၪနီၪအီၪက့ၪလၩ့အလူ ဘဲၫၥိၭ ၦလဂၩဂၩအ့ၪၥ့ၪယၫလၧအအီၪဝ့ၫ အလးတၭ,ဘၪ ဒုၭနဲၪဝ့ၫဘဲၫၥိၭ အဝ့ၫၥံၪမိဖီၪ့ထၬအဝ့ၫဒၪလီၫ."
		},
		"12": {
			"1": "<sup>1</sup> မၩအၥၭဘဲၫနီၪတၭ, ဘိၪ့လ့ၩဖၬလချႃၭဘၪဒံၭဘၪ ဎူၫၥၫ့တၭ, ယ့ၫၡုၬလ့ၩထီၩ့လၧဘ့ၭၥနံၫထီးအမၩဂဲထုၪ့ ထဲၩ့ စလၭဇရၧၭလၧအၥံၫယူၭဝ့ၫလဂၩနီၪအီၪ",
			"2": "<sup>2</sup> ဝ့ၫအလးလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ၦလဖၪနီၪမၩ ဆၧအၪ့ဆၧအီၩလၧ အဂးထီးနီၪတၭ, နးမၫၥၫမၩဆၧ လုအၪ့လုအီၩတၭ, စလၭဇရၧၭအီၪလၧၦဆၧၫ့နၩ့",
			"3": "<sup>3</sup> ဒံၩ့ခံၫ့လၧအၥိၭ လၧစပွဲထံၭနီၪလီၫ.- မၩအၥၭဘဲၫနီၪ တၭ,နးမၫရံၫမၩန့ၥိၪနၧၫ့မၧၫ့နၫဒူၫလၧအလူဒိၪဎွ့ၩ ဒိၪလလံတြၫ ဎၥၧၫ့ရွ့ၫၭ တၭ,ဂုၪယ့ၫၡုၬအခၪ့တၭ, ၥိၪနီၪအနၧၫ့မၧၫ့ဎွ့ၩထၪ့ဂံၪ့နီၪလီၫ.",
			"4": "<sup>4</sup> မၩအၥၭဘဲၫနီၪတၭ, ၦအီၪလၧအထံၩအဖျဲၥံၪအ ကျၩလၧအမိဖ့ၪလၫ့ခွံၬအဝ့ၫ စယုဒၭအံၭစကၫရအၧၭ",
			"5": "<sup>5</sup> လဂၩ, စံၭဝ့ၫ,- ၥိၪနၧၫ့မၧၫ့ယီၩ မွဲဘၪနီၫလအၪ့ဆၫ ဘၪဝ့ၫတၭ, လဖ့ၪလၫ့ဘၪဝ့ၫအဎွ့ၩဒန့ရံၫၥၧၫ့ယၩလၧ",
			"6": "<sup>6</sup> ၦၡၪ့ဖိၪၦယၬဖိၪနီၪလဲၪ.- မွဲအၥၭလအီၪဘၪၦၡၪ့ဖိၪ နီၪမွဲၦအၪ့ဂူၪဆၧအကၠီၩ့တၭ, အီၪလၧအထိၪ့နီၪဆိၬ ဆၧလၧၦဒုၭနုၬလၩ့လၧအဖၧၩ့အကၠီၩ့နီၪတၭ, စံၭ",
			"7": "<sup>7</sup> ဆၧနီၪလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ယ့ၫၡုၬစံၭဝ့ၫ ထီး မၩထံၬထၬအဝ့ၫလဂ့ၩ, ယဘၪဆၧခုၪ့လၩ့ဘၧၩ့အနံၩ အၥၫ့အဂးနီၪ, မွဲအအီၪက့ၪလၩ့ဝဲၩ ဆၧယီၩလီၫ.",
			"8": "<sup>8</sup> အဂဲးဘဲၫယီၩ ၦၡၪ့ဖိၪလဖၪနီၪ အီၪလၧနၥံၪအၥိၭ လထံၪဎးလီၫ. အ့ၪမွဲယဝ့ၫဒၪယီၩယအီၪလၧနၥံၪ အၥိၭလထံၪဎးအ့ၬ.",
			"9": "<sup>9</sup> မၩအၥၭဘဲၫနီတၭ, ၦယုဒၫဖိၪခမျၧးဖၭဒိၪ ၥ့ၪယၫ ဝ့ၫလၧယ့ၫၡုၬအီၪဝ့ၫထီးနီၪတၭ, ဂဲၫဝ့ၫန့ၫလၧယ့ၫၡုၬ အကၠီၩ့နီၪလကၭလၧၩ့, မွဲဘဲၫၥိၭအမိဒၪဘၪ စလၭဇ ရၧၭလၧအဒုၭဂဲထုၪ့ထဲၩ့ဝ့ၫ လၧဆၧၥံၫအဖၧၩ့နီၪလီၫ.",
			"10": "<sup>10</sup> ၦလုဆၧအဒိၪၥံၪကိၪ့လိၬအၥၭ ဘဲၫၥိၭအမိမၩၥံၫဘၪ",
			"11": "<sup>11</sup> စလၭဇရၧၭနီၪလီၫ.- အဂဲးဘဲၫယီၩလၧအဝ့ၫနီၪ အကၠီၩ့,ၦယုဒၫဖိၪၥံၪ အၪဂၩဂဲၫနဲၩထဲၩ့ယ့ၫၡုၬလီၫ.",
			"12": "<sup>12</sup> ကဲဂီၩခိၬလနံၩနီၪၦခမျၧးဖၭဒိၪ လၧအဂဲၫလၧ ဆၧဘိၪ့ဖၧၩ့လဖၪနီၪ, နါဂၧၫ့ဝ့ၫလၧယ့ၫၡုၬဂဲၫလၧယ",
			"13": "<sup>13</sup> ရုစလံၫ့အဖၧၩ့ၥၭ အဘိၩ့ဘၭနီၪ,- မၩန့စီၩ့မလီၫ့အ ထဲၩ့နီၪလ့ၩအၪ့ဂၬဝ့ၫတၭ, ကိၭၡၭထၪ့ဆၧ, မွဲဆၧထိး ထဲၩ့တၩ့ထဲၩ့ဘိၩ့နဲၪ့ယီၩဆံၭ. ၦအံၫစရ့ၭလၭဖိၪအ စဎွၩလၧအဂဲၫလၧယွၩအမံၩ့နီၪ, မွဲအဘၪဆၧဆိၪဂ့ၩ",
			"14": "<sup>14</sup> ဆံၭ.- ယ့ၫၡုၬဒၪန့ကၥ့ၪယီၩ့အဖိၪလဒုၩတၭ,ထူၬဝ့ၫ ဘဲၫဆၧကွ့ၭအၥၭအၥိၭနီၪ,",
			"15": "<sup>15</sup> ဇံအိၫ့အဖိၪမုၪဧ့, ထီးၥၭမဲၪလဂ့ၩ, ယိခွါ,နစဎွၩဂဲၫ လၧနအီၪထူၬကၥ့ၪယီၩ့အဖိၪလီၫ.",
			"16": "<sup>16</sup> ဆၧလဖၪနီၪလၧအၥၫ့အထံၩအဖျဲၥံၪနၪဝ့ၫလၥ့ၪ ဘၪလါနၫ့ဘိၩ, ထီးယ့ၫၡုၬအလၩအဖၩ့ဖျီၪထၪ့ တၭ,အဝ့ၫၥံၪနၪ့ထၪ့ထဲၩ့အၥၭလၧဆၧနီၪကွ့ၭအ ၥၭလၧအဂဲးဒဲ အဝ့ၫၥံၪမၩအဝ့ၫဒၪလၧဆၧနီၪလီၫ.",
			"17": "<sup>17</sup> မၩအၥၭဘဲၫနီၪတၭ, ၦခမျၧးလၧအအီၪဝ့ၫလၧအ ၥိၭလဖၪနီၪ ထိးအၥၭလၧအကိၭထၪ့ထဲၩ့ စလၭဇရၧၭ လၧအၥွၪခိၪအဖၧၩ့ ဒဲဒုၭဂဲထုၪ့ထဲၩ့အဝ့ၫ လၧဆၧၥံၫ",
			"18": "<sup>18</sup> အဖၧၩ့နီၪလီၫ.- အခိးမွဲၦခမျၧးနါဂၧၫ့လၧအမၩလၩ့ လၭဆၧအကၠီၩ့တၭ, လ့ၩထၪ့အၪ့ဂၬအဝ့ၫဒၪလီၫ.",
			"19": "<sup>19</sup> မၩအၥၭဘဲၫနီၪတၭ, ၦဖၫရစံၫၥံၪစံၭလိၬအၥၭ,နၥံၪ မၩဆၧလန့ကၩဘၪဆၧနးမံၩ့နီၪ,မွဲနၥံၪဒၪဘၪအ့ၬ ဧၪ.ယိခွါ,ဂၪ့ခိၪနီၪလ့ၩဖိၬယူၭအခဲၫ့ယူၭ.",
			"20": "<sup>20</sup> ၦဂြံစၭဖိၪၥံၪလနၩ့နၩ့ အီၪလၧၦဂဲၫဘၩဆၧလၧဆၧ",
			"21": "<sup>21</sup> ဘိၪ့ဖၧၩ့လဖၪအကျၩလီၫ.- မၩအၥၭဘဲၫနီၪတၭ,အဝ့ၫ ၥံၪဂဲၫလၧစဖံလံၭၦဘ့ၭၥစ့ဒၫဖိၪလၧဂၫလလံၫအဖၧၩ့ အအီၪတၭ,အၪ့စၪ့အဝ့ၫ,စံၭဝ့ၫကဆါဧ့,ဆၧမိဒၪဘၪ",
			"22": "<sup>22</sup> ပၥၭလၧယ့ၫၡုၬနီၪလီၫ.- တၭစဖံလံၭလီၩဘၪ စအၪ့ ဒူၫနီၪ,စအၫ့ဒူၫ ဒဲစဖံလံၭ လ့ၩလီၩဘၪထဲၩ့ ယ့ၫၡုၬ လီၫ.",
			"23": "<sup>23</sup> ယ့ၫၡုၬချဲၩ့ဆၧၫ့အဝ့ၫၥံၪတၭ, စံၭဝ့ၫ, အမုအလၩ လၧၦၡၩအဖိၪခွၫအလၩအဖၩ့မိဖျီၪထၪ့နီၪဘၪယူၭ",
			"24": "<sup>24</sup> ဝ့ၫယူၭ.- ယလီၩဘၪနၥံၪတီၩတီၩလီၩ့လီၩ့,ဘုၪချံၫ လဖျိၪ့လၩ့ထ့ၬလၧဂၪ့ခိၪအဖၧၩ့နီၪ, အ့ၪလအုၪၥံၫဘၪ တၭ,အီၪဒၪအဆၧလဖျိၪ့ဎးလီၫ. မွဲလါနၫ့အ့ၪအုၪၥံၫ",
			"25": "<sup>25</sup> နီၪၥၪထၪ့ဝ့ၫအၪဖျိၪ့လီၫ.- ၦလၧအအဲၪအၥၭမၧၫ့ဒၪ ဝ့ၫနီၪ,အၥၭမၧၫ့မိလၩ့မါခွံၬဝ့ၫလီၫ. ၦလၧအမ့ၬလဲၩ အၥၭမၧၫ့ဒၪဝ့ၫ လၧဂၪ့ခိၪချိၫ့ယီၩ, မိန့ဘၪထဲၩ့အၥၭ",
			"26": "<sup>26</sup> မၧၫ့အဆိၩဆိၩအကၠၪကၠၪလီၫ.- ၦလဂၩဂၩအ့ၪမၩ ယဆၧမၩနီၪမွဲအဖိၬဒၪဝ့ၫယခဲၫ့ဆံၭ. ထီးယအီၪ အလးနီၪယခ့ၫယၡၩ မိအီၪဝ့ၫထီးနီၪဆ့လီၫ. ၦ လဂၩဂၩအ့ၪမၩယဆၧမၩတၭ, ယဖါမိဒုၭလၩဖၩ့ အဝ့ၫနီၪလီၫ.",
			"27": "<sup>27</sup> ဘိၩ့နဲၪ့ယီၩ ယၥုၪ့ခိယၥၭဝီၩတၭ, မွဲယမိစံၭ ဘဲၫၥ့ၪလဲၪ.မွဲယမိစံၭ, ဖါဧ့,ထိးထဲၩ့တၩ့ထဲၩ့ယၧၩ လၧအဆၧၫ့အထီယီၩဧၪ. မွဲလါနၫ့ဘဲၫၥိၭယမိထိး ဆၧအဆၧၫ့ အထီယီၩတၭ, ယဂဲၫလၩ့ယဝ့ၫလီၫ. ဖါဧ့,ဒုၭလၩဖၩ့နမံၩ့ဆံၭ.",
			"28": "<sup>28</sup> မၩအၥၭဘဲၫနီၪတၭ, ဆၧအလူၥီၫလၩ့လၧမူၭခိၪ,",
			"29": "<sup>29</sup> ယဒုၭလၩဖၩ့ယူၭ.တၭယမိဒုၭလၩဖၩ့ဒီၭလီၫ.- မၩ အၥၭဘဲၫနီၪတၭ, ၦခမျၧးလၧအဆၧၫ့ထုၪ့နါဂၧၫ့ဆၧ နီၪတၭ,စံၭဝ့ၫလၧအမွဲလၫ့အလူၥီၫလီၫ. အဂူၫဂၩလ နၩ့,စံၭဝ့ၫ, မွဲအၥီၫ့လဂၩ ချဲၩ့ဆၧလၧအဝ့ၫနီၪလီၫ.",
			"30": "<sup>30</sup> ယ့ၫၡုၬချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭဝ့ၫ,ဆၧအလူၥီၫနီၪ မွဲလၧ",
			"31": "<sup>31</sup> ယဂးအ့ၬ, မွဲလၧနၥံၪအဂးလီၫ.- ဘိၩ့နဲၪ့ယီၩဂၪ့ခိၪ ဘၪဆၧစ့ၩရၫ့လီၫ. ဘိၩ့နဲၪ့ယီၩဂၪ့ခိၪအခိၪနီၪဘၪ",
			"32": "<sup>32</sup> ဆၧနၫ့ထၪ့ခွံၬဝ့ၫလီၫ.- ယဝ့ၫဒၪယီၩ ယအ့ၪဘၪဆၧ ဘီၩ့ထၪ့ယၧၩလၧဂၪ့ခိၪချိၫ့ယီၩတၭ, ယမိမီၩ့ထဲၩ့ ၦကိၭဂၩဒ့ၭလၧယအီၪလီၫ.",
			"33": "<sup>33</sup> မွဲအမိၥံၫဘဲၫအံၩဘဲၫအိၩအဂဲးအကၠီၪ့နီၪ, ဒုၭနဲၪ ဝ့ၫလၧအဆၧချဲၩ့နီၪလီၫ.",
			"34": "<sup>34</sup> ၦခမျၧးချဲၩ့ဆၧၫ့အဝ့ၫ,ပနါဂၧၫ့လၧဆၧမၪလူၬအ ဖၧၩ့နီၪလၧဎရံၬမိအီၪဝ့ၫအဆိၩဆိၩအကၠၪကၠၪလီၫ. မွဲဘၪနီၫလၧနစံၭ ၦၡၩအဖိၪခွၫ မိဘၪဘီၩ့ထၪ့အၥၭ",
			"35": "<sup>35</sup> လဲၪ.ၦၡၩအဖိၪခွၫနီၪမွဲပလၫလဂၩလဲၪ.- မၩအၥၭ ဘဲၫနီၪတၭ,ယ့ၫၡုၬစံၭအဝ့ၫၥံၪ,ဆၧဖၩ့မိအီၪဒံၭလၧ နၥံၪအၥိၭလဆိဖိၪတၭး ဆၧဖၩ့အီၪဒံၭဝ့ၫအဘိၩ့ ဘၭနီၪ,ဘဲၫၥိၭဆၧထီးခံၭန့နၥံၪလဂ့ၩတၭ, စဲၪ့ထၪ့န ၥံၪဝ့ၫဘီၪ.ၦစဲၪ့လၧဆၧခံၭကျၩနီၪ, မွဲအစဲၪ့ဝ့ၫခီၫခီၫ",
			"36": "<sup>36</sup> လဲၪ,ၥ့ၪယၫဝ့ၫအ့ၬ.- နၥံၪအီၪလၧဆၧဖၩ့အဘိၩ့ဘၭ နီၪ,ဘဲၫၥိၭနၥံၪမိကဲၪဘၪဆၧဖၩ့အဖိၪတၭ, နဲၩထဲၩ့ ဆၧဖၩ့ယီၩဆံၭ. ယ့ၫၡုၬလီၩဘၪဆၧလဖၪနီၪဂီၩ့ တၭ,စဲၪ့ထၪ့ခွံၬအီၪက့ၪၥူၪခွံၬ အၥၭလၧအဝ့ၫၥံၪလီၫ.",
			"37": "<sup>37</sup> အဝ့ၫဒၪမၩလၩ့လၭဆၧလၧအဝ့ၫၥံၪအမ့ၬယၫအၪ",
			"38": "<sup>38</sup> ဘဲၫနီၪလါနၫ့ဘိၩ,အဝ့ၫၥံၪနဲၩထဲၩ့ဝ့ၫအ့ၬ.- မၩအၥၭ ဘဲၫနီၪတၭ,မီၪစအဲၫစ့ယၫအလူလၧၫ့ထၪ့ဎွ့ၩထၪ့လၧ အစံၭဝ့ၫ, ကဆါဧ့,မွဲပလၫနဲၩပဆၧပရၧၫ့လဂၩလဲၪ. ကဆါအစူၪအီၪဖျီၪထၪ့ယူၭအၥၭ, လၧပလၫအမ့ၬယၫလဂၩလဲၪ.",
			"39": "<sup>39</sup> မွဲဘဲၫနီၪတၭ, အဝ့ၫၥံၪနဲၩဆၧၥ့ၪအ့ၬ, အဂဲးဘဲၫ ယီၩစအဲၫစ့ယၫစံၭဒီၭဝ့ၫ,",
			"40": "<sup>40</sup> ဘဲၫၥိၭအလမိဒၪဘၪဆၧလၧအမ့ၬၥၪ, ဒဲအလမိၥ့ၪယၫဘၪဆၧလၧအၥၭ ဒဲအလကၠၪလီၩ့ထဲၩ့ဘၪအၥၭ, ဒဲယထီးမၩဘျၪထဲၩ့ဘၪအဝ့ၫၥံၪလဂ့ၩနီၪ, ဆၧမၩခံၭအမ့ၬၥၪ, ဒဲမၩနီၩ့အၥၭလီၫ.",
			"41": "<sup>41</sup> လၧစအဲၫစ့ယၫ ဒၪဘၪအလၩအဖၩ့နီၪ, လီၩလၩ့ လၬလၩ့ဆၧအဂဲးအကၠီၪ့ယီၩအဘိၩ့ဘၭနီၪလီၩ",
			"42": "<sup>42</sup> ဘၪဆၧလဖၪယီၩလီၫ.- မွဲလါနၫ့ဘဲၫနီၪတၭ,ၦဒိၪၦၡါ နဲၩထဲၩ့ဝ့ၫအၪဂၩလါနၫ့ဘိၩ, မွဲလၧၦဖၫရစံၫၥံၪအ ကၠီၩ့နီၪ,ဘဲၫၥိၭအထီးဘၪဆၧနၫ့ထၪ့ခွံၬဝ့ၫလၧၥရိၬ",
			"43": "<sup>43</sup> ဖၧၩ့လဂ့ၩတၭ,အုၩ့လၩ့ဝ့ၫအ့ၬ.- အဂဲးဘဲၫယီၩ အဲၪဒိၭၦၡၩအဆၧစံၭထၪ့အၪ့အူၭ အၪနဲၪ့အအဲၪဒိၭ ယွၩအဆၧစံၭထၪ့အၪ့အူၭဝ့ၫဒၪနီၪလီၫ.",
			"44": "<sup>44</sup> ယ့ၫၡုၬကိၭၡၭထၪ့ဆၧ, စံၭဝ့ၫ, ၦလၧအနဲၩထဲၩ့ ယၧၩယီၩ,မွဲအနဲၩထဲၩ့ၦလၧအအၪ့မၧၫ့လၩ့ယၧၩ",
			"45": "<sup>45</sup> လဂၩနီၪလီၫ.- ၦလၧအဒၪဘၪယၧၩယီၩ မွဲအဒၪဘၪ",
			"46": "<sup>46</sup> ၦလၧအအၪ့မၧၫ့လၩ့ယၧၩ လဂၩနီၪလီၫ.- ယဝ့ၫဒၪ ယီၩယမွဲဆၧဖၩ့လဖျိၪ့ဂဲၫထီၩ့လၩ့လၧဂၪ့ခိၪချိၫ့ ယီၩဘဲၫၥိၭကယဲၦလၧအနဲၩထဲၩ့ယၧၩလဂၩဂၩနီၪ,",
			"47": "<sup>47</sup> ထီးအီၪလၧဆၧခံၭကျၩလဂ့ၩလီၫ.- ၦအ့ၪနါဂၧၫ့ယ လူတၭ, လနဲၩဘၪဝ့ၫနီၪ ယလစ့ၩရၫ့ဘၪအဝ့ၫတၭ, အဂဲးဘဲၫယီၩ ဘဲၫၥိၭယမိစ့ၩရၫ့ဂၪ့ခိၪဖိၪနီၪယဂဲၫ ယဝ့ၫအ့ၬ,မွဲဘဲၫၥိၭ ယမိထိးထဲၩ့တၩ့ထဲၩ့ အဝ့ၫၥံၪ",
			"48": "<sup>48</sup> လီၫ.- ၦၡၩလဂၩဂၩလၧအခွံၬၡိၭယၧၩယီၩ, ဒဲလထီး န့ဘၪယလူနီၪ, ၦစ့ၩရၫ့အဝ့ၫဒၪအီၪဝ့ၫလဂၩလီၫ. ဆၧချဲၩ့လၧယလီၩဘၪဒၪလ့ၬ မိစ့ၩရၫ့အဝ့ၫလၧမုနံၩ",
			"49": "<sup>49</sup> ထုၬခိၬလီၫ.- အဂဲးဘဲၫယီၩ မွဲယချဲၩ့ဒၪယဝ့ၫလၧယ ဂဲးမွဲအ့ၬ, အ့ၪမွဲဖါလၧအအၪ့မၧၫ့လၩ့န့ယၧၩနီၪ, မွဲယဘၪစံၭဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪ, မွဲယဘၪချဲၩ့ဘဲၫအံၩ",
			"50": "<sup>50</sup> ဘဲၫအိၩအဂဲးနီၪ, အဝ့ၫဒၪမၪလူၬယၧၩလီၫ.- ယၥ့ၪ ယၫယဝ့ၫဒၪလၧအဆၧမၪလူၬနီၪ မွဲဆၧမၧၫ့လၩ့ဆိၩ လၩ့ကၠၪလီၫ. မၩအၥၭဘဲၫနီၪတၭ, ယချဲၩ့ယဝ့ၫဒၪ ဘဲၫယဖါလီၩဘၪယၧၩအၥိၭလီၫ."
		},
		"13": {
			"1": "<sup>1</sup> ဘိၪ့လ့ၩဖၬနီၪ လချႃၭဘၪဒံၭဘၪတၭ, ယ့ၫၡုၬ ၥ့ၪယၫလၧအမုအလၩဘၪယူၭ လၧအမိဘၪစဲၪ့ဒၪ အလးလၧဂၪ့ခိၪချိၫ့ယီၩ ထဲၩ့ထၪ့လၧဖါအအီၪနီၪ, မွဲ အအဲၪအခ့ၫအၡၩဒၪဝ့ၫ လၧအအီၪလၧဂၪ့ခိၪချိၫ့ယီၩ",
			"2": "<sup>2</sup> တၭ,အဲၪဝ့ၫထီးအထုၬလီၫ.- အၪ့ဆၧလၧဂၪလခီၫ အဘိၩ့ဘၭနီၪ, မုၪခီၩလဲးဒုၭနုၬဆၧလၧစစဲမၧၫ့အဖိၪ ခွၫစယုဒၭအံၭစကၫရအၧၭလဂၩအၥၭ ဘဲၫၥိၭအမိ",
			"3": "<sup>3</sup> ဖ့ၪလၫ့ခွံၬအဝ့ၫဒၪလီၫ.- ယ့ၫၡုၬၥ့ၪယၫဝ့ၫလၧဖါ ဖ့ၪလၫ့ယူၭကယဲဆၧထီးအလူၬလၧအစူၪဖၧၩ့, ဒဲလၧ အဂဲၫလၩ့ဝ့ၫလၧယွၩအအီၪတၭ, မိထဲၩ့ထၪ့ဝ့ၫလၧ",
			"4": "<sup>4</sup> ယွၩအအီၪနီၪ,- ဂဲထုၪ့လၧအအၪ့ဆၧလၧဂၪလခီၫတၭ, ဘဲၪ့လၩ့ခွံၬအဖၬဘဲၩ့လၧအလီၩ့နီၪ, ခဲးထူၬထၪ့ဆၧ",
			"5": "<sup>5</sup> ကဲၩ့ယၬလၧအယးဒံၩ့လီၫ.- အနီၪဂီၩ့တၭ, ဂါလၩ့ထံၫ လၧအံၪ့ဒိၫ့ဖၧၩ့တၭ, ၥူၫဝၭခွံၬအထံၩအဖျဲၥံၪအခၪ့တၭ, ထူၭခွံၬဝ့ၫလၧဆၧကဲၩ့ယၬလၧအခဲးထူၬဝ့ၫလၧအယးဒံၩ့ နီၪလီၫ.",
			"6": "<sup>6</sup> မၩအၥၭဘဲၫနီၪတၭ, ဂဲၫလၧစစဲမၧၫ့ပံတၧၫလဂၩ အအီၪနီၪ, အဝ့ၫဒၪစံၭကဆါဧ့, မွဲနမိၥူၫဝၭယခၪ့ဆ့",
			"7": "<sup>7</sup> ဧၪ.- ယ့ၫၡုၬချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭအဝ့ၫဆၧလၧယ မၩဘိၩ့နဲၪ့ယီၩနၥ့ၪယၫအ့ၬ. အ့ၪမွဲလၧဆၧလဖၪယီၩ",
			"8": "<sup>8</sup> အလးခဲၫ့နမိၥ့ၪယၫလီၫ.- စပံတၧၫစံၭဝ့ၫ,ယမိဖ့ၪလၫ့ နၥူၫဝၭခွံၬယခၪ့လၩလါအ့ၬ. ယ့ၫၡုၬချဲၩ့ဆၧၫ့အဝ့ၫ, ယအ့ၪလၥူၫဝၭခွံၬဘၪနၧၩနီၪ နဘၪဆဲၫ့လၧယၧၩအ့ၬ.",
			"9": "<sup>9</sup> တၭစစဲမၧၫ့ပံတၧၫစံၭဝ့ၫ, ကဆါဧ့, န့ၫယခၪ့ယီၩ",
			"10": "<sup>10</sup> လကၭလၧၩ့,မွဲယစူၪဒဲယခိၪဎွံၪဆ့ဆံၭ.- ယ့ၫၡုၬစံၭ အဝ့ၫ,ၦလၧအအၪ့လုထံၫဂီၩ့နီၪ, အ့ၪလမွဲဘၪအခၪ့ တၭ,ၥူၫဝၭခွံၬအလးအီၪအ့ၬ. မွဲအဆံၫ့ဝ့ၫ ထၧၫ့ဂၩ ယၫလီၫ.နၥံၪဝ့ၫယီၩ နၥံၪဆံၫ့လါနၫ့ဘိၩ, မွဲကိၭဂၩ ဒ့ၭအ့ၬ.",
			"11": "<sup>11</sup> အဂဲးဘဲၫယီၩ, မွဲအၥ့ၪယၫၦလၧအမိဖ့ၪလၫ့ခွံၬဝ့ၫ လဂၩနီၪ, အခိးမွဲအစံၭဝ့ၫ, နၥံၪဆံၫ့ကိၭဂၩဒ့ၭအ့ၬ.",
			"12": "<sup>12</sup> မၩအၥၭဘဲၫနီၪတၭ, ထီးအၥူၫဝၭခွံၬအဝ့ၫၥံၪအခၪ့ ဂီၩ့တၭ, ကီၩ့ထၪ့ထဲၩ့အဖၬဘဲၩ့နီၪဆၧၫ့နၩ့ဒံၩ့ခံၫ့ဒီၭ လၧစပွဲထံၭတၭ, စံၭအဝ့ၫၥံၪ, ယမၩနၥံၪလၧဆၧနီၫ",
			"13": "<sup>13</sup> လဲၪနီၪ,မွဲနၥံၪနၪၥ့ၪဆ့ဧၪ.- နၥံၪကိၭယၧၩဆရၫ, ဒဲ ကဆါတၭ,နၥံၪစံၭဆၧနီၪမွဲအတီၩလီၫ. အဂဲးဘဲၫ",
			"14": "<sup>14</sup> ယီၩယမွဲဆၧနီၪလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ယဝ့ၫဒၪ ယီၩနၥံၪအဆရၫ, ဒဲနၥံၪအကဆါ, ယအ့ၪၥူၫဝၭခွံၬ နၥံၪအခၪ့နီၪ, နၥံၪဝ့ၫဒၪယီၩကြၨၭလၧနၥံၪၥူၫဝၭခွံၬ",
			"15": "<sup>15</sup> လိၬနၥံၪအခၪ့ဆ့လီၫ.- အဂဲးဘဲၫယီၩဘဲၫၥိၭနၥံၪမိမၩ ဆၧဘဲၫယမၩနၥံၪအၥိၭနီၪ, ယဒုၭနဲၪနၥံၪအဒီၩ့အ ထ့ၬလီၫ.",
			"16": "<sup>16</sup> ယလီၩဘၪနၥံၪတီၩတီၩလီၩ့လီၩ့ယီၩ, အဎီးအၡၩ နီၪလဒိၪနဲၪ့ဘၪအကဆါတၭ ၦဆၧအၪ့မၧၫ့ဖိၪနီၪဒိၪ",
			"17": "<sup>17</sup> နဲၪ့ၦလၧအအၪ့မၧၫ့လၩ့ဝ့ၫနီၪဆ့အ့ၬ.- ဆၧနီၪလဖၪ နၥံၪအ့ၪၥ့ၪယၫ,ဒဲနၥံၪအ့ၪမၩဝ့ၫဆ့, မွဲနၥံၪဘၪဆၧ",
			"18": "<sup>18</sup> ဆိၪဂ့ၩနၥံၪဝ့ၫလီၫ.- မွဲယစံၭနၥံၪကိၭဂၩဒ့ၭအ့ၬ. ၦလၧ ယရွံန့လဖၪနီၪ ယၥ့ၪယၫအဝ့ၫၥံၪလီၫ. ဘဲၫၥိၭဆၧ ကွ့ၭအၥၭမိလၧၫ့ထၪ့ဎွ့ၩထၪ့နီၪ,ၦ လၧ အ အၪ့ ဎုၬ ဆၧ လၧ ယၧၩ လ ဂၩ နီၪ, မွဲ အ ထၧၫ့ ယၧၩ လၧ အ ခၪ့ နိး ခဲၫ့ လီၫ.",
			"19": "<sup>19</sup> ယလီၩဘၪနၥံၪဘိၩ့နဲၪ့ယီၩ, လၧဆၧလချႃၭမၩဒံၭ ဘၪအၥၭဘဲၫၥိၭထီးဆၧမၩအၥၭနီၪနၥံၪမိနဲၩလၧ",
			"20": "<sup>20</sup> ယမွဲအဝ့ၫဒၪလီၫ.- ယလီၩဘၪနၥံၪတီၩတီၩလီၩ့လီၩ့, ၦအ့ၪထိးဆၧၫ့ၦလၧယအၪ့မၧၫ့လၩ့ဝ့ၫလဂၩဂၩနီၪ, မွဲအထိးဆၧၫ့ယၧၩဆ့း ၦလၧအထိးဆၧၫ့ယၧၩလဂၩ ဂၩနီၪ, မွဲအထိးဆၧၫ့ၦလၧအအၪ့မၧၫ့လၩ့ယၧၩလဂၩ နီၪဆ့လီၫ.",
			"21": "<sup>21</sup> ဆၧနီၪလဖၪယ့ၫၡုၬလီၩဘၪဝ့ၫဂီၩ့,အၥုၪ့ခိအ ၥၭဝီၩတၭ, ထိးအၥၭစံၭဝ့ၫဒၪ, ယလီၩဘၪနၥံၪတီၩ တီၩလီၩ့လီၩ့, ၦအီၪလၧနၥံၪအကျၩလဂၩမိဖ့ၪလၫ့ခွံၬ",
			"22": "<sup>22</sup> ယၧၩလီၫ.- မွဲအစံၭၦလၫလဂၩလဲၪနီၪအထံၩအဖျဲၥံၪ",
			"23": "<sup>23</sup> အၥၭဂံၩ့ဂၩ့ဝ့ၫတၭ, ယိလိၬအၥၭလီၫ.- အထံၩအဖျဲ လၧယ့ၫၡုၬအဲၪဝ့ၫလဂၩနီၪ ဆၧၫ့နၩ့ဒံၩ့ခံၫ့လၧယ့ၫ",
			"24": "<sup>24</sup> ၡုၬအၥၭနၫအလီၩ့လီၫ.- မၩအၥၭဘဲၫနီၪတၭ,ဘဲၫ ၥိၭအမိအၪ့စၪ့အဝ့ၫလဂၩ, လၧအစံၭပလၫလဂၩလဲၪ နီၪ,စစဲမၧၫ့ပံတၧၫဖျၭလၩ့စိၩအခိၪလၧအအီၪလီၫ.",
			"25": "<sup>25</sup> မၩအၥၭဘဲၫနီၪတၭ, အဝ့ၫနီၪမံၫနၩ့ဒိၭနဲၩ့အၥၭလၧ ယ့ၫၡုၬအၥၭနၫအလီၩ့တၭ, စံၭအဝ့ၫဒၪကဆါဧ့,မွဲ",
			"26": "<sup>26</sup> ပလၫလဂၩလဲၪ.- ယ့ၫၡုၬချဲၩ့ဆၧၫ့ဝ့ၫ, ထီးယအ့ၪ ဘၧၩ့လၩ့ဆၧလမိၩဖ့ၪလၫ့ၦလဂၩ, မွဲအဝ့ၫနီၪလီၫ. ဘၧၩ့လၩ့ဆၧလမိၩဂီၩ့နီၪ, ဖ့ၪလၫ့ဝ့ၫလၧစစဲမၧၫ့အဖိၪ",
			"27": "<sup>27</sup> ခွၫစယုဒၭအံၭစကၫရအၧၭနီၪလီၫ.- ဆၧလမိၩနီၪအ လးခဲၫ့တၭ, မုၪခီၩလဲးဂဲၫနုၬလၧအဖၧၩ့လီၫ. မၩ အၥၭဘဲၫနီၪတၭ, ယ့ၫၡုၬစံၭအဝ့ၫ,နမၩဆၧနီၪမၩနဝ့ၫ ချဲၫ့ချဲၫ့ဆံၭ.",
			"28": "<sup>28</sup> မွဲဘၪနီၫလၧအစံၭအဝ့ၫဒၪ လၧဆၧဘဲၫနီၪလဲၪ, ၦဆၧၫ့နၩ့ဒံၩ့ခံၫ့ လၧစပွဲထံၭလဖၪနီၪၥ့ၪယၫဝ့ၫနးဂၩ",
			"29": "<sup>29</sup> အ့ၬ.- အဂဲးဘဲၫယီၩလနၩ့နၩ့ဆီၫ့မီၪ့ဝ့ၫ,မွဲလၧစယု ဒၭဆိၬထိၪ့တၭ, ယ့ၫၡုၬစံၭအဝ့ၫလၧအဘၪဎွ့ၩဆၧ လမံၩ့မံၩ့လၧအကြၨၭအီၪလၧ ဆၧဘိၪ့အဂး,အ့ၪလမွဲ ဘၪဘဲၫနီၪတၭ, လၧအမိဘၪဖ့ၪလၫ့ ၦၡၪ့ဖိၪအဆၧ",
			"30": "<sup>30</sup> လမံၩ့မံၩ့လီၫ.- မၩအၥၭဘဲၫနီၪတၭ, အဝ့ၫဒၪဒိၭန့ဆၧ လမိၩနီၪဂီၩ့တၭ, စဲၪ့ထၪ့ခွံၬဝ့ၫချဲၫ့မၬတၭ, မွဲလၧမုနၩလခီၫလီၫ.",
			"31": "<sup>31</sup> ထီးအဝ့ၫစဲၪ့ထၪ့ခွံၬနီၪ, ယ့ၫၡုၬစံၭဝ့ၫ, ၦၡၩအဖိၪခွၫ အလၩအဖၩ့အီၪဖျီၪထၪ့ဝ့ၫဘိၩ့နဲၪ့ယီၩတၭ,ယွၩအ",
			"32": "<sup>32</sup> လၩအဖၩ့အီၪဖျီၪလၧအဖၧၩ့ဆ့လီၫ.- ယွၩအလၩ အဖၩ့အ့ၪအီၪဖျီၪလၧအဖၧၩ့တၭ, ယွၩမိဒုၭအီၪဖျီၪအ ဝ့ၫနီၪအလၩအဖၩ့လၧအနၫ့ဆါဒၪဝ့ၫအဖၧၩ့ဆ့လီၫ. တၭမိဒုၭအီၪဖျီၪထၪ့အလၩအဖၩ့ချဲၫ့ချဲၫ့လ့ၬလီၫ.",
			"33": "<sup>33</sup> ဖိၪၥံၪလံၩၥံၪဧ့, ယအီၪဒံၭလၧနၥံၪအၥိၭ မီခိၬဒံၭ တၭ,နၥံၪမိအၪ့ဎၬယၧၩတၭ, ဘဲၫယလီၩဘၪၦယုဒၫ ဖိၪၥံၪအၥိၭနီၪ, ဘိၩ့နဲၪ့ယီၩ ယလီၩဘၪထဲၩ့နၥံၪဆ့",
			"34": "<sup>34</sup> တၭ,လၧယလ့ၩဆၧအလးနီၪနၥံၪလ့ၩၥ့ၪအ့ၬ.- ယဖ့ၪ လၫ့နၥံၪလၧဆၧမၪလူၬအၥၫ့လထံၪယီၩ, မွဲဘဲၫၥိၭ နၥံၪမိအဲၪလိၬကွံၩလိၬနၥံၪအၥၭတၭး ဘဲၫယအဲၪနၥံၪ အၥိၭနီၪ, အဲၪလိၬကွံၩလိၬနၥံၪအၥၭ ဘဲၫနီၪအၥိၭဆ့",
			"35": "<sup>35</sup> ဆံၭ.- နၥံၪအ့ၪအဲၪလိၬကွံၩလိၬနၥံၪအၥၭနီၪ, လၧဆၧ ယီၩအကၠီၩ့တၭ, ကယဲၦထီးအလူၬ မိၥ့ၪယၫဝ့ၫလၧ နၥံၪမွဲယထံၩယဖျဲၥံၪလီၫ.",
			"36": "<sup>36</sup> စစဲမၧၫ့ပံတၧၫစံၭဝ့ၫ, ကဆါဧ့,မွဲနမိလ့ၩခီၫခီၫလဲၪ. ယ့ၫၡုၬချဲၩ့ဆၧၫ့ဝ့ၫ,မွဲယမိလ့ၩခီၫခီၫလဲၪနီၪ,ဘိၩ့နဲၪ့ ယီၩနဖိၬယခဲၫ့ၥ့ၪအ့ၬ. အ့ၪမွဲလၧယၫလခီၫနဖိၬယ",
			"37": "<sup>37</sup> ခဲၫ့မိၥ့ၪလီၫ.- စပံတၧၫစံၭအဝ့ၫ,ကဆါဧ့,မွဲဘၪနီၫလၧ ယဖိၬနခဲၫ့ ဘိၩ့နဲၪ့ယီၩလၥ့ၪဘၪလဲၪ. ယမိအီၪက့ၪ",
			"38": "<sup>38</sup> လၩ့ခွံၬယၥၭမၧၫ့လၧနကၠီၩ့လီၫ.- ယ့ၫၡုၬချဲၫ့ဆၧၫ့ ဝ့ၫ,မွဲနမိအီၪက့ၪလၩ့ခွံၬ နၥၭမၧၫ့လၧယကၠီၩ့ဆ့ဧၪ. ယလီၩဘၪနၧၩတီၩတီၩလီၩ့လီၩ့ယီၩ, ဆၫ့ဖၫလချႃၭ အီၩ့အိၪထၪ့ဒံၭဘၪနီၪ, နမိမီၪ့ဘံၭယၧၩနးၥၧၫ့ဖၧၫ့လီၫ."
		},
		"14": {
			"1": "<sup>1</sup> နၥံၪဝ့ၫဒၪယီၩထီးၥုၪ့ခိၥၭဝီၩလဂ့ၩ, နဲၩထဲၩ့ယွၩ",
			"2": "<sup>2</sup> တၭ,နဲၩထဲၩ့ယၧၩဆ့ဆံၭ.- လၧယဖါအီၪဝ့ၫအလး နီၪ,နီးလဖၪအီၪဝ့ၫအၪစီၪ့လီၫ. အ့ၪလမွဲဘၪဘဲၫနီၪ, ယလီၩဘၪယူၭနၥံၪယူၭတၭ, မွဲလၧယလ့ၩတဲၩ့ဝဲၩ",
			"3": "<sup>3</sup> နၥံၪအလးလစီၪ့အကၠီၩ့လီၫ.- ယအ့ၪလ့ၩတဲၩ့ဝဲၩ နၥံၪအလးလစီၪ့နီၪ, ဘဲၫၥိၭနၥံၪမိအီၪဘၪထီးယအီၪ အလးနီၪ ယမိဂဲၫထဲၩ့ဒီၭတၭ, မၩန့နၥံၪလၧယအီၪ",
			"4": "<sup>4</sup> လီၫ.- ထီးဒၪယလ့ၩဆၧလစီၪ့နီၪ, မွဲနၥံၪၥ့ၪယၫဒဲဖၧၩ့ ၥၭနီၪနၥံၪၥ့ၪယၫဆ့လီၫ.",
			"5": "<sup>5</sup> စထီမၭစံၭဝ့ၫ,ကဆါဧ့, မွဲနလ့ၩခီၫခီၫလဲၪနီၪပလၥ့ၪ ယၫဘၪတၭ, မွဲပၥ့ၪယၫဖၧၩ့ၥၭနီၪမိၥ့ၪဘဲၫၥ့ၪလဲၪ.",
			"6": "<sup>6</sup> ယ့ၫၡုၬစံၭဆၧၫ့ဝ့ၫ, ယဝ့ၫဒၪယီၩယမွဲဖၧၩ့ၥၭ, ဒဲဆၧ မွဲဆၧတီၩ,ဒဲဆၧမၧၫ့လီၫ. အ့ၪလမွဲဘၪလၧယၧၩ",
			"7": "<sup>7</sup> ယီၩၦထီၩ့လၧဖါအအီၪနးဂၩအ့ၬ.- နၥံၪအ့ၪၥ့ၪယၫ ယၧၩတၭ,မွဲနၥံၪမိၥ့ၪယၫယဖါဆ့လီၫ. တၭအယီၩစူၩ ယၫနၥံၪၥ့ၪယၫအဝ့ၫနီၪတၭ, မွဲနၥံၪဒၪဘၪယူၭဆ့လီၫ.",
			"8": "<sup>8</sup> စဖံလံၭစံၭအဝ့ၫ, ကဆါဧ့,ဒုၭနဲၪပၧၩလၧဖါတၭ,",
			"9": "<sup>9</sup> မိမံၫ့ၥုၪ့မံၫ့ၥၭပၧၩလီၫ.- ယ့ၫၡုၬစံၭအဝ့ၫ, စဖံလံၭဧ့, ယအီၪလၧနၥံၪအၥိၭ ယံၬခီးယီၩတၭ, မွဲနၥံၪၥ့ၪယၫ ယၧၩဒံၭအ့ၬဧၪ. ၦလၧအဒၪဘၪယၧၩယီၩမွဲအဒၪဘၪ ယူၭဖါဆ့လီၫ. အ့ၪမွဲဘဲၫနီၪတၭ, မွဲဘၪနီၫနစံၭဒုၭ",
			"10": "<sup>10</sup> နဲၪပၧၩလၧဖါနီၪလဲၪ.- ယအီၪလၧဖါအဖၧၩ့, ဒဲဖါအီၪ လၧယဖၧၩ့နီၪမွဲနနဲၩအ့ၬဧၪ. ဆၧချဲၩ့လၧယလီၩဘၪ နၥံၪယီၩမွဲယလီၩဘၪဒၪယဝ့ၫအ့ၬ. ဆၧလၧယမၩ",
			"11": "<sup>11</sup> ယဝ့ၫနီၪမွဲဖါအီၪလၧယဖၧၩ့မၩဆၧလီၫ.- နဲၩထဲၩ့ ယၧၩလၧယအီၪလၧဖါအဖၧၩ့, ဒဲဖါအီၪလၧယဖၧၩ့ ဆံၭ.အ့ၪလမွဲဘၪဘဲၫနီၪတၭ, နဲၩလၧယဆၧမၩလဖၪ အကၠီၩ့ဆံၭ.",
			"12": "<sup>12</sup> ယလီၩဘၪနၥံၪတီၩတီၩလီၩ့လီၩ့ယီၩ, ၦလၧအနဲၩ ထဲၩ့ယၧၩလဂၩဂၩ,ဆၧမၩလၧယမၩနီၪ မိမၩ ဒၪဝ့ၪဆ့တၭ,မိမၩဆၧဒိၪနဲၪ့အနီၪဒံၭလီၫ. အဂဲးဘဲၫ",
			"13": "<sup>13</sup> ယီၩမွဲယထဲၩ့ထၪ့လၧယဖါအီၪအကၠီၩ့လီၫ.- ထီး ဒၪနၥံၪအၪ့ကံၩ့ဆၧလမံၩ့လါလါလၧယမံၩ့နီၪယမိ မၩအနီၪဘဲၫၥိၭဖါအလၩအဖၩ့မိအီၪဖျီၪဝ့ၫ လၧဖိၪခွၫ",
			"14": "<sup>14</sup> အဖၧၩ့လီၫ.- နၥံၪအ့ၪအၪ့ကံၩ့ဆၧလမံၩ့မံၩ့လၧယမံၩ့ နီၪယမိဖ့ၪလၫ့နၥံၪလီၫ.",
			"15": "<sup>15</sup> နၥံၪအ့ၪအဲၪယၧၩတၭ, ထီးန့ဖံၭထၬယဆၧမၪ လူၬလဖၪနီၪဆံၭ.",
			"16": "<sup>16</sup> ယမိအၪ့ကံၩ့ဆၧလၧဖါတၭ, အဝ့ၫမိဖ့ၪလၫ့နၥံၪ လၧၦမၩမုၬဆၧအဂူၫဂၩလဂၩဘဲၫအမိအီၪဘၪလၧ",
			"17": "<sup>17</sup> နၥံၪအၥိၭလၩ့ဆိၩလၩ့ကၠၪလီၫ.- အဝ့ၫနီၪမွဲၥၭမုလၧ အဘၪဆဲၫ့လၧဆၧမွဲဆၧတီၩလၧဂၪ့ခိၪဖိၪထိးဆၧၫ့ ဝ့ၫဒၪၥ့ၪအ့ၬ. အဂဲးဘဲၫယီၩလဒၪဘၪဝ့ၫနီၪ ၥ့ၪယၫဝ့ၫ အ့ၬ.အ့ၪမွဲနၥံၪဝ့ၫယီၩ နၥံၪၥ့ၪယၫအဝ့ၫလီၫ. အဂဲး ဘဲၫယီၩအီၪဂုးခၧၫ့လၧနၥံၪအၥိၭတၭ, မိအီၪလၧ နၥံၪ",
			"18": "<sup>18</sup> အဖၧၩ့လီၫ.- ယလအီၪက့ၪဖိၪဎွ့ၪဘၪနၥံၪတၭး ယမိဂဲၫထဲၩ့လၧနၥံၪအအီၪလီၫ.",
			"19": "<sup>19</sup> မီခိၬဖီၩ့ခွံၬနီၪ, ဂၪ့ခိၪဖိၪလဒၪလၧၩ့ဘၪယၧၩတၭ, အ့ၪမွဲနၥံၪဝ့ၫဒၪယီၩနၥံၪမိဒၪဘၪယၧၩလီၫ. မွဲယမၧၫ့",
			"20": "<sup>20</sup> အကၠီၩ့တၭ, နၥံၪမိမၧၫ့ဆ့လီၫ.- လၧမုလနံၩနီၪနၥံၪ မိၥ့ၪယၫ လၧယအီၪလၧဖါအဖၧၩ့, ဒဲနၥံၪအီၪလၧယ",
			"21": "<sup>21</sup> ဖၧၩ့ဒဲယအီၪလၧနၥံၪအဖၧၩ့လီၫ.- ၦလၧအအီၪလၧ ယဆၧမၪလူၬလဖၪ,ဒဲထီးန့ဖံၭထၬဝ့ၫနီၪ,မွဲၦလၧ အအဲၪယၧၩ, ဒဲၦလၧအအဲၪယၧၩနီၪ, ယဖါမိအဲၪအဝ့ၫ တၭ,ယဝ့ၫဒၪယီၩယမိအဲၪဝ့ၫဆ့, ဒဲယမိဒုၭနဲၪယၥၭ လၧအဝ့ၫနီၪဆ့လီၫ.",
			"22": "<sup>22</sup> စယုဒၭ (လမွဲဘၪအံၭစကၫရအၧၭ)လဂၩ,စံၭအ ဝ့ၫ, ကဆါဧ့,ဆၧမိမၩအၥၭလၧနလမၩဖျီၪဘၪနၥၭ လၧဂၪ့ခိၪဖိၪယီၩတၭ, မွဲနမိမၩဖျီၪနၥၭ လၧပၧၩယီၩ",
			"23": "<sup>23</sup> ဘဲၫၥ့ၪလဲၪ.- ယ့ၫၡုၬချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭအဝ့ၫနီၪ, ၦအ့ၪအဲၪယၧၩတၭ, မိထီးန့ဖံၭထၬယလူတၭ, ယဖါ မိအဲၪအဝ့ၪဒၪ,ဒဲပမိဂဲၫလၧအအီၪတၭ, ပမိအီၪပဝ့ၫ လၧအၥိၭလီၫ.",
			"24": "<sup>24</sup> ၦလၧအလအဲၪဘၪယၧၩနီၪ ထီးန့ယလူအ့ၬ. ဆၧ ချဲၩ့လၧနၥံၪနါဂၧၫ့နီၪမွဲယလူအ့ၬ. မွဲဖါလၧအအၪ့မၧၫ့",
			"25": "<sup>25</sup> လၩ့ယၧၩလဂၩနီၪအလူလီၫ.- ဆၧနီၪလဖၪယလီၩ ဘၪယူၭနၥံၪလၧယအီၪလၧနၥံၪအၥိၭ အဘိၩ့ဘၭနီၪ လီၫ.",
			"26": "<sup>26</sup> မွဲလါနၫ့ဘိၩၦမၩမုၬဆၧ,ၥၭမုဆံၫ့ဎံၪ,လၧဖါ မိအၪ့မၧၫ့လၩ့ဝ့ၫလၧယမံၩ့နီၪ, အဝ့ၫလဂၩမိၥီၪ့ထဲၩ့ နၥံၪလၧဆၧထီးအလူၬ, ဒဲမိဒုၭနၪ့ထၪ့ထဲၩ့နၥံၪလၧ",
			"27": "<sup>27</sup> ဆၧလၧယလီၩဘၪနၥံၪထီးအလူၬလီၫ.- ယအီၪက့ၪ လၩ့ထးဆၧမုၬဆၧလၩလၧနၥံၪအဂးတၭ, ယဆၧ မုၬဆၧလၩနီၪယဖ့ၪလၫ့နၥံၪလီၫ. ယဖ့ၪလၫ့နၥံၪဘဲၫ ဂၪ့ခိၪဖိၪဖ့ၪလၫ့ဝ့ၫအၥိၭနီၪမွဲအ့ၬ. ထီးၥုၪ့ခိၥၭဝီၩလ",
			"28": "<sup>28</sup> ဂ့ၩ,ထီးၥၭမဲၪဆၧလဂ့ၩ,- နၥံၪနါဂၧၫ့ယူၭလၧယစံၭ နၥံၪ,ယလ့ၩဆၧတၭယမိဂဲၫထဲၩ့လၧနၥံၪ အအီၪလီၫ. နၥံၪအ့ၪအဲၪယၧၩတၭ, မွဲယစံၭဆၧလၧယလ့ၩထၪ့ လၧဖါအအီၪနီၪ, နၥံၪမိၥၭထိၬနၥံၪဝ့ၫလီၫ. အဂဲး",
			"29": "<sup>29</sup> ဘဲၫယီၩယဖါဒိၪနဲၪ့ယၧၩဒံၭလီၫ.- ထီးဆၧနီၪလဖၪ မၩအၥၭတၭ, ဘဲၫၥိၭနၥံၪမိနဲၩဆၧနီၪ, ယလီၩဘၪဝဲၩ နၥံၪဘိၩ့နဲၪ့ယီၩ ဘိၩ့အလချႃၭ မၩဒံၭဘၪအၥၭနီၪ လီၫ.",
			"30": "<sup>30</sup> လၧယၫလခီၫနီၪ ယမိလီၩဘၪဆၧလၧနၥံၪအၪလၧၩ့ အ့ၬ. အဂဲးဘဲၫယီၩဂၪ့ခိၪအခိၪဂဲၫဝ့ၫတၭ, အဆၧ အီၪလၧယဖၧၩ့နးမံၩ့အ့ၬ.",
			"31": "<sup>31</sup> မွဲလါနၫ့ဘိၩ ဘဲၫၥိၭဂၪ့ခိၪဖိၪမိၥ့ၪယၫ လၧယအဲၪ ဖါတၭ,ဘဲၫဖါမၪလူၬယၧၩအၥိၭနီၪ, ယမၩယဝ့ၫ ဘဲၫနီၪအၥိၭလီၫ. ဂဲထုၪ့ဘီၪ, မွဲပစဲၪ့ထၪ့ခွံၬၡီၩ့ ထီး ယီၩဆံၭ."
		},
		"15": {
			"1": "<sup>1</sup> ယဝ့ၫဒၪယီၩ ယမွဲစဘံၭအမုလၩ့ထံးလၩ့ဆ့ၭတၭ,",
			"2": "<sup>2</sup> ယဖါမွဲၦခိၭစဘံၭအလးလီၫ.- ကယဲအထဲၩ့လၧယ လီၩ့လၧအလၥၪဘၪဝ့ၫနီၪ, မွဲအဖ့ၬခွံၬဝ့ၫတၭးကယဲ အထဲၩ့လၧအၥၪဝ့ၫနီၪ, ဘဲၫၥိၭအမိၥၪအၪထၪ့တၭ,",
			"3": "<sup>3</sup> မၩဆံၫ့ထၪ့ဝ့ၫဒၪလီၫ.- ဘိၩ့နဲၪ့ယီၩမွဲလၧယလူလၧ ယလီၩဘၪနၥံၪအကၠီၩ့ယီၩနၥံၪဆံၫ့ယူၭနၥံၪဝ့ၫလီၫ.",
			"4": "<sup>4</sup> အီၪဂုးခၧၫ့နၥံၪဝ့ၫလၧယဖၧၩ့တၭ, ယမိအီၪဂုးခၧၫ့ ယဝ့ၫလၧနၥံၪအဖၧၩ့လီၫ. ဘဲၫထဲၩ့အ့ၪလအီၪဂုးခၧၫ့ ဘၪဝ့ၫလၧစဘံၭမုအလီၩ့နီၪၥၪဒၪအဆၧလၥ့ၪဘၪအ ၥိၭနီၪ,နၥံၪဝ့ၫဒၪယီၩ နၥံၪအ့ၪလအီၪဂုးခၧၫ့ဘၪလၧ",
			"5": "<sup>5</sup> ယဖၧၩ့တၭ, နၥံၪလၥၪဘၪဘဲၫနီၪအၥိၭလီၫ.- ယဝ့ၫ ဒၪယီၩယမွဲစဘံၭအမုတၭ, နၥံၪမွဲအထဲၩ့လီၫ. ၦလၧ အအီၪဂုးခၧၫ့လၧယဖၧၩ့, ဒဲယအီၪလၧအဖၧၩ့နီၪ, ၥၪ ဝ့ၫအၪဖျိၪ့လီၫ.အဂဲးဘဲၫယီၩအ့ၪလမွဲဘၪလၧယကၠီၩ့",
			"6": "<sup>6</sup> တၭ,နၥံၪမၩဆၧၥ့ၪနးမံၩ့အ့ၬ.- ၦလဂၩဂၩအ့ၪလအီၪ ဂုးခၧၫ့ဘၪဝ့ၫလၧယဖၧၩ့ယီၩ, ဘၪဆၧခွံၬၡိၭဝ့ၫဘဲၫ ဆၧအထဲၩ့အၥိၭတၭ,ဎဲၫ့ထၬခွံၬဝ့ၫဒၪလီၫ. ၦအၪ့ထုၫ့ ကီၪ့အဝ့ၫၥံၪဖျႃၭလၩ့ဝ့ၫလၧမ့ၪဖၧၩ့တၭ, ဆူၭခဲၩထၪ့",
			"7": "<sup>7</sup> ဝ့ၫဒၪလီၫ.- နၥံၪအ့ၪအီၪဂုးခၧၫ့လၧယဖၧၩ့, ဒဲယလူ ယထၫအီၪဂုးခၧၫ့လၧနၥံၪအဖၧၩ့တၭ, ထီးဒၪအဘၪ နၥံၪအၥၭလၧဆၧလမံၩ့လါလါနီၪ, အၪ့ကံၩ့ဆံၭ, တၭဆၧမိမၩလၧနၥံၪအဂးလီၫ.",
			"8": "<sup>8</sup> လၧနၥံၪၥၪထၪ့အၪဖျိၪ့အကၠီၩ့နီၪ, မွဲယဖါအလၩအ ဖၩ့အီၪဖျီၪဝ့ၫတၭ, နၥံၪမိကဲၪထၪ့ယထံၩယဖျဲလီၫ.",
			"9": "<sup>9</sup> ဘဲၫဖါအဲၪယၧၩအၥိၭနီၪ, ယဝ့ၫဒၪယီၩယအဲၪနၥံၪဆ့",
			"10": "<sup>10</sup> လီၫ.အီၪဂုးခၧၫ့လၧယဆၧအဲၪအဖၧၩ့ဆံၭ.- နၥံၪအ့ၪ ထီးန့ဖံၭထၬယဆၧမၪလူၬလဖၪနီၪ, နၥံၪမိအီၪဂုး ခၧၫ့လၧယဆၧအဲၪအဖၧၩ့ ဘဲၫယထီးန့ဖံၭထၬယဖါ အဆၧမၪလူၬလဖၪနီၪ, ဒဲယအီၪဂုးခၧၫ့ယဝ့ၫ လၧအ ဆၧအဲၪအဖၧၩ့အၥိၭနီၪလီၫ.",
			"11": "<sup>11</sup> ဘဲၫၥိၭယဆၧၥၭထိၬမိအီၪဝ့ၫလၧနၥံၪအဖၧၩ့, ဒဲန ၥံၪအဆၧၥၭထိၬမိလၧၫ့ထၪ့ဎွ့ၩထၪ့ဝ့ၫတၭ, ယလီၩ",
			"12": "<sup>12</sup> ဘၪယူၭဆၧယီၩလဖၪလီၫ.- အယီၩမွဲယဆၧမၪ လူၬ,ဘဲၫယအဲၪနၥံၪအၥိၭနီၪ, အဲၪလိၬကွံၩလိၬနၥံၪ အၥၭဘဲၫနီၪအၥိၭဆံၭ.",
			"13": "<sup>13</sup> ၦလဂၩဂၩအ့ၪအီၪက့ၪလၩ့ အၥၭမၧၫ့လၧအထံၩ အၥိၭအကၠီၩ့နီၪ, ၦၡၩအဆၧအဲၪဆၧကွံၩနီၪဒိၪ",
			"14": "<sup>14</sup> နဲၪ့အဝ့ၫနီၪအီၪနးဂၩအ့ၬ.- ထီးဒၪဆၧလၧယမၪလူၬ နၥံၪနီၪနၥံၪအ့ၪမၩတၭ, နၥံၪမွဲယထံၩယၥိၭလီၫ.",
			"15": "<sup>15</sup> ယကိၭလၧၩ့နၥံၪလၧဎီးလၧၡၩအ့ၬ. အဂဲးဘဲၫယီၩ အ ကဆါမၩနီၫလဲၪနီၫလဲၪနီၪ, အဎီးအၡၩၥ့ၪယၫဝ့ၫအ့ၬ. ယကိၭထဲၩ့နၥံၪလၧထံၩလၧၥိၭလီၫ. အဂဲးဘဲၫယီၩ ကယဲယနါဂၧၫ့ဆၧလၧဖါအအီၪနီၪ ယဒုၭၥ့ၪယၫနၥံၪ လီၫ.",
			"16": "<sup>16</sup> နၥံၪဝ့ၫဒၪယီၩနၥံၪလရွံန့ဘၪယၧၩတၭ, ယဝ့ၫဒၪ ယီၩယရွံန့ယူၭနၥံၪ, ဒဲအီၪက့ၪလၩ့ယူၭနၥံၪဘဲၫၥိၭ နၥံၪမိလ့ၩၥၪထၪ့, ဒဲနၥံၪအဆၧၥၪနီၪ မိအီၪဂုးခၧၫ့ဝ့ၫ လီၫ.ဘဲၫၥိၭနၥံၪအ့ၪအၪ့ကံၩ့ဆၧလမံၩ့လါလါ လၧဖါ နီၪလၧယမံၩ့အကၠီၩ့တၭ, အဝ့ၫဒၪမိဖ့ၪလၫ့ဝ့ၫလၧ",
			"17": "<sup>17</sup> နၥံၪအဂးလီၫ.- ယမၪလူၬနၥံၪလၧဆၧလဖၪယီၩဘဲၫ ၥိၭနၥံၪမိအဲၪလိၬကွံၩလိၬနၥံၪအၥၭလီၫ.",
			"18": "<sup>18</sup> ဂၪ့ခိၪဖိၪအ့ၪမ့ၬလဲၩနၥံၪနီၪ, ၥ့ၪယၫနၥံၪဝ့ၫလၧ အလချႃၭ မ့ၬလဲၩဒံၭဘၪနၥံၪနီၪ, မ့ၬလဲၩဆိၫယၧၩ",
			"19": "<sup>19</sup> ယီၩလီၫ.- နၥံၪအ့ၪဘၪဆဲၫ့ လၧဂၪ့ခိၪဖိၪနီၪ ဂၪ့ခိၪဖိၪ မိအဲၪအဆၧဒၪဝ့ၫလီၫ. အ့ၪမွဲနၥံၪဝ့ၫယီၩ နၥံၪလဘၪ ဆဲၫ့ဘၪလၧဂၪ့ခိၪဖိၪတၭ, ယရွံန့ခွံၬနၥံၪလၧဂၪ့ခိၪဖိၪ ၥံၪအကျၩအကၠီၩ့နီၪဂၪ့ခိၪဖိၪမ့ၬလဲၩနၥံၪလီၫ.",
			"20": "<sup>20</sup> နၪ့ထၪ့ထဲၩ့ဆၧချဲၩ့လၧယလီၩဘၪနၥံၪနီၪ,အဎီး အၡၩဒိၪနဲၪ့အကဆါအ့ၬ. အဝ့ၫၥံၪအ့ၪမၩအၧၩ့ယၧၩ တၭမိမၩအၧၩ့နၥံၪဆ့လီၫ. အ့ၪထီးန့ဖံၭထၬယလူ",
			"21": "<sup>21</sup> တၭ,မိထီးန့ဖံၭထၬနၥံၪအလူဆ့လီၫ.- မွဲလါနၫ့ဘိၩ အဝ့ၫၥံၪမိမၩနၥံၪလၧဆၧနီၪလဖၪ ထီးအလူၬလၧယ မံၩ့အကၠီၩ့လီၫ. အဂဲးဘဲၫယီၩၦလၧအအၪ့မၧၫ့လၩ့ န့ယၧၩနီၪ အဝ့ၫၥံၪၥ့ၪယၫဝ့ၫအ့ၬ.",
			"22": "<sup>22</sup> ယအ့ၪလဂဲၫလီၩဘၪအဝ့ၫၥံၪနီၪ အဆၧမၪအီၪ အ့ၬ. အ့ၪမွဲဘိၩ့နဲၪ့ယီၩအဆၧချဲၩ့ဖီၩ့ဖျ့ၭလၩ့အ",
			"23": "<sup>23</sup> ၥၭအီၪနးမံၩ့အ့ၬ.- ၦလၧအမ့ၬလဲၩယၧၩလဂၩဂၩနီၪ,",
			"24": "<sup>24</sup> မ့ၬလဲၩယဖါဆ့လီၫ.- ဆၧမၩလၧၦဂူၫဂၩလမၩဘၪ နးဂၩနီၪ, ယအ့ၪလမၩဘၪလၧအဝ့ၫၥံၪအမ့ၬယၫ တၭ,အဆၧမၪအီၪအ့ၬ. အ့ၪမွဲဘိၩ့နဲၪ့ယီၩအဝ့ၫၥံၪ ဒၪဘၪဆၧလါနၫ့တၭ, မ့ၬလဲၩယၧၩ,ဒဲယဖါဆ့နံၫဂၩ",
			"25": "<sup>25</sup> လူၬလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ဆၧချဲၩ့လၧဆၧကွ့ၭ အၥၭလၧအဝ့ၫၥံၪအဆၧမၪလူၬအဖၧၩ့နီၪ, လၧၫ့ထၪ့ ဎွ့ၩထၪ့ဝ့ၫတၭ, စံၭဝ့ၫ, အဝ့ၫၥံၪမ့ၬလဲၩယၧၩပျီၩ ပျီၩလီၫ.",
			"26": "<sup>26</sup> အ့ၪမွဲထီးၦမၩမုၬဆၧလၧ ယမိအၪ့မၧၫ့လၩ့ဝ့ၫလၧ ဖါအအီၪလဂၩနီၪ, ၥၭမုလၧအဘၪဆဲၫ့လၧဆၧမွဲဆၧ တီၩလၧအဂဲၫလၩ့လၧဖါအအီၪ အ့ၪဂဲၫထီၩ့ဝ့ၫ",
			"27": "<sup>27</sup> တၭ,မိထိးအၥၭလၧယဂဲးယကၠီၪ့လီၫ.- နၥံၪဝ့ၫဒၪ လဖၪယီၩနၥံၪမိထိးနၥံၪအၥၭဆ့လီၫ. အဂဲးဘဲၫ ယီၩနၥံၪအီၪလၧယၥိၭလၧအခၪ့ထံၭလံၩလံၩခီး ဘိၩ့နဲၪ့ယီၩအကၠီၩ့လီၫ."
		},
		"16": {
			"1": "<sup>1</sup> ဘဲၫၥိၭနၥံၪထီးဘၪ ဆၧလၩ့ထံၩဖါအလးလဂ့ၩ",
			"2": "<sup>2</sup> နီၪ,ယလီၩဘၪယူၭနၥံၪလၧဆၧယီၩလဖၪလီၫ.- ၦၡၩ လဖၪမိနၫ့ထၪ့ခွံၬနၥံၪလၧၥရိၬဖၧၩ့တၭ, မွဲယူၭ, အ ဆၧၫ့အထီမိဘၪလၧၦလဂၩဂၩ လၧအမၩၥံၫနၥံၪနီၪ,",
			"3": "<sup>3</sup> မိဆီၫ့မီၪ့ဝ့ၫလၧအမၩဘိၪ့ယွၩလီၫ.- အခိးမွဲအလ ၥ့ၪယၫဘၪဖါ, ဒဲယၧၩယီၩတၭ, အဝ့ၫၥံၪမိမၩဆၧလ ဖၪနီၪလီၫ.",
			"4": "<sup>4</sup> မွဲလါနၫ့ဘိၩထီးအဆၧၫ့အထီအ့ၪဘၪနီၪ, ဘဲၫၥိၭ နၥံၪမိနၪ့ထၪ့ထဲၩ့ လၧယလီၩဘၪနၥံၪအဆၧယီၩလဖၪ တၭ, ယလီၩဘၪဝဲၩယူၭနၥံၪယူၭ. လၧအၥၫ့လၧအ ခၪ့ထံၭနီၪယအီၪဒံၭလၧနၥံၪအၥိၭတၭ, ဆၧယီၩလဖၪ",
			"5": "<sup>5</sup> ယလီၩဘၪဒံၭနၥံၪအ့ၬ.- အ့ၪမွဲဘိၩ့နဲၪ့ယီၩ, ယမိထဲၩ့ ထၪ့လၧၦလၧအအၪ့မၧၫ့လၩ့န့ယၧၩလဂၩ အအီၪနီၪ တၭ,မွဲနမိလ့ၩခီၫခီၫလဲၪနီၪ နၥံၪအၪ့စၪ့ယၧၩနးဂၩ",
			"6": "<sup>6</sup> အ့ၬ.- မွဲလါနၫ့ဘိၩယလီၩဘၪနၥံၪလၧဆၧယီၩလဖၪ အဂဲးတၭ, နၥံၪအၥုၪ့နၥံၪအၥၭလၧၫ့ဎွ့ၩယူၭလၧဆၧ ၥၭအုၭလခီၫနီၪလီၫ.",
			"7": "<sup>7</sup> မွဲလါနၫ့ဘိၩယလီၩဘၪနၥံၪလၧဆၧမွဲဆၧတီၩ, ယထဲၩ့ထၪ့နီၪမွဲအဂ့ၩဒၪအဆၧလၧနၥံၪအဂးလီၫ.အ ဂဲးဘဲၫယီၩယအ့ၪလထဲၩ့ထၪ့ဘၪတၭ, ၦမၩမုၬဆၧလ ဂၩနီၪမိဂဲၫလၧနၥံၪအီၪအ့ၬ. မွဲလါနၫ့ယအ့ၪထဲၩ့ထၪ့",
			"8": "<sup>8</sup> နီၪယမိအၪ့မၧၫ့အဂဲၫလၩ့လၧနၥံၪအအီၪလီၫ.- ထီး အဝ့ၫဒၪဂဲၫအ့ၪထီၩ့တၭ, မိဒုၭၥ့ၪယၫဂၪ့ခိၪဖိၪလၧဆၧ ဒဲၩဘၭအဂဲး, ဒဲဆၧတီၩဆၧလီၩ့အဂဲး, ဒဲဆၧစ့ၩရၫ့ အဂဲးလီၫ.",
			"9": "<sup>9</sup> လၧဆၧဒဲၩဘၭအဂဲး,မွဲအဝ့ၫၥံၪလနဲၩဘၪယၧၩ",
			"10": "<sup>10</sup> အကၠီၩ့နီၪ,- လၧဆၧတီၩဆၧလီၩ့အဂဲး,မွဲယထဲၩ့ ထၪ့လၧယဖါအအီၪ, ဒဲနၥံၪလဒၪလၧၩ့ဘၪယၧၩအ",
			"11": "<sup>11</sup> ကၠီၩ့နီၪ,- လၧဆၧစ့ၩရၫ့အဂဲး,မွဲဂၪ့ခိၪအခိၪလဂၩ ဘၪဆၧစ့ၩရၫ့အကၠီၩ့နီၪလီၫ.",
			"12": "<sup>12</sup> ယလီၩဘၪနၥံၪ, ဆၧအီၪဒံၭအၪအၪလ့ၬလါနၫ့တၭ,",
			"13": "<sup>13</sup> ဘိၩ့နဲၪ့ယီၩနၥံၪဒိၭန့ကဲၪဝါဒံၭအ့ၬ.- အ့ၪမွဲထီၩ့အ ဝ့ၫဒၪ,ၥၭမုလၧအဘၪဆဲၫ့ လၧဆၧမွဲဆၧတီၩ ဂဲၫအ့ၪ ထီၩ့ဝ့ၫနီၪ, မိၥိၫ့နၥံၪလၧဆၧမွဲဆၧတီၩထီးအလူၬအ ဖၧၩ့လီၫ.အဂဲးဘဲၫယီၩမိလီၩဘၪ အဆၧဒၪဝ့ၫနီၪ မွဲ အ့ၬ.ထီးဒၪအနါဂၧၫ့ဝ့ၫလဖၪနီၪ မိလီၩလၩ့လၬလၩ့ ဝ့ၫတၭ,မိလီၩဘၪနၥံၪလၧဆၧမိမၩအၥၭအဂဲးဆ့",
			"14": "<sup>14</sup> လီၫ.- အဝ့ၫဒၪနီၪ မိမၩလၩဖၩ့ယၧၩလီၫ. အဂဲးဘဲၫ ယီၩမိမၩန့ဆၧဘၪဆဲၫ့လၧယၧၩတၭ, မိလီၩဘၪနၥံၪ",
			"15": "<sup>15</sup> လီၫ.- ကယဲယဖါအဆၧအီၪလမံၩ့လါလါနီၪမွဲယဆၧ လီၫ.မွဲဘဲၫနီၪတၭ, ယလီၩဘၪနၥံၪလၧအမိမၩန့ဆၧ ဘၪဆဲၫ့လၧယၧၩယီၩတၭ, မိလီၩဘၪနၥံၪလီၫ.",
			"16": "<sup>16</sup> မီခိၬတၭနၥံၪဒၪဘၪလၧၩ့ယၧၩအ့ၬ. မၩဒီၭမီခိၬ နီၪနၥံၪမိဒၪဘၪယၧၩလီၫ. အဂဲးဘဲၫယီၩ ယမိထဲၩ့ ထၪ့လၧယဖါအအီၪလီၫ.",
			"17": "<sup>17</sup> မၩအၥၭဘဲၫနီၪတၭ, အထံၩအဖျဲလနၩ့နၩ့ချဲၩ့လိၬ အၥၭတၭ,အဝ့ၫဒၪစံၭဆၧ,မီခိၬနီၪနၥံၪလဒၪလၧၩ့ဘၪ ယၧၩ,မၩဒီၭမီခိၬ,နၥံၪမိဒၪဘၪယၧၩတၭ, အဂဲးဘဲၫ ယီၩယထဲၩ့ထၪ့လၧယဖါအအီၪနီၪတၭ, မွဲအစံၭဝ့ၫ",
			"18": "<sup>18</sup> ဘဲၫၥ့ၪလဲၪ.- မၩအၥၭဘဲၫနီၪတၭ, အဝ့ၫၥံၪစံၭ, အဝ့ၫ ဒၪစံၭဝ့ၫ, :မီခိၬ,: မွဲအစံၭဝ့ၫဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪ နီၪ,ပၥ့ၪယၫအ့ၬ.",
			"19": "<sup>19</sup> မၩအၥၭဘဲၫနီၪတၭ, ယ့ၫၡုၬၥ့ၪယၫဝ့ၫလၧအဝ့ၫၥံၪ မိအၪ့စၪ့ဘၪအၥၭတၭ,စံၭအဝ့ၫၥံၪ, ယလီၩဘၪ နၥံၪ,မီခိၬတၭ, နၥံၪဒၪဘၪလၧၩ့ယၧၩအ့ၬ, မၩဒီၭ မီခိၬတၭ,နၥံၪမိဒၪဘၪထဲၩ့ယၧၩအဂဲးနီၪ, မွဲနၥံၪ",
			"20": "<sup>20</sup> အၪ့စၪ့လိၬနၥံၪအၥၭဆ့ဧၪ.- ယလီၩဘၪနၥံၪတီၩတီၩ လီၩ့လီၩ့ယီၩ, လၧနၥံၪအမ့ၬထံၫမိလၩ့တၭ, နၥံၪ မိဂၪ့မိယၧၩ့နၥံၪဝ့ၫလီၫ. အ့ၪမွဲဂၪ့ခိၪဖိၪနီၪမိၥၭထိၬဝ့ၫ လခီၫလီၫ. နၥံၪဝ့ၫယီၩ နၥံၪမိၥုၪ့အုၭၥၭအုၭ လါနၫ့ ဘိၩ,နၥံၪအဆၧၥၭအုၭနီၪ, မိကဲၪထဲၩ့လၧဆၧၥၭထိၬ",
			"21": "<sup>21</sup> ဝ့ၫလခီၫလီၫ.- ၦမုၪနီၪထီၩ့အမိအီၪဖျဲၪ ဆၧဘၪဝ့ၫတၭ, အၥုၪ့အုၭအၥၭအုၭဝ့ၫလီၫ. အဂဲးဘဲၫယီၩအမုအ လၩဘၪယူၭ. အ့ၪမွဲထီးဖိၪၥၪ အီၪဖျဲၪဝ့ၫဂီၩ့နီၪ, ၥၭ ထိၬဝ့ၫလၧၦၡၩလဂၩအီၪဖျဲၪဝ့ၫ လၧဂၪ့ခိၪယီၩအဂဲး",
			"22": "<sup>22</sup> တၭ,နၪ့ထၪ့ထဲၩ့လၧၩ့အဆၧၡၪ့နီၪအ့ၬ.- မၩအၥၭဘဲၫ နီၪတၭ,ဘိၩ့နဲၪ့ယီၩ နၥံၪအၥုၪ့အုၭအၥၭအုၭ လါနၫ့ ဘိၩ,ယမိဒၪထဲၩ့ဒီၭနၥံၪတၭ, နၥံၪမိၥုၪ့ထိၬၥၭ ထိၬတၭ,နၥံၪအဆၧၥၭထိၬနီၪ, ၦအၪ့ဂူၬန့ခွံၬဝ့ၫလၧ နၥံၪအအီၪနးဂၩအ့ၬ.",
			"23": "<sup>23</sup> တၭလၧမုလနံၩနီၪ, နၥံၪမိအၪ့ကံၩ့ဘၪလၧၩ့ဆၧလၧ ယၧၩနးမံၩ့အ့ၬ. ယလီၩဘၪနၥံၪ တီၩတီၩလီၩ့လီၩ့ ယီၩ,ထီးဒၪနၥံၪအၪ့ကံၩ့ဆၧလမံၩ့လါလါလဖၪနီၪ",
			"24": "<sup>24</sup> လၧယမံၩ့အကၠီၩ့တၭ, အဝ့ၫဒၪမိဖ့ၪလၫ့နၥံၪလီၫ.- ခီး ဘိၩ့နဲၪ့ယီၩမွဲနၥံၪအၪ့ကံၩ့ဆၧလၧယမံၩ့အကၠီၩ့နးမံၩ့ ဒံၭအ့ၬ.အၪ့ကံၩ့ဆံၭ, တၭနၥံၪမိန့ဘၪဘဲၫၥိၭနၥံၪအ ဆၧၥၭထိၬမိလၧၫ့ထၪ့ဎွ့ၩထၪ့ဝ့ၫဒၪလီၫ.",
			"25": "<sup>25</sup> ဆၧယီၩလဖၪယလီၩဘၪယူၭနၥံၪ လၧဆၧချဲၩ့အ ဒီၩ့ယူၭ. ဆၧအဆၧၫ့အထီမိဘၪဝ့ၫ လၧယလီၩဘၪ လၧၩ့နၥံၪလၧဆၧချဲၩ့အဒီၩ့အ့ၬ. မွဲယမိလီၩဘၪနၥံၪ",
			"26": "<sup>26</sup> လၧဖါအဂဲးအကၠီၪ့လၩ့ထံးလၩ့ဆ့ၭလီၫ.- ဆၧလၧမု လနံၩနီၪနၥံၪမိအၪ့ကံၩ့ဆၧလၧယမံၩ့အကၠီၩ့တၭ, ယလလီၩဘၪနၥံၪ လၧယမိအၪ့ကံၩ့န့နၥံၪအဂး လၧ",
			"27": "<sup>27</sup> ဖါနီၪး- အဂဲးဘဲၫယီၩမွဲနၥံၪအဲၪယၧၩ, နၥံၪနဲၩလၧယ ဂဲၫလၩ့လၧယွၩအအီၪအကၠီၩ့တၭ, ဖါအနၫ့ဆါဒၪဝ့ၫ",
			"28": "<sup>28</sup> အဲၪနၥံၪလီၫ.- ယဂဲၫလၩ့လၧဖါအအီၪတၭ,ယ ထီၩ့လၩ့ယူၭလၧဂၪ့ခိၪချိၫ့ယီၩလီၫ. မၩဒီၭလဖၧၫ့ယ စဲၪ့ထၪ့ခွံၬလၧဂၪ့ခိၪတၭ, ယမိထဲၩ့ထၪ့ထဲၩ့လၧဖါအ အီၪလီၫ.",
			"29": "<sup>29</sup> အထံၩအဖျဲၥံၪစံၭအဝ့ၫ, ယိခွါ,ဘိၩ့နဲၪ့ယီၩနချဲၩ့",
			"30": "<sup>30</sup> ဆၧလၩ့ထံးလၩ့ဆ့ၭတၭ, နချဲၩ့ဒီၩ့လၩ့ဆၧအ့ၬ.- ဘိၩ့ နဲၪ့ယီၩပၥ့ၪယၫလၧ နၥ့ၪယၫဆၧထီးအလူၬတၭ, ၦလ ဂၩဂၩ အၪ့စၪ့နၧၩအလးလအီၪဘၪ, လၧဆၧယီၩအ ဂဲးပနဲၩလၧနဂဲၫလၩ့လၧယွၩအအီၪလီၫ.",
			"31": "<sup>31</sup> ယ့ၫၡုၬချဲၩ့ဆၧၫ့အဝ့ၫၥံၪ, မွဲနၥံၪနဲၩ ဘိၩ့နဲၪ့ယီၩ",
			"32": "<sup>32</sup> ဆ့ဧၪ.- ယိခွါ,အနၩရံၩမိဘၪဝ့ၫတၭ, ဘၪယူၭဘိၩ့ နဲၪ့ယီၩ,လၧနၥံၪမိလၩ့ဖၭလိၬနၥံၪအၥၭလဂၩလၧအ လးဒၪဝ့ၫ, လဂၩလၧအလးဒၪဝ့ၫနီၪ, နၥံၪမိစဲၪ့ခွံၬၡိၭ ထးယၧၩလဂၩဎးတၭ, ယအီၪလဂၩဎးဆ့အ့ၬ.အဂဲး ဘဲၫယီၩဖါအီၪဝ့ၫလၧယၥိၭလီၫ.",
			"33": "<sup>33</sup> ဘဲၫၥိၭနၥံၪမိအီၪလၧ ဆၧမုၬဆၧလၩလၧယၧၩတၭ, ယလီၩဘၪယူၭနၥံၪလၧဆၧယီၩလဖၪလီၫ. လၧဂၪ့ခိၪ ချိၫ့ယီၩနၥံၪမိဘၪဆၧအၡၪ့လီၫ. မွဲလါနၫ့တၭ, ၥၭ ဎွံၫထၪ့နၥံၪဝ့ၫဘီၪ, ယဝ့ၫဒၪယီၩယမၩနၧၩ့မၩစၪယူၭ ဂၪ့ခိၪယူၭလီၫ."
		},
		"17": {
			"1": "<sup>1</sup> ဆၧနီၪလဖၪယ့ၫၡုၬလီၩဘၪဝ့ၫဂီၩ့တၭ, ယိထၪ့ဆၧ လၧမူၭခိၪတၭ,စံၭဝ့ၫ,ဖါဧ့,နၩရံၩဘၪယူၭ, ဘဲၫနဖိၪ ခွၫမိဒုၭလၩဖၩ့နၧၩ အၥိၭနီၪ, ဒုၭဖျီၪထၪ့ နဖိၪခွၫအ",
			"2": "<sup>2</sup> လၩအဖၩ့ဆံၭ.- ဘဲၫနဖ့ၪလၫ့အဝ့ၫဒၪလၧ အစီၩ့အမၩ့ လၧကယဲဆၧအယၪထီးအလူၬအဖၫ့ခိၪအၥိၭနီၪ, ဘဲၫ နီၪအၥိၭ,အဝ့ၫဒၪမိဖ့ၪလၫ့ ကယဲၦလၧနဖ့ၪလၫ့ဝ့ၫလၧ အစူၪဖၧၩ့လဂၩလါလါနီၪ, လၧဆၧမၧၫ့အဆိၩအကၠၪ",
			"3": "<sup>3</sup> နီၪလီၫ.- တၭဆၧမၧၫ့အဆိၩအကၠၪနီၪမွဲအယီၩ,ဆၧ ၥ့ၪယၫလၧနမွဲယွၩလဂၩဎးလၩ့ထံးလၩ့ဆ့ၭ, ဒဲယ့ၫ",
			"4": "<sup>4</sup> ၡုၬဎရံၬလၧနအၪ့မၧၫ့လၩ့နီၪလီၫ.- ယဒုၭလၩဖၩ့ ယူၭနၧၩလၧဂၪ့ခိၪချိၫ့ယီၩယူၭ, ဆၧမၩလၧနဖ့ၪလၫ့",
			"5": "<sup>5</sup> ယၧၩလၧယဘၪမၩနီၪယမၩဂီၩ့ယူၭ.- ဘိၩ့နဲၪ့ယီၩ, ဖါဧ့,ဒုၭလၩဒုၭဖၩ့ယၧၩလၧ နနၫ့ဆါဒၪနဝ့ၫလၧဆၧ လၩဆၧဖၩ့လၧအအီၪလၧ ယလီၩ့လၧယအီၪလၧနၥိၭ",
			"6": "<sup>6</sup> လၧဂၪ့ခိၪလချႃၭကဲၪထၪ့ဒံၭဘၪနီၪဆံၭ.- ၦၡၩၥံၪ လၧနဖ့ၪလၫ့ယၧၩလၧဂၪ့ခိၪဖိၪအကျၩနီၪ, ယဒုၭဖျီၪ ထၪ့ယူၭနမံၩ့လၧအဝ့ၫၥံၪအမ့ၬယၫနီၪလီၫ. အဝ့ၫၥံၪ မွဲနဆၧတၭ, နဖ့ၪလၫ့ယူၭအဝ့ၫၥံၪလၧယစူၪဖၧၩ့ယူၭ.",
			"7": "<sup>7</sup> အဝ့ၫၥံၪထီးန့ယူၭနလူနထၫယူၭလီၫ.- ဘိၩ့နဲၪ့ယီၩ အဝ့ၫၥံၪၥ့ၪယၫလၧထီးဒၪ ဆၧလၧနဖ့ၪလၫ့ယၧၩ ထီး",
			"8": "<sup>8</sup> အလူၬနီၪ, ဂဲၫလၩ့လၧနအီၪအလးလီၫ.- အဂဲးဘဲၫယီၩ ဆၧချဲၩ့လၧနဖ့ၪလၫ့ယၧၩလဖၪနီၪ, ယဖ့ၪလၫ့ထဲၩ့ အဝ့ၫၥံၪတၭ,အဝ့ၫၥံၪမၩန့ထဲၩ့ဝ့ၫတၭ, ၥ့ၪယၫလၩ့ ထံးလၩ့ဆ့ၭလၧယဂဲၫလၩ့လၧနအီၪတၭ, နဲၩဝ့ၫလၧန",
			"9": "<sup>9</sup> အၪ့မၧၫ့လၩ့န့ယၧၩလီၫ.- ယအၪ့ကံၩ့န့အဝ့ၫၥံၪအ ဂးတၭ,ယလအၪ့ကံၩ့န့ဘၪ ၦဂၪ့ခိၪဖိၪၥံၪအဂးနီၪး အ့ၪမွဲလၧၦလၧနဖ့ၪလၫ့ယၧၩလဖၪနီၪအဂးလီၫ. အဂဲး",
			"10": "<sup>10</sup> ဘဲၫယီၩအဝ့ၫၥံၪမွဲနဆၧလီၫ.- ကယဲယဆၧထီးအလူၬ နီၪမွဲနဆၧ,နဆၧလဖၪနီၪမွဲယဆၧတၭ, ယလၩယ",
			"11": "<sup>11</sup> ဖၩ့အီၪဖျီၪဝ့ၫလၧအဖၧၩ့လီၫ.- ယဝ့ၫဒၪယီၩယအီၪ လၧၩ့လၧဂၪ့ခိၪချိၫ့ယီၩအ့ၬ. အ့ၪမွဲအဝ့ၫၥံၪယီၩ,မိအီၪ ဒံၭလၧဂၪ့ခိၪချိၫ့, အ့ၪမွဲယဝ့ၫဒၪယီၩ ယမိထဲၩ့ထၪ့လၧ နအီၪလီၫ. ဖါဆံၫ့ဎံၪဧ့,ၦလၧနဖ့ၪလၫ့ယၧၩလဖၪ နီၪ,ဘဲၫၥိၭအမိကဲၪဆၧလမံၩ့ဎး, ဘဲၫနၧၩဒဲယၧၩအ ၥိၭတၭ,ယိထဲၩ့ခွါထဲၩ့အဝ့ၫၥံၪလၧနမံၩ့အဖၧၩ့",
			"12": "<sup>12</sup> ဆံၭ.- လၧယအီၪလၧဂၪ့ခိၪချိၫ့ လၧအၥိၭအဘိၩ့ဘၭ နီၪ,ယယိထဲၩ့ခွါထဲၩ့အဝ့ၫၥံၪ လၧနမံၩ့အဖၧၩ့လီၫ. ၦလၧနဖ့ၪလၫ့ယၧၩလဖၪနီၪ ယအီၪခိၭထၬယူၭအဝ့ၫ ၥံၪယူၭတၭ, အ့ၪလမွဲဘၪၦဂၭဂီၩ့ဖိၪလဂၩ ဘဲၫၥိၭလံၬ အီၪကွ့ၭအၥၭမိလၧၫ့ထၪ့ဎွ့ၩထၪ့ဝ့ၫနီၪ, လၩ့မါဘၪ ဝ့ၫနးဂၩအ့ၬ.",
			"13": "<sup>13</sup> ဘိၩ့နဲၪ့ယီၩ ယထဲၩ့ထၪ့လၧနအီၪတၭ, ဘဲၫၥိၭအ ဝ့ၫၥံၪမိအီၪလၧ ယဆၧၥၭထိၬလၧၫ့ထၪ့ဎွ့ၩထၪ့ဝ့ၫလၧ အဖၧၩ့နီၪ, ယလီၩဘၪဆၧလဖၪယီၩ လၧဂၪ့ခိၪချိၫ့",
			"14": "<sup>14</sup> ယီၩလီၫ.- ယဖ့ၪလၫ့ယူၭအဝ့ၫၥံၪလၧနလူနထၫယူၭး ၦဂၪ့ခိၪဖိၪမ့ၬလဲၩအဝ့ၫၥံၪနီၪ, အဂဲးဘဲၫယီၩအဝ့ၫ ၥံၪလဘၪဆဲၫ့ဘၪလၧဂၪ့ခိၪ ဘဲၫယဝ့ၫဒၪယီၩ ယလ",
			"15": "<sup>15</sup> ဘၪဆဲၫ့ဘၪလၧဂၪ့ခိၪအၥိၭနီၪဆ့လီၫ.- ဘဲၫၥိၭနမိအၪ့ မၩန့ခွံၬအဝ့ၫၥံၪ လၧဂၪ့ခိၪယီၩတၭ, မွဲယလအၪ့ကံၩ့ ဘၪးမွဲလၧနမိယိထဲၩ့ခွါထဲၩ့ဝ့ၫဘဲၫၥိၭဆၧအၧၩ့ဆၧ",
			"16": "<sup>16</sup> ၥၫ့ထီးဘၪအဝ့ၫၥံၪလဂ့ၩလီၫ.- အဝ့ၫၥံၪလဘၪဆဲၫ့ ဘၪလၧဂၪ့ခိၪ, ဘဲၫယဝ့ၫဒၪယီၩ လဘၪဆဲၫ့ဘၪလၧ",
			"17": "<sup>17</sup> ဂၪ့ခိၪအၥိၭနီၪဆ့လီၫ.- မၩဆံၫ့ဎံၪအဝ့ၫၥံၪလၧနဆၧ မွဲဆၧတီၩအဖၧၩ့ဆံၭ. နလူနထၫနီၪမွဲဆၧမွဲဆၧ",
			"18": "<sup>18</sup> တီၩလီၫ.- ဘဲၫနအၪ့မၧၫ့လၩ့န့ယၧၩ လၧဂၪ့ခိၪအၥိၭ",
			"19": "<sup>19</sup> နီၪ,ယအၪ့မၧၫ့လၩ့အဝ့ၫၥံၪလၧ ဂၪ့ခိၪဆ့လီၫ.- ဘဲၫၥိၭ အဝ့ၫၥံၪမိဆံၫ့ဎံၪထၪ့လၧ ဆၧမွဲဆၧတီၩအဖၧၩ့တၭ, ယမၩဆံၫ့ဎံၪထၪ့ယၥၭလၧအဂးလီၫ.",
			"20": "<sup>20</sup> ယအၪ့ကံၩ့န့ကယဲအဝ့ၫၥံၪအဂးလကၭလၧၩ့,ၦ ၡၩၥံၪလၧအနဲၩထဲၩ့ယၧၩ လၧအဝ့ၫၥံၪအလူအကၠီၩ့နီၪ,",
			"21": "<sup>21</sup> မွဲယအၪ့ကံၩ့န့အဝ့ၫၥံၪအဂးဆ့လီၫ.- မွဲဘဲၫၥိၭအဝ့ၫ ၥံၪထီးအလူၬမိကဲၪထၪ့ ဆၧလမံၩ့ဎး,ဖါဧ့,ဘဲၫနအီၪ လၧယဖၧၩ့,ဒဲယအီၪလၧနဖၧၩ့အၥိၭနီၪ, ဘဲၫၥိၭအဝ့ၫ ၥံၪမိကဲၪထၪ့ဆၧလမံၩ့ဎးလၧပဖၧၩ့, ဘဲၫၦဂၪ့ခိၪဖိၪ",
			"22": "<sup>22</sup> ၥံၪမိနဲၩလၧနအၪ့မၧၫ့လၩ့န့ယၧၩအၥိၭနီၪလီၫ.- ဆၧ လၩဆၧဖၩ့လၧနဖ့ၪလၫ့ယၧၩနီၪးယဖ့ၪလၫ့အဝ့ၫ ၥံၪ,ဘဲၫၥိၭအမိကဲၪထၪ့ဆၧလမံၩ့ဎး, ဘဲၫပအီၪပဝ့ၫ",
			"23": "<sup>23</sup> ဒၪလမံၩ့ဎးအၥိၭ,- ယအီၪလၧအဝ့ၫၥံၪအဖၧၩ့ဒဲနအီၪ လၧယဖၧၩ့, ဘဲၫၥိၭအဝ့ၫၥံၪ မိအီၪလၧၫ့ဎွ့ၩ လၧဆၧ လမံၩ့ဎး ဘဲၫၦဂၪ့ခိၪဖိၪမိၥ့ၪယၫ လၧနအၪ့မၧၫ့လၩ့ ယၧၩအၥိၭနီၪ, ဒဲနအဲၪအဝ့ၫၥံၪဘဲၫနအဲၪယၧၩအၥိၭ နီၪလီၫ.",
			"24": "<sup>24</sup> ဖါဧ့, ၦလၧနဖ့ၪလၫ့ယၧၩလဖၪ ဘဲၫၥိၭအမိဒၪဘၪ ယလၩယဖၩ့လၧနဖ့ၪလၫ့ယၧၩနီၪ, ယဆိၫ့မုလါလၧ အဝ့ၫၥံၪမိအီၪဘၪဝ့ၫထီးယအီၪအလးနီၪလီၫ. အ ဂဲးဘဲၫယီၩ, လၧဂၪ့ခိၪအခၪ့ထံၭ လချႃၭကဲၪထၪ့ဒံၭ ဘၪနီၪ,နဝ့ၫဒၪယီၩနအဲၪယူၭယၧၩယူၭလီၫ.",
			"25": "<sup>25</sup> ဆၧတီၩဖါဧ့, ၦဂၪ့ခိၪဖိၪၥ့ၪယၫနၧၩအ့ၬ. အ့ၪမွဲယ ဝ့ၫဒၪယီၩ ယၥ့ၪယၫနၧၩတၭ, ၦလဖၪယီၩၥ့ၪယၫလၧ",
			"26": "<sup>26</sup> နအၪ့မၧၫ့လၩ့န့ယၧၩလီၫ.- ဘဲၫၥိၭဆၧအဲၪလၧနအဲၪ ယၧၩယီၩ မိအီၪလၧအဝ့ၫၥံၪအဖၧၩ့, ဒဲယမိအီၪလၧ အဖၧၩ့ဆ့တၭ, ယဒုၭၥ့ၪယၫယူၭအဝ့ၫၥံၪ လၧနမံၩ့ တၭ,ယမိဒုၭၥ့ၪယၫဒံၭဆ့လီၫ."
		},
		"18": {
			"1": "<sup>1</sup> ယ့ၫၡုၬချဲၩ့ဆၧလဖၪနီၪဂီၩ့တၭ, စဲၪ့ထၪ့လ့ၩဝ့ၫလၧ အထံၩအဖျဲၥံၪအၥိၭလၧကံဒၧၫ့ဝါလခီၫ, ထီးကျိၭ အီၪဝ့ၫအလးလစီၪ့နီၪ, လ့ၩနုၬဝ့ၫလၧအထံၩအဖျဲၥံၪ",
			"2": "<sup>2</sup> အၥိၭလီၫ.- ၦလၧအဖ့ၪလၫ့ခွံၬအဝ့ၫဒၪ, စယုဒၭနီၪ ၥ့ၪယၫအလးလီၫ. အဂဲးဘဲၫယီၩဆၧအလးနီၪ ယ့ၫ ၡုၬလ့ၩယုၩယါဝ့ၫ လၧအထံၩအဖျဲၥံၪအၥိၭလီၫ.",
			"3": "<sup>3</sup> မၩအၥၭဘဲၫနီၪတၭ, စယုဒၭလဂၩန့ဘၪယူၭၥုၭ ဖိၪလဒီၪ့ဒဲအခိၪလဖၪ လၧၦလုဆၧအဒိၪၥံၪဒဲလၧၦဖၫ ရစံၫၥံၪအစူၪဖၧၩ့တၭ, လ့ၩထီၩ့ထီးနီၪလၧမ့ၪဒိၩ့ၥံၪ,",
			"4": "<sup>4</sup> ဒဲၡီၫၥံၪ,ဒဲဆၧအစူၪဝဲၩလဖၪနီၪလီၫ.- မၩအၥၭဘဲၫ နီၪတၭ,ယ့ၫၡုၬၥ့ၪယၫလၧဆၧမိမၩအၥၭ လၧအဂး ထီးအလူၬနီၪ,လ့ၩထၪ့ဝ့ၫလၧအအီၪတၭ, စံၭအဝ့ၫ",
			"5": "<sup>5</sup> ၥံၪ,မွဲနၥံၪအၪ့ဎၬပလၫလဂၩလဲၪ.- အဝ့ၫၥံၪချဲၩ့ဆၧၫ့ ဝ့ၫဒၪ,ၦနၭဇရ့ၭဖိၪယ့ၫၡုၬနီၪလီၫ. ယ့ၫၡုၬလီၩဘၪ အဝ့ၫၥံၪ,မွဲယၧၩလီၫ. တၭၦလၧအဖ့ၪလၫ့ခွံၬ အဝ့ၫ, စယုဒၭလဂၩအီၪဝ့ၫ လၧအဝ့ၫၥံၪအၥိၭဆ့လီၫ.",
			"6": "<sup>6</sup> မၩအၥၭဘဲၫနီၪတၭ, ထီးအစံၭအဝ့ၫၥံၪ, မွဲယၧၩ တၭ,အဝ့ၫၥံၪဂုၩ့ထဲၩ့အၥၭလၧအလးခဲၫ့နီၪ, လၩ့",
			"7": "<sup>7</sup> ထံၩဖါဝ့ၫလၧဂၪ့ခိၪလီၩ့လီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ယ့ၫၡုၬအၪ့စၪ့ဒီၭအဝ့ၫၥံၪ, မွဲနၥံၪအၪ့ဎၬပလၫလဂၩ လဲၪ.အဝ့ၫၥံၪစံၭဝ့ၫ, ၦနၭဇရ့ၭဖိၪ ယ့ၫၡုၬ နီၪလီၫ.",
			"8": "<sup>8</sup> ယ့ၫၡုၬချဲၩ့ဆၧၫ့ဝ့ၫ, ယလီၩဘၪယူၭနၥံၪယူၭ, မွဲယၧၩ လီၫ.မၩအၥၭဘဲၫနီၪတၭ, နၥံၪအ့ၪအၪ့ဎၬယၧၩယီၩ ဒုၭထဲၩ့ထဲၩ့ၦလဖၪယီၩဆံၭ.",
			"9": "<sup>9</sup> ဘဲၫၥိၭဆၧအလူလၧယစံၭဝ့ၫ, :ၦလၧနဖ့ၪလၫ့ယူၭ ယၧၩလဖၪနီၪ, ယမၩလၩ့မါနးဂၩအ့ၬ: နီၪမိလၧၫ့ထၪ့ ဎွ့ၩထၪ့ဝ့ၫဒၪလီၫ.",
			"10": "<sup>10</sup> မၩအၥၭဘဲၫနီၪတၭ, စစဲမၧၫ့ပံတၧၫလဂၩအီၪလၧ အနၭလဘံၪ့နီၪ, ထုၭထၪ့ဝ့ၫတၭ, ဖ့ၬၦလုဆၧအခိၪ အဎီးအၡၩလဂၩတၭ, အနါထွ့ၪထူၬခွံၬဝ့ၫလီၫ. ဆၧ",
			"11": "<sup>11</sup> အဎီးအၡၩလဂၩနီၪအမံၩ့မွဲစမၫလခၧၭလီၫ.- မၩအ ၥၭဘဲၫနီၪတၭ, ယ့ၫၡုၬစံၭစပံတၧၫဖျၪ့နုၬထဲၩ့နၭလၧ အကၠိၭဖၧၩ့ဆံၭ. လိၫ့လၧယဖါဖ့ၪလၫ့ယၧၩနီၪ, မွဲယ အီၩဘၪအ့ၬဧၪ.",
			"12": "<sup>12</sup> မၩအၥၭဘဲၫနီၪတၭ,ၦၥုၭဖိၪလဒီၪ့ဒဲၦၥုၭဖိၪလထီၫ့ အခိၪ, ဒဲၦယုဒၫဖိၪၥံၪ အဎီးအၡၩလဖၪ ဖီၪ့န့ယ့ၫၡုၬ",
			"13": "<sup>13</sup> နီၪစၧၩ့ထၬဝ့ၫဂီၩ့,- လ့ၩၥိၫ့ဆိၫဝ့ၫထီၩ့လၧစအၪ့နၭ အအီၪလီၫ. အဂဲးဘဲၫယီၩ အဝ့ၫနီၪမွဲစက့အဖၭလၧ အကဲၪထၪ့ၦလုဆၧအခိၪ လနံၪ့ဎးနီၪလဂၩ အမံၩ့ၡါ",
			"14": "<sup>14</sup> ခွၫလီၫ.- စက့အဖၭမွဲၦလဂၩလၧအၥီၪ့လိၪၦယုဒၫဖိၪ ၥံၪလၧၦလဂၩကြၨၭၥံၫလၧၦလဆၨၩနီၪအဂးလီၫ.",
			"15": "<sup>15</sup> စစဲမၧၫ့ပံတၧၫဒဲအဖျဲဂူၫဂၩလဂၩဖိၬထၪ့ယ့ၫၡုၬ အခဲၫ့လီၫ.အဖျဲလၧအဂူၫဂၩလဂၩနီၪ ၥ့ၪယၫလိၬအ ၥၭလၧၦလုဆၧအခိၪနီၪ, လ့ၩနုၬဝ့ၫလၧယ့ၫၡုၬအၥိၭ",
			"16": "<sup>16</sup> လၧၦလုဆၧအခိၪအဂံၪ့အဝၩ့ဖၧၩ့လီၫ.- အ့ၪမွဲစပံတၧၫ လဂၩနီၪဆၧၫ့ထုၪ့အီၪဝ့ၫလၧ တရၫ့အနဲၩ့ထံၭ လၧခီၫ့ လခီၫနီၪလီၫ. မၩအၥၭဘဲၫနီၪတၭ, အထံၩအဖျဲလၧ ၦလုဆၧအခိၪၥ့ၪယၫဝ့ၫလဂၩနီၪ,စဲၪ့ထၪ့တၭ,ချဲၩ့ဆၧ လၧၦမုၪလၧအခိၭတရၫ့လဂၩနီၪတၭ, ဒုၭလ့ၩနုၬစပံ",
			"17": "<sup>17</sup> တၧၫလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ၦမုၪလၧအခိၭတရၫ့ လဂၩနီၪစံၭစပံတၧၫ, နမွဲၦလဂၩနီၪအထံၩအဖျဲ,မွဲ အ့ၬဧၪ.တၭအဝ့ၫဒၪစံၭဆၧၫ့ဆၧ, ယမွဲအ့ၬ.",
			"18": "<sup>18</sup> မွဲဆၧဂီးတၭ, ၦဎီးဖိၪၥံၪ ဒဲဆၧအခ့ၫအၡၩလဖၪ ဆၧၫ့ထုၪ့ထီးနီၪတၭ, မၩခဲၩထၪ့ယူၭမ့ၪ လၧၥွၪထီး တၭ,ဆူၭဆူၭမ့ၪနီၪ စပံတၧၫဆၧၫ့ထုၪ့ ဆူၭဆူၭမ့ၪလၧ အဝ့ၫၥံၪအၥိၭဆ့လီၫ.",
			"19": "<sup>19</sup> မၩအၥၭဘဲၫနီၪတၭ, ၦလုဆၧအခိၪအၪ့စၪ့ယ့ၫၡုၬ လၧအထံၩအဖျဲၥံၪအဂဲး, ဒဲအဆၧၥီၪ့ဆၧၥၫ့အဂဲး",
			"20": "<sup>20</sup> လီၫ.- ယ့ၫၡုၬချဲၩ့ဆၧၫ့အဝ့ၫနီၪ, ယလီၩဘၪဆၧအီၪ ဖျီၪလၧဂၪ့ခိၪချိၫ့ယီၩတၭ, ယၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ဆၧလၧ ၥရိၬဖၧၩ့,ဒဲလၧဆၧလုအဂံၪ့ဖၧၩ့လထံၪဎးထီးၦယုဒၫ ဖိၪၥံၪထီးအလူၬအီၪကီၪ့အလးနီၪတၭ, လၧဆၧအီၪ",
			"21": "<sup>21</sup> ၥူၪအလးနီၪ ယလီၩဘၪဆၧနးမံၩ့အ့ၬ.- နအၪ့စၪ့ ယၧၩမွဲဘၪလဲၪး အၪ့စၪ့ဒၪခလူၬၦလၧအနါဂၧၫ့ယလီၩ လၩ့လၬလၩ့ဆၧ လၧအဝ့ၫၥံၪအမ့ၬယၫနီၪဆံၭ. ယိ ခွါ,ဆၧလၧယလီၩလၩ့လၬလၩ့လဖၪနီၪ, အဝ့ၫၥံၪၥ့ၪ ယၫဝ့ၫဒၪလီၫ.",
			"22": "<sup>22</sup> အဝ့ၫဒၪချဲၩ့ဆၧနီၪလဖၪဂီၩ့တၭ, ဆၧအခ့ၫအၡၩ ဆၧၫ့ထုၪ့ဝ့ၫထီးနီၪလဂၩဒဲၩယ့ၫၡုၬအမ့ၬတၭ, စံၭ",
			"23": "<sup>23</sup> ဝ့ၫဒၪမွဲနချဲၩ့ဆၧၫ့ၦလုဆၧအခိၪဘဲၫနီၪၥိၭဆ့ဧၪ.- ယ့ၫ ၡုၬချဲၩ့ဆၧၫ့အဝ့ၫ, ယအ့ၪစံၭဆၧအၧၩ့တၭ, ထိးနၥၭ လၧဆၧအၧၩ့အဂဲးနီၪဆံၭ. အ့ၪမွဲဆၧဂ့ၩတၭ, မွဲဘၪနီၫ လၧနဒဲၩယၧၩလဲၪ.",
			"24": "<sup>24</sup> လၧအအီၪစၧၩ့ထၬအၥၭနီၪ,စအၪ့နၭအၪ့မၧၫ့ၦလ့ၩ ၥိၫ့ဝ့ၫထီၩ့လၧၦလုဆၧအခိၪ, စက့အဖၭအအီၪနီၪလီၫ.",
			"25": "<sup>25</sup> စစဲမၧၫ့ပံတၧၫဆၧၫ့ထုၪ့ဆူၭဆူၭမ့ၪလီၫ. မၩအၥၭ ဘဲၪနီၪတၭ ၦစံၭအဝ့ၫ, နဝ့ၫဒၪယီၩနမွဲအဝ့ၫဒၪအ ထံၩအဖျဲလဂၩ,မွဲအ့ၬဧၪ. အဝ့ၫဒၪမီၪ့ဘံၭဝ့ၫတၭ,စံၭဝ့ၫ,",
			"26": "<sup>26</sup> ယမွဲအ့ၬ.- ၦလၧစပံတၧၫဖ့ၬထူၬခွံၬ အနါလဂၩအ ဘူၭအထံး ၦလုဆၧအခိၪအခ့ၫအၡၩလဂၩနီၪစံၭဝ့ၫ, ယဒၪဘၪနအီၪလၧကျိၭဖၧၩ့လၧအဝ့ၫနီၪအၥိၭ, မွဲအ့ၬ",
			"27": "<sup>27</sup> ဧၪ.- မၩအၥၭဘဲၫနီၪတၭ, စပံတၧၫမီၪ့ဘံၭဒီၭဝ့ၫတၭ, ဆၫ့ဖၫအီၩ့အိၪထၪ့ဝ့ၫချဲၫ့မၬလီၫ.",
			"28": "<sup>28</sup> မၩအၥၭဘဲၫနီၪတၭ, အဝ့ၫၥံၪလ့ၩၥိၫ့ထၪ့ခွံၬ ယ့ၫ ၡုၬလၧစက့အဖၭအအီၪထီၩ့လၧ ဆၧစ့ၩရၫ့ခွးအလး တၭ,ဘၪလၧမုဆဲၪ့ထၪ့အခၫနီၪလီၫ. ဘဲၫၥိၭအထီး ဘၪစံၪစၪလဂ့ၩ, ဘဲၫအမိအၪ့ဘိၪ့လ့ၩဖၬအၥိၭနီၪ,",
			"29": "<sup>29</sup> အဝ့ၫၥံၪလ့ၩနုၬဝ့ၫလၧ ဆၧစ့ၩရၫ့ခွးအလးအ့ၬ.- မၩ အၥၭဘဲၫနီၪတၭ, စပဲလၭဂဲၫထၪ့လၧခီၫ့လၧအဝ့ၫၥံၪ အအီၪတၭ,စံၭဝ့ၫ, ၦလဂၩယီၩမွဲနၥံၪအီၪက့ၪဆၧမၪ",
			"30": "<sup>30</sup> လၧအလီၩ့လၧဆၧနီၪလမံၩ့လဲၪ.- အဝ့ၫၥံၪချဲၩ့ဆၧၫ့ ဆၧတၭစံၭဝ့ၫ, ၦယီၩအ့ၪလမွဲဘၪ ၦမၩဆၧအၧၩ့လဂၩ",
			"31": "<sup>31</sup> တၭ,ပဖ့ၪလၫ့ခွံၬလၧနစူၪဖၧၩ့အ့ၬ.- မၩအၥၭဘဲၫနီၪ တၭ,စပဲလၭစံၭအဝ့ၫၥံၪ, မၩန့အဝ့ၫနီၪစ့ၩရၫ့ဒၪနၥံၪ ဝ့ၫဘဲၫနၥံၪအထူၫအရူၫအီၪဝ့ၫအၥိၭနီၪဆံၭ. မၩအၥၭ ဘဲၫနီၪတၭ,ၦယုဒၫဖိၪၥံၪစံၭဝ့ၫ, ဆၧဖ့ၪလၫ့ၦမၩၥံၫၦ",
			"32": "<sup>32</sup> ၡၩနးဂၩအ့ၬ.- ဆၧမၩအၥၭဘဲၫနီၪ,ဘဲၫၥိၭယ့ၫၡုၬ အလူလၧအလီၩဘၪဝဲၩဝ့ၫနီၪ, ဒုၭနဲၪဆၧလၧအဘၪ ၥံၫဝ့ၫအဂဲးအကၠီၩ့ မိလၧၫ့ထၪ့ဎွ့ၩထၪ့ဝ့ၫဒၪလီၫ.",
			"33": "<sup>33</sup> မၩအၥၭဘဲၫနီၪတၭ, စပဲလၭထဲၩ့နုၬဒီၭလၧအဆၧ စ့ၩရၫ့ခွးအလးနီၪကိၭထဲၩ့ယ့ၫရှူၬတၭ, စံၭအဝ့ၫ, နဝ့ၫ",
			"34": "<sup>34</sup> ဒၪယီၩနမွဲၦယုဒၫဖိၪၥံၪ အစဎွၩနီၪဆ့ဧၪ.- ယ့ၫရှူၬချဲၩ့ ဆၧၫ့အဝ့ၫနီၪ, ထီးနၥၭဒၪနဝ့ၫတၭ,မွဲနစံၭဆၧယီၩဧၪ. အ့ၪလမွဲဘၪဘဲၫနီၪတၭ, မွဲဂူၫဂၩလီၩဘၪနၧၩလၧယဂဲး",
			"35": "<sup>35</sup> ဧၪ.- စပဲလၭချဲၩ့ဆၧၫ့ဝ့ၫ,ယဝ့ၫဒၪယီၩယမွဲၦယုဒၫဖိၪ ဆ့ဧၪ.နဆၨၩဒၪနဝ့ၫ, ဒဲၦလုဆၧအဒိၪလဖၪဖ့ၪလၫ့ ခွံၬယူၭနၧၩလၧယစူၪဖၧၩ့ယူၭ. မွဲနမၩဘၪယူၭဆၧနီၪ",
			"36": "<sup>36</sup> လမံၩ့လဲၪ.- ယ့ၫၡုၬချဲၩ့ဆၧၫ့ဝ့ၫ,ယဝ့ၫဒၪယီၩယ ဘၩ့ယမုးဘၪဆဲၫ့လၧဂၪ့ခိၪယီၩအ့ၬ. ယဘၩ့ယမုး အ့ၪဘၪဆဲၫ့လၧဂၪ့ခိၪယီၩတၭ, ဘဲၫၥိၭယထီးထီၩ့လၩ့ လၧၦယုဒၫဖိၪၥံၪအစူၪဖၧၩ့လဂ့ၩနီၪ, ယခ့ၫယၡၩ လဖၪမိဒုၭၥုၭလီၫ.အ့ၪမွဲယဘၩ့ယမုး အီၪထီးယီၩ",
			"37": "<sup>37</sup> အ့ၬ.- မၩအၥၭဘဲၫနီၪတၭ, စပဲလၭစံၭအဝ့ၫ,အ့ၪမွဲ ဘဲၫနီၪတၭ, နမွဲစဎွၩလဂၩဆ့ဧၪ.ယ့ၫၡုၬချဲၩ့ဆၧၫ့ဝ့ၫ, နစံၭဆၧနီၪဘၪယူၭ,ယမွဲစဎွၩလီၫ. ဘဲၫၥိၭယမိထိး ယၥၭလၧဆၧမွဲဆၧတီၩအဂဲးနီၪ, ယအီၪဖျဲၪယူၭ ယဝ့ၫတၭ,ယဂဲၫလၩ့ဘူၭယူၭလၧဂၪ့ခိၪချိၫ့ယီၩယူၭ.က ယဲၦလၧအဘၪဆဲၫ့လၧဆၧမွဲဆၧတီၩနီၪမွဲအခိၭနၪ ယလူလီၫ.",
			"38": "<sup>38</sup> စပဲလၭစံၭအဝ့ၫ, ဆၧမွဲဆၧတီၩနီၪ မွဲဆၧနီၪလဲၪ. စံၭဆၧနီၪဂီၩ့တၭ, လ့ၩထၪ့ဒီၭဝ့ၫလၧၦယုဒၫဖိၪၥံၪ အ အီၪတၭ, လီၩဘၪအဝ့ၫၥံၪ, အဝ့ၫလဂၩယီၩယဒၪဘၪ",
			"39": "<sup>39</sup> ဆၧအမၪလၧအလီၩ့နးမံၩ့အ့ၬ.- မွဲလါနၫ့ဘိၩနၥံၪအ ထူၫအရူၫအီၪဝ့ၫလၧ ယဘၪကွဲၪဖျါခွံၬန့လၧနၥံၪအဂး ၦလဂၩလၧဘိၪ့လ့ၩဖၬနီၪလီၫ. မၩအၥၭဘဲၫနီၪတၭ, မွဲအဘၪနၥံၪအၥၭလၧ ယမိကွဲၪဖျါခွံၬန့လၧနၥံၪအဂး ၦယုဒၫဖိၪၥံၪအစဎွၩနီၪဆ့ဧၪ.",
			"40": "<sup>40</sup> မၩအၥၭဘဲၫနီၪတၭ, အဝ့ၫၥံၪထီးအလူၬ ကိၭၡၭ ထၪ့ဒီၭတၭ,စံၭဝ့ၫ, အဝ့ၫနီၪမွဲအ့ၬ.မွဲစဘရၭဘၭနီၪ လီၫ.တၭစဘရၭဘၭနီၪ မွဲထမျၬလဂၩလီၫ."
		},
		"19": {
			"1": "<sup>1</sup> ထီးနီၪလဖၧၫ့စပဲလၭမၩန့ယ့ၫၡုၬတၭ, ဒိၪဝ့ၫထး",
			"2": "<sup>2</sup> ဝ့ၫဒၪလီၫ.- ၦၥုၭဖိၪလဖၪထဲၫ့ၥရဖူၩ လၧဆၧဆူၪနီၪ တၭ,ဒုၭချႃၬထၪ့ဝ့ၫလၧအခိၪဎွံၪအလီၩ့တၭ, ဒုၭၥိၭထၪ့ ဝ့ၫလၧအဝိၬလိၫ့ လုၭဖုၭနီၪ, အဝ့ၫၥံၪဂဲၫလၧအအီၪ",
			"3": "<sup>3</sup> တၭ,- စံၭဝ့ၫဒၪ, ၦယုဒၫဖိၪၥံၪအစဎွၩဧ့,မွဲနဘၪဆၧ အမုၬဆံၭၬ တၭဒဲၩဝ့ၫဒၪအမ့ၬလီၫ.",
			"4": "<sup>4</sup> စပဲလၭလ့ၩထၪ့ဒီၭလၧခီၫ့နီၪ, စံၭၦလဖၪနီၪ,ယိခွါ, ဘဲၫနၥံၪမိၥ့ၪယၫလၧ ယလဒၪဘၪအဆၧမၪလၧအဝ့ၫ ဒၪအလီၩ့နးမံၩ့နီၪ, ယဂဲၫၥိၫ့ထၪ့ဝ့ၫ လၧနၥံၪအအီၪ",
			"5": "<sup>5</sup> လၧခီၫ့လီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ယ့ၫၡုၬချႃၬၥရဖူၩ ဆၧဆူၪနီၪ,ၥိၭဝိၬလိၫ့လုၭဖုၭတၭ, လ့ၩထၪ့ဝ့ၫလၧခီၫ့ လီၫ.စပဲလၭစံၭအဝ့ၫၥံၪ, ယိခွါ, ၦလဂၩနီၪဘီၪၬ",
			"6": "<sup>6</sup> မၩအၥၭဘဲၫနီၪတၭ, ထီးၦလုဆၧအဒိၪၥံၪဒဲဆၧအ ခ့ၫအၡၩလဖၪဒၪဘၪအဝ့ၫနီၪ, အဝ့ၫၥံၪကိၭၡၭထၪ့ဝ့ၫ တၭ,စံၭဝ့ၫ, ဖျၩထၪ့ခွံၬအဝ့ၫလၧထုၪ့စူၪယၫအလီၩ့ ဘီၪ.ဖျၩထၪ့ခွံၬအဝ့ၫ လၧထုၪ့စူၪယၫ အလီၩ့ဘီၪ. စပဲလၭစံၭအဝ့ၫၥံၪ, မၩန့အဝ့ၫဒၪတၭ, ဖျၩထၪ့ခွံၬဒၪ နၥံၪဝ့ၫလၧထုၪ့စူၪယၫ အလီၩ့ဘီၪ. အဂဲးဘဲၫယီၩ ယဝ့ၫဒၪယီၩယဒၪဘၪ အဆၧမၪလၧအလီၩ့နးမံၩ့အ့ၬ.",
			"7": "<sup>7</sup> ၦယုဒၫဖိၪၥံၪချဲၩ့ဆၧၫ့ဝ့ၫဒၪ, ပဝ့ၫဒၪယီၩ ပထူၫပရူၫ အီၪဝ့ၫတၭ,ဘဲၫပထူၫပရူၫအီၪဝ့ၫအၥိၭနီၪဂ့ၩဘၪၥံၫ ဝ့ၫဒၪလီၫ. အဂဲးဘဲၫယီၩမွဲအစံၭလၩ့အၥၭ လၧအမွဲ ယွၩအဖိၪခွၫလီၫ.",
			"8": "<sup>8</sup> မၩအၥၭဘဲၫနီၪတၭ, ထီးစပဲလၭနါဂၧၫ့ဆၧချဲၩ့နီၪ",
			"9": "<sup>9</sup> ၥၭမဲၪၥၭဖျဲၩ့ဝ့ၫဒိၪနဲၪ့အလးဒံၭလီၫ.- ထဲၩ့နုၬထဲၩ့ဒီၭ လၧဆၧစ့ၩရၫ့ခွး အလးတၭ, စံၭယ့ၫၡုၬနီၪ မွဲနအီၪ ထၪ့အထံၭခီၫခီၫလဲၪ. ယ့ၫၡုၬချဲၩ့ဆၧၫ့အဝ့ၫနးထံၪ",
			"10": "<sup>10</sup> အ့ၬ.- မၩအၥၭဘဲၫနီၪတၭ, စပဲလၭစံၭဝ့ၫဒၪ, မွဲနစံၭ ဆၧၫ့ယၧၩအ့ၬဧၪ. ယစီၩ့ယမၩ့အီၪဝ့ၫ လၧယမိဖျၩ ထၪ့နၧၩလၧထုၪ့စူၪယၫအလီၩ့နီၪမွဲဂ့ၩ, ဒဲယစီၩ့ယမၩ့ အီၪဝ့ၫလၧယမိကွဲၪဖျါခွံၬနၧၩနီၪမွဲဂ့ၩ, နၥ့ၪယၫအ့ၬ",
			"11": "<sup>11</sup> ဧၪ.- ယ့ၫၡုၬစံၭဆၧၫ့ဝ့ၫဒၪ, ဆၧလၧထၭနီၪအ့ၪလဖ့ၪ လၫ့ဘၪနထၫ့ဒုၪဒၩယၧၩတၭ, နစီၩ့နမၩ့အီၪဝ့ၫနးမံၩ့ အ့ၬ.မွဲဘဲၫနီၪတၭ, ၦလၧအဖ့ၪလၫ့ယၧၩလၧနစူၪဖၧၩ့ နီၪအဆၧဒဲၩဘၭ ဒိၪဒၪအဆၧဒံၭလီၫ.",
			"12": "<sup>12</sup> ထီးနီၪလဖၧၫ့, စပဲလၭအၪ့ဎၬကွဲၪဖျါခွံၬ အဝ့ၫနီၪ လီၫ.အ့ၪမွဲၦယုဒၫဖိၪၥံၪကိၭၡၭထၪ့အလူတၭ, စံၭဝ့ၫ ဒၪ,အဝ့ၫလဂၩယီၩနအ့ၪဖျါခွံၬတၭ, နမွဲစံစၧၫအထံၩ အၥိၭအ့ၬ. ကယဲၦလၧအစံၭလၩ့အၥၭလၧအမွဲစဎွၩ လဂၩဂၩနီၪချဲၩ့မၪစံစၧၫနီၪလီၫ.",
			"13": "<sup>13</sup> စပဲလၭနါဂၧၫ့ဆၧချဲၩ့နီၪတၭ,ၥိၫ့ထၪ့ယ့ၫၡုၬလၧ ခီၫ့နီၪ,ဆၧၫ့နၩ့ဝ့ၫလၧဆၧစ့ၩရၫ့ခွး အလးဆီၩ့ဆီအီၪ ဝ့ၫလၧအလးကိၭဝ့ၫအမံၩ့ လၧလိးယဲး,အ့ၪမွဲလၧၦဟံ",
			"14": "<sup>14</sup> ဘြႃၫအဆၧချဲၩ့နီၪကိၭဝ့ၫအမံၩ့ ဂၭဘၥၫလီၫ.- မွဲဘိၪ့ လ့ၩဖၬတဲၩ့ဝဲၩဆၧအနံၩတၭ, ဘူၭထၪ့ဎူၫနၩရံၩ",
			"15": "<sup>15</sup> အဝ့ၫစံၭၦယုဒၫဖိၪၥံၪ ယိခွါ,နၥံၪအစဎွၩဘီၪ.- အဝ့ၫ ၥံၪကိၭၡၭထၪ့ဝ့ၫ, ဆိၬထၪ့ခွံၬအဝ့ၫဘီၪ, ဆိၬထၪ့ခွံၬ အဝ့ၫဘီၪ,ဖျၩထၪ့အဝ့ၫလၧထုၪ့စူၪယၫအလီၩ့ဘီၪ. စပဲလၭစံၭအဝ့ၫၥံၪ, မွဲယဘၪဖျၩထၪ့နၥံၪအစဎွၩလၧ ထုၪ့စူၪယၫအလီၩ့နီၪဆ့ဧၪ. ၦလုဆၧအဒိၪလဖၪစံၭ ဆၧၫ့ဝ့ၫ, အ့ၪလမွဲဘၪစံစၧၫလဂၩနီၪပစဎွၩအီၪ",
			"16": "<sup>16</sup> အ့ၬ.- မၩအၥၭဘဲၫနီၪတၭ, ဘဲၫၥိၭအဝ့ၫနီၪ မိဘၪဆၧ ဖျၩထၪ့လၧထုၪ့စူၪယၫအလီၩ့နီၪ, အဝ့ၫဒၪဖ့ၪလၫ့ ခွံၬဝ့ၫလၧအဝ့ၫၥံၪအစူၪဖၧၩ့လီၫ. အဝ့ၫၥံၪမၩန့ယ့ၫ ၡုၬတၭလ့ၩၥိၫ့ထၪ့ခွံၬဝ့ၫဒၪလီၫ.",
			"17": "<sup>17</sup> အဝ့ၫဒၪစဲၪ့ထၪ့ယိၭအထုၪ့စူၪယၫထီၩ့လၧအလး ဆၧကိၭဝ့ၫအမံၩ့လၧဆၧခိၪဎွံၪလဲၫ, လၧၦဟံဘြႃၫ",
			"18": "<sup>18</sup> အဆၧချဲၩ့ကိၭဝ့ၫလၧဂီၫလဂိၥၫလီၫ.- အဝ့ၫၥံၪဖျၩထၪ့ ဝ့ၫလၧထုၪ့စူၪယၫအလီၩ့ထီးနီၪ, ဒဲၦဂူၫဂၩနံၫဂၩလၧ အၥိၭ,လၧလခီၫလဂၩ, ဒဲလၧလခီၫဒၪလဂၩတၭ, ယ့ၫ",
			"19": "<sup>19</sup> ၡုၬအီၪဝ့ၫလၧအဘိၩ့ဆၧၩ့နီၪလီၫ.- စပဲလၭကွ့ၭလံၬ ဒုၭနဲၪဆၧနီၪအီၪက့ၪထၪ့ဝ့ၫလၧထုၪ့စူၪယၫအလီၩ့ လီၫ.ဆၧအီၪကွ့ၭအၥၭနီၪ, ၦယုဒၫဖိၪၥံၪအစဎွၩၦနၭဇရ့ၭဖိၪယ့ၫၡုၬ နီၪလီၫ.",
			"20": "<sup>20</sup> မၩအၥၭဘဲၫနီၪတၭ, လံၬဒုၭနဲၪဆၧနီၪ ၦယုဒၫဖိၪ ၥံၪဖီဘၪဝ့ၫအၪဂၩလီၫ. အဂဲးဘဲၫယီၩအလးထီးယ့ၫ ၡုၬဘၪဆၧဖျၩထၪ့ဝ့ၫ လၧထုၪ့စူၪယၫအလီၩ့နီၪ အီၪ ဘူၭလၧဒိၩ့နီၪလီၫ. ဆၧအီၪကွ့ၭအၥၭနီၪ မွဲလၧဟံ ဘြႃၫအလၨ,ဒဲဂြံစၭအလၨ, ဒဲလၧၦရိမၫအလၨဆ့",
			"21": "<sup>21</sup> လီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ၦယုဒၫဖိၪအၡၩလုဆၧအ ဒိၪလဖၪနီၪစံၭစပဲလၭ, ကွ့ၭလၧၦယုဒၫဖိၪၥံၪအစဎွၩ လဂ့ၩ,အ့ၪမွဲလၧအစံၭလၩ့အၥၭ, ယမွဲၦယုဒၫဖိၪၥံၪ",
			"22": "<sup>22</sup> အစဎွၩဘီၪ.- တၭစပဲလၭစံၭဆၧၫ့ဝ့ၫ, ဆၧလၧယကွ့ၭ ဝ့ၫနီၪ,ယကွ့ၭဂီၩ့ယူၭ.",
			"23": "<sup>23</sup> မၩအၥၭဘဲၫနီၪတၭ, ထီးၦၥုၭဖိၪလဖၪဖျၩထၪ့ယ့ၫ ၡုၬလၧထုၪ့စူၪယၫအလီၩ့ဂီၩ့နီၪ, အၪ့မၩန့ဝ့ၫအကီၩ့ အၥိၭတၭ, အၪ့နၩ့ဖၭဝ့ၫလံပိၩ့တၭ, အၪ့နၩ့လိၬအၥၭ ဂၩပိၩ့ဂၩပိၩ့ဂီၩ့, အ့ၪမွဲဆဲၫ့နီၪဆၧထၭဝ့ၫဂီၩ့ လၧခံၫ",
			"24": "<sup>24</sup> လၧထံၭထၧၫ့ဘံၪ့ယၫတၭ,အထီၩ့အီၪအ့ၬ.- မၩအ ၥၭဘဲၫနီၪတၭ, အဝ့ၫၥံၪစံၭလိၬအၥၭ, ထီးမၩယၬအ ယီၩလဂ့ၩ. မွဲပမိဖၭလိၬပၥၭ လၧအဂးဘီၪ. ဘဲၫၥိၭ ဆၧကွ့ၭအၥၭမိလၧၫ့ထၪ့ဎွ့ၩထၪ့လၧအစံၭဝ့ၫ, အဝ့ၫၥံၪအၪ့နၩ့ဖၭယကီၩ့ယၥိၭလၧအကျၩ, ဒဲဖၭဝ့ၫလၧယဆဲၫ့အဂးလီၫ. မၩအၥၭဘဲၫနီၪတၭ, ဆၧလဖၪနီၪ ၦၥုၭဖိၪၥံၪမၩဝ့ၫ လီၫ.",
			"25": "<sup>25</sup> တၭအမိဒဲအမိအထၧၫ့ဖုဝဲမုၪ, စကျံအိၫဖၭအမၫ နးမၫရံၫ,ဒဲၦမၭဂဒၫလံနံၫဖိၪ, နးမၫရံၫၥံၪဆၧၫ့ထုၪ့ဝ့ၫ",
			"26": "<sup>26</sup> လၧယ့ၫၡုၬအထုၪ့စူၪယၫအနဲၩ့ထံၭနီၪ လီၫ.- မၩအ ၥၭဘဲၫနီၪတၭ, ယ့ၫၡုၬဒၪဘၪအမိဒဲ အဖျဲလၧအအဲၪဝ့ၫ လဂၩဆၧၫ့ထုၪ့လၧအနဲၩ့ထံၭတၭ, စံၭအမိနီၪ,ၦ",
			"27": "<sup>27</sup> မုၪဧ့,ယိခွါ,နဖိၪခွၫဘီၪ.- ထီးနီၪလဖၧၫ့စံၭအဖျဲလဂၩ နီၪ,ယိခွါ,နမိဘီၪ.ခီၫလၧနၩရံၫနီၪအလးခဲၫ့တၭ, အ ဖျဲလဂၩနီၪထဲၩ့န့ၦမုၪနီၪလၧအလးဒၪဝ့ၫလီၫ.",
			"28": "<sup>28</sup> လၧဆၧနီၪအလးခဲၫ့တၭ, ယ့ၫၡုၬၥ့ၪယၫလၧဆၧ ထီးအလူၬ ဂီၩ့ယူၭ, ဘဲၫၥိၭဆၧကွ့ၭအၥၭမိလၧၫ့ထၪ့ ဎွ့ၩထၪ့ဝ့ၫတၭ, စံၭဝ့ၫဒၪ,ဆၧၥၭဝံယၥၭလၧထံၫ",
			"29": "<sup>29</sup> လီၫ.- ဖၧၩ့လၧအအီၪဎွ့ၩဝ့ၫ လၧဆၧဆဲၪ့ထံၫအီၪဝ့ၫ ထီးနီၪလဖျိၪ့တၭ, ၦလဖၪနီၪစုၪစီၪလၩ့ဎၧၩ့မၫဆမံၭ လလီၪ့လၧဆၧဆဲၪ့ထံၫနီၪ, ထၫ့ထၪ့ဝ့ၫလၧဟံစိၭလ ဘီၩ့အခံၫထိၭဂီၩ့တၭ, ယူၬထၪ့ဝ့ၫလၧအနိၭထံၭလီၫ.",
			"30": "<sup>30</sup> မၩအၥၭဘဲၫနီၪတၭ, ထီးယ့ၫၡုၬဒိၭန့ဆၧဆဲၪ့ထံၫနီၪ, စံၭဝ့ၫဒၪ,ဆၧဂီၩ့ယူၭးဖျၭလၩ့အခိၪတၭ, ဒုၭစဲၪ့ ထၪ့ခွံၬအၥၭလီၫ.",
			"31": "<sup>31</sup> မၩအၥၭဘဲၫနီၪတၭ, ဘဲၫၥိၭအစွၪထီးအီၪလၧထုၪ့ စူၪယၫအလီၩ့လၧမးၥံၫအနံၩလဂ့ၩ, (အဂဲးဘဲၫယီၩ ဆၧလၧမးၥံၫအနံၩလနံၩနီၪ, မွဲမုနံၩအဒိၪ) တၭ,မွဲမု တဲၩ့ဝဲၩဆၧအနံၩအကၠီၩ့နီၪ, ၦယုဒၫဖိၪၥံၪအၪ့ကံၩ့ စပဲလၭဘဲၫၥိၭဆၧမိမၩခါအခၪ့တၭ, လ့ၩဆိၬခွံၬဝ့ၫ",
			"32": "<sup>32</sup> ဒၪလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, ၦၥုၭဖိၪၥံၪလ့ၩမၩခါ ၦလၧအခၪ့ထံၭလဂၩအခၪ့ ဒဲအဝ့ၫလဂၩလၧအဘၪ ဆၧဖျၩထၪ့ဝ့ၫ လၧထုၪ့စူၪယၫအလီၩ့ လၧအၥိၭနီၪ",
			"33": "<sup>33</sup> လီၫ.- အ့ၪမွဲထီးအထီၩ့လၧယ့ၫၡုၬအအီၪနီၪ, ဒၪဘၪ",
			"34": "<sup>34</sup> ဝ့ၫလၧအၥံၫယူၭတၭ, မၩခါလၧၩ့ဝ့ၫအခၪ့အ့ၬ.- မွဲလါ နၫ့ဘိၩၦၥုၭဖိၪလဂၩဆ့ၭထၪ့ယ့ၫၡုၬ အဂုၬဖၩလၧဖၩ့ တၭ,အၥွံၪဒဲအထံၫယွၩလၩ့ဝ့ၫချဲၫ့မၬလီၫ.",
			"35": "<sup>35</sup> ဆၧနီၪလဖၪၦလၧအဒၪဘၪဝ့ၫနီၪထိးအၥၭတၭ, အဝ့ၫဒၪအဆၧထိးအၥၭနီၪမွဲအတီၩတၭ, ၥ့ၪယၫဝ့ၫ လၧအချဲၩ့ဆၧတီၩတီၩ ဘဲၫၥိၭနၥံၪမိနဲၩဆၧလီၫ.",
			"36": "<sup>36</sup> အဂဲးဘဲၫယီၩ ဆၧနီၪလဖၪ မၩအၥၭဘဲၫၥိၭ ဆၧကွ့ၭအ ၥၭမိလၧၫ့ထၪ့ဎွ့ၩထၪ့ဝ့ၫလၧအစံၭ, အဝ့ၫဒၪနီၪ",
			"37": "<sup>37</sup> အဎွံၪခါဝ့ၫနးဘီၩ့အ့ၬ.- ဆၧကွ့ၭအၥၭလၧ အဂူၫဂၩ, စံၭဝ့ၫဒၪ,အ ဝ့ၫ ၥံၪ နီၪ မိ ယိ ဘၪ ၦ လၧ အဆ့ၭဝ့ၫလဂၩ နီၪ လီၫ.",
			"38": "<sup>38</sup> လၧဆၧနီၪလဖၪအလးခဲၫ့တၭ, ၦအရမၥံအၫဖိၪ စယိၥၭလဂၩနီၪအၪ့ကံၩ့စပဲလၭလၧအမိဆိၬလၩ့ယ့ၫ ၡုၬအစွၪနီၪလီၫ. (အဝ့ၫနီၪမွဲယ့ၫၡုၬအဖျဲနီၪ, မွဲလါ နၫ့ဘိၩၥၭမဲၪၦယုဒၫဖိၪတၭ, အီၪၥူၪဝ့ၫလီၫ.) စပဲ လၭဖ့ၪလၫ့အဝ့ၫဒၪလီၫ. မၩအၥၭဘဲၫနီၪတၭ, အဝ့ၫ ဒၪလ့ၩမၩန့ယ့ၫၡုၬအစွၪလီၫ.",
			"39": "<sup>39</sup> စနံၭကဒံမၧၭလၧအဂဲၫလၧယ့ၫၡုၬအအီၪ လၧမု နၩလခီၫလဂၩနီၪ, ဂဲၫဆိၬဆၧနၧၫ့မၧၫ့မူၫရၫ့လၧအလဲၩ ဎုၬဝ့ၫလၧအကၠီၫတၭ, ခံၫ့ဝ့ၫၥၧၫ့မၧၫ့ကၪယူၭလီၫ.",
			"40": "<sup>40</sup> မၩအၥၭဘဲၫနီၪတၭ, အဝ့ၫနီၪမၩန့ယ့ၫၡုၬအစွၪတၭ, ဘီၪ့ထၬဝ့ၫလၧဆၧဘွၩဖျ့ၫလံၬကံၭ, ဒဲဆၧနၧၫ့မၧၫ့ လဖၪနီၪ,ဘဲၫၦယုဒၫဖိၪၥံၪခုၪ့လၩ့ဘၧၩ့ခွံၬဆၧအထူၫ အရူၫအီၪဝ့ၫအၥိၭနီၪလီၫ.",
			"41": "<sup>41</sup> ထီးအလးလၧယ့ၫၡုၬဘၪဆၧဖျၩထၪ့ဝ့ၫလၧထုၪ့ စူၪယၫအလီၩ့နီၪကျိၭအီၪဝ့ၫလစီၪ့တၭ, လၧကျိၭဖၧၩ့ နီၪဆၧၥွၪခိၪအၥၫ့ လၧၦလအီၪက့ၪဒံၭဘၪ ၦၡၩအစွၪ",
			"42": "<sup>42</sup> လၧအဖၧၩ့နးဂၩနီၪအီၪဝ့ၫလစီၪ့လီၫ.- မၩအၥၭဘဲၫ နီၪတၭ,မွဲအဘၪၦယုဒၫဖိၪၥံၪ တဲၩ့ဝဲၩဆၧအနံၩနီၪ, ဆၧၥွၪခိၪအီၪဘူၭဝ့ၫအကၠီၩ့တၭ, အဝ့ၫၥံၪအီၪက့ၪလၩ့ ယ့ၫၡုၬထီးနီၪလီၫ."
		},
		"20": {
			"1": "<sup>1</sup> လၧမုနွ့ၫနံၩအထးဖၧၩ့မုခၪ့ထံၭအနံၩဂီၩဂီၩလ့ၬ လၧဆၧခံၭဒံၭအဘိၩ့ဘၭနီၪ, နးမၫရံၫမၭဂဒၫလံနံၫ လ့ၩထီၩ့ဝ့ၫလၧဆၧၥွၪခိၪအအီၪနီၪ ဒၪဘၪလိးအီၪလၧ ဆၧၥွၪခိၪအဖၧၩ့ခိၪထိၭနီၪ ချံးခွံၬယူၭအၥၭယူၭလီၫ.",
			"2": "<sup>2</sup> မၩအၥၭဘဲၫနီၪတၭ, ထဲၩ့စဲၪ့တလဲးဝ့ၫထီၩ့လၧစစဲမၧၫ့ ပံတၧၫဒဲအဖျဲဂူၫဂၩလၧယ့ၫၡုၬအဲၪဝ့ၫလဂၩအအီၪ နီၪ,စံၭအဝ့ၫၥံၪ,ၦလဖၪလ့ၩဆိၬခွံၬယူၭ ကဆါလၧဆၧ ၥွၪခိၪအဖၧၩ့ယူၭတၭ, မွဲအအီၪက့ၪဝ့ၫ ခီၫခီၫလဲၪနီၪ ပၥ့ၪယၫအ့ၬ.",
			"3": "<sup>3</sup> မၩအၥၭဘဲၫနီၪတၭ, စပံတၧၫဒဲအဖျဲဂူၫဂၩလဂၩ နီၪ,စဲၪ့ထၪ့ဝ့ၫတၭလ့ၩဝ့ၫထီၩ့လၧဆၧၥွၪခိၪ အအီၪနီၪ",
			"4": "<sup>4</sup> လီၫ.- ၦနံၫဂၩစဲၪ့တလဲးဎုၬဝ့ၫနီၪ, အဖျဲဂူၫဂၩလဂၩစဲၪ့ ဖီၩ့ခွံၬစပံတၧၫတၭ, ထီၩ့ဆိၫဝ့ၫလၧဆၧၥွၪခိၪအအီၪ",
			"5": "<sup>5</sup> လီၫ.- မွဲအယိဆူၭလၩ့ဝ့ၫတၭ,ဒၪဘၪဆၧဘွၩအီၪက့ၪ",
			"6": "<sup>6</sup> လၩ့အၥၭလါနၫ့ဘိၩလ့ၩနုၬဝ့ၫအ့ၬ.- မၩအၥၭဘဲၫ နီၪတၭ,စပံတၧၫဂဲၫထီၩ့ဝ့ၫလၧအလးခဲၫ့တၭ, လ့ၩနုၬ ဝ့ၫလၧဆၧၥွၪခိၪအဖၧၩ့နီၪ, ဒၪဘၪဆၧဘွၩအီၪက့ၪ",
			"7": "<sup>7</sup> လၩ့အၥၭ,- ဒဲပဝၫလၧအဘီၪ့ထၪ့အခိၪဎွံၪအီၪစီၪ့ ဎးလၧဆၧဘွၩနီၪအ့ၬ. အီၪထူၫထၪ့ဒၪအၥၭ လၧအ",
			"8": "<sup>8</sup> လးလစီၪ့ဒၪလီၫ.- မၩအၥၭဘဲၫနီၪတၭ, အဖျဲဂူၫဂၩလ ဂၩ, လၧအလ့ၩထီၩ့ဆိၫဝ့ၫ လၧဆၧၥွၪခိၪနီၪလ့ၩနုၬ",
			"9": "<sup>9</sup> ဝ့ၫဆ့တၭ, ဒၪဘၪဆၧနီၪနဲၩဝ့ၫလီၫ.- အဂဲးဘဲၫယီၩ ဆၧကွ့ၭအၥၭလၧအဘၪဂဲထုၪ့ထဲၩ့ဝ့ၫ လၧဆၧၥံၫနီၪ",
			"10": "<sup>10</sup> အဝ့ၫၥံၪနၪဝ့ၫၥ့ၪဒံၭအ့ၬ.- မၩအၥၭဘဲၫနီၪတၭ, အ ထံၩအဖျဲၥံၪထဲၩ့ထဲၩ့ဒီၭဝ့ၫလၧ အထံၩအၥိၭအအီၪ နီၪလီၫ.",
			"11": "<sup>11</sup> အ့ၪမွဲနးမၫရံၫနီၪဂၪ့ဆၧၫ့ထုၪ့ဝ့ၫလၧခီၫ့လၧဆၧၥွၪ ခိၪဖၧၩ့အနဲၩ့ထံၭလီၫ. မၩအၥၭဘဲၫနီၪတၭ, ဂၪ့ဝ့ၫ အဘိၩ့ဘၭနီၪ, ၡီၫ့လၩ့အၥၭတၭယိနုၬဝ့ၫလၧဆၧၥွၪ",
			"12": "<sup>12</sup> ခိၪအဖၧၩ့,- ဒၪဘၪအၥီၫ့နံၫဂၩကီၩ့ၥိၭဝ့ၫ လၧအကီၩ့ အၥိၭဘွၩ, ဆၧၫ့နၩ့ဝ့ၫထီးလၧယ့ၫၡုၬအစွၪ အီၪက့ၪ လၩ့အၥၭအလးနီၪ လၧအခိၪလဂၩလၧအခၪ့လဂၩ",
			"13": "<sup>13</sup> နီၪလီၫ.- အဝ့ၫၥံၪစံၭအဝ့ၫနီၪ, ၦမုၪဧ့,နဂၪ့နီၪမွဲအဘၪ ဆၧနီၪလဲၪ. အဝ့ၫဒၪစံၭဆၧၫ့အဝ့ၫၥံၪ, အဂဲးဘဲၫယီၩ ၦလဖၪဆိၬခွံၬယကဆါတၭ, အီၪက့ၪလၩ့ဝ့ၫခီၫခီၫ လဲၪနီၪယၥ့ၪယၫအ့ၬ.",
			"14": "<sup>14</sup> ၦမုၪနီၪစံၭဝ့ၫဂီၩ့, ကၠၪထဲၩ့အၥၭလၧအလးခဲၫ့တၭ, ဒၪဘၪလါနၫ့ယ့ၫၡုၬဆၧၫ့ထုၪ့ဝ့ၫတၭ, ၥ့ၪယၫဝ့ၫလၧ",
			"15": "<sup>15</sup> အမွဲယ့ၫၡုၬနီၪအ့ၬ.- ယ့ၫၡုၬစံၭဝ့ၫ, ၦမုၪဧ့,နဂၪ့နီၪမွဲ ဘၪဆၧနီၪလဲၪ. မွဲနအၪ့ဎၬပလၫလဂၩလဲၪ. ၦမုၪနီၪ ဆီၫ့မီၪ့လၧအဝ့ၫဒၪမွဲၦခိၭကျိၭတၭ, စံၭအဝ့ၫ,ကဆါ ဧ့,နအ့ၪလ့ၩဆိၬခွံၬအဝ့ၫလဂၩတၭ, မွဲနအီၪက့ၪဝ့ၫ ခီၫခီၫလဲၪနီၪ, လီၩဘၪယၧၩဆံၭ. တၭယမိလ့ၩမၩန့",
			"16": "<sup>16</sup> အဝ့ၫဒၪလီၫ.- ယ့ၫၡုၬစံၭအဝ့ၫ, နးမၫရံၫဧ့,တၭ နးမၫရံၫကၠၪထဲၩ့အၥၭနီၪ, စံၭအဝ့ၫဒၪလၧဟံဘြႃၫ အလၨ,ရၫဘိနံၫဧ့, (ဘဲၫပစံၭဆၧအၥိၭ, ဆရၫဧ့ၬ)",
			"17": "<sup>17</sup> ယ့ၫၡုၬစံၭအဝ့ၫ, ထိၭဘၪယၧၩလဂ့ၩ,ယထဲၩ့ထၪ့ ဒံၭလၧယဖါအအီၪဒံၭအ့ၬ. ထဲၩ့လၧယထၧၫ့ဖုဝဲၥံၪအ အီၪတၭ, စံၭအဝ့ၫၥံၪ, လၧယထဲၩ့ထၪ့လၧယဖါ, ဒဲလၧနၥံၪအဖါအအီၪ,လၧယယွၩ, ဒဲနၥံၪအယွၩ အအီၪနီၪဆံၭ.",
			"18": "<sup>18</sup> နးမၫရံၫမၭဂဒၫလံနံၫ နီၪထဲၩ့လီၩဘၪအထံၩအဖျဲ ၥံၪလၧအဒၪဘၪကဆါနီၪ ဒဲလၧအလီၩဘၪအဝ့ၫ လၧဆၧနီၪလဖၪလီၫ.",
			"19": "<sup>19</sup> မၩအၥၭဘဲၫနီၪတၭ, လၧမုနွ့ၫနံၩအထးဖၧၩ့မုခၪ့ ထံၭအနံၩနီၪဘၪလၧမုဂၪလၩ့တၭ, အထံၩအဖျဲၥံၪ ၥၭမဲၪၦယုဒၫဖိၪအကၠီၩ့နီၪ, အီၪကိၩ့အီၪကီၪ့ကၭဘံၭ ထၬတရၫ့ဂီၩ့ယူၭတၭ, ယ့ၫၡုၬဂဲၫဆၧၫ့ထုၪ့လၧအၥၭ ကျၩတၭ,စံၭအဝ့ၫၥံၪ, မွဲဆၧအမုၬအီၪလၧနၥံၪအလီၩ့ ဆံၭ.",
			"20": "<sup>20</sup> စံၭဆၧနီၪတၭဒုၭနဲၪအဝ့ၫၥံၪလၧအစူၪယၫၥၭဒဲအ ဂုၬဖၩလီၫ.မၩအၥၭဘဲၫနီၪတၭ, အထံၩအဖျဲၥံၪဒၪ ဘၪအကဆါနီၪအၥုၪ့ထိၬအၥၭထိၬထၪ့ဝ့ၫဒၪလီၫ.",
			"21": "<sup>21</sup> မၩအၥၭဘဲၫနီၪတၭ, ယ့ၫၡုၬစံၭဒီၭအဝ့ၫၥံၪ, မွဲဆၧအ မုၬအီၪလၧနၥံၪအလီၩ့ဆံၭ. ဘဲၫယဖါအၪ့မၧၫ့လၩ့ န့ယၧၩအၥိၭနီၪ, ယမိအၪ့မၧၫ့လၩ့န့နၥံၪဘဲၫနီၪအၥိၭ ဆ့လီၫ.",
			"22": "<sup>22</sup> အဝ့ၫဒၪစံၭဆၧလဖၪနီၪဂီၩ့တၭ, ၥၪၡိၪလၧအဝ့ၫၥံၪ အလီၩ့တၭ, စံၭဝ့ၫဒၪ, ဒိၭန့နၥံၪဝ့ၫၥၭမုဆံၫ့ဎံၪနီၪ",
			"23": "<sup>23</sup> ဆံၭ.- ထီးဒၪၦၡၩအဆၧမၪ လၧနၥံၪကွဲၪဖျါခွံၬဝ့ၫ လဖၪနီၪမိဘၪကွဲၪဖျါခွံၬ အၥၭလီၫ. ထီးဒၪၦၡၩအ ဆၧမၪလၧနၥံၪဖီၪ့ထၬလဖၪနီၪ မိဘၪဖီၪ့ထၬအၥၭဆ့လီၫ.",
			"24": "<sup>24</sup> လၧယ့ၫၡုၬဂဲၫဝ့ၫနီၪ ၦအီၪလၧလဆံၫနံၫဂၩအကျၩ, စထီမၭ(ကိၭဝ့ၫလၧစဒံၭဒမၧၭ) လဂၩအီၪလၧအ",
			"25": "<sup>25</sup> ဝ့ၫၥံၪအၥိၭအ့ၬ.- မၩအၥၭဘဲၫနီၪတၭ,အထံၩအဖျဲဂူၫ ဂၩလဖၪစံၭအဝ့ၫနီၪ, ပဝ့ၫဒၪယီၩပဒၪဘၪယူၭကဆါ ယူၭ.အ့ၪမွဲအဝ့ၫဒၪစံၭအဝ့ၫၥံၪ,ယအ့ၪလဒၪဘၪ ထၭအလးလၧအစူၪယၫၥၭအဖၧၩ့, ယအ့ၪလအီၩ့ဘၪ အဖၧၩ့လးနီၪလၧယစူၪနိၩ့တၭ ယအ့ၪလဘူၭဘၪအ ဂုၬဖၩအဖၧၩ့လးလၧယစူၪနီၪ ယနဲၩယဝ့ၫအ့ၬ.",
			"26": "<sup>26</sup> အယီၩအလးခဲၫ့ ဎိၭၥၫ့နီၪ, အထံၩအဖျဲၥံၪ အီၪဒီၭ လၧအဖၧၩ့နီၪ, စထီမၭအီၪလၧအကျၩလီၫ. တရၫ့ၥံၪ ကၭဘံၭထၬအၥၭဂီၩ့ယူၭတၭ, ယ့ၫၡုၬဂဲၫဆၧၫ့ထုၪ့ လၧအကျၩနီၪ, စံၭဝ့ၫဒၪ, မွဲဆၧအမုၬအီၪလၧနၥံၪ",
			"27": "<sup>27</sup> အလီၩ့ဆံၭ.- ထီးနီၪလဖၧၫ့စံၭစထီမၭ, ယူၬစိၩနစူၪ နိၩ့ထီးယီၩယိယစူၪယၫၥၭယီၩတၭ, ယူၬစိၩနစူၪ ထီးယီၩတၭဘူၭယိခွါယဂုၬဖၩ အဖၧၩ့လးယီၩဆံၭ. ၥၭနီၪမွဲအထီးဂံၩ့ဂၩ့လဂ့ၩ, နဲၩဆၧဆံၭ.",
			"28": "<sup>28</sup> စထီမၭချဲၩ့ဆၧၫ့ဆၧတၭ, စံၭအဝ့ၫ, ယကဆါ,ဒဲ",
			"29": "<sup>29</sup> ယယွၩမၬကၨ.- ယ့ၫၡုၬစံၭအဝ့ၫ, မွဲနဒၪဘၪယၧၩအ ကၠီၩ့တၭနနဲၩနဝ့ၫ, ၦလၧအလဒၪဘၪဝ့ၫလါနၫ့ဘိၩနဲၩ ဝ့ၫလဖၪဘၪဆိၪဂ့ၩဝ့ၫဒၪလီၫ.",
			"30": "<sup>30</sup> ဆၧလၩ့လၭလၧအဂူၫဂၩလၧအလကွ့ၭဘၪအၥၭ လၧလံၬယီၩအဖၧၩ့, ယ့ၫၡုၬမၩဝ့ၫလၧအထံၩအဖျဲၥံၪ",
			"31": "<sup>31</sup> အမ့ၬယၫအၪမံၩ့လီၫ.- ဘဲၫၥိၭနၥံၪမိနဲၩလၧ ယ့ၫၡုၬ မွဲဎရံၬ,ယွၩအဖိၪခွၫနီၪ, နၥံၪနဲၩဆၧအကၠီၩ့တၭ, နၥံၪ မိန့ဘၪဆၧမၧၫ့ လၧယမံၩ့အဖၧၩ့နီၪ, ဆၧလဖၪယီၩ ဘၪဆၧကွ့ၭအၥၭလီၫ."
		},
		"21": {
			"1": "<sup>1</sup> လၧဆၧနီၪလဖၪအလးခဲၫ့တၭ, ယ့ၫၡုၬဒုၭနဲၪဒီၭအ ၥၭလၧအထံၩအဖျဲၥံၪအမ့ၬယၫ လၧကွံၩတဘံရအၭ",
			"2": "<sup>2</sup> အနဲၩ့ထံၭနီၪလီၫ. ဒုၭနဲၪအၥၭဘဲၫယီၩ,- စစဲမၧၫ့ပံ တၧၫ,ဒဲစထီမၭလၧအကိၭဝ့ၫစဒံဒမၧၭ, ဒဲၦကၫနအၫ့ဖိၪ ဘၪဆဲၫ့လၧဂၫလလံၫ, စနၥၫ့နအ့လၭ,ဒဲစဇ့ၭဘဒံၫ အဖိၪခွၫလဖၪ, ဒဲအထံၩအဖျဲၥံၪလၧအဂူၫဂၩနံၫဂၩၥံၪ အီၪဝ့ၫလစီၪ့ဎးလီၫ.",
			"3": "<sup>3</sup> စစဲမၧၫ့ပံတၧၫစံၭအဝ့ၫၥံၪ, ယဝ့ၫဒၪယီၩယမိလ့ၩ မၩအၪ့ယၪလီၫ. အဝ့ၫၥံၪစံၭဝ့ၫ, ပမိလ့ၩလၧနၥိၭဆ့ လီၫ.အဝ့ၫၥံၪစဲၪ့ထၪ့ဝ့ၫနီၪ လ့ၩနုၬလၧချံၫဖၧၩ့ချဲၫ့မၬ တၭ,မုလနၩနီၪမၩဆၧန့နးမံၩ့အ့ၬ.",
			"4": "<sup>4</sup> မုဆဲၪ့ထၪ့တၭယ့ၫၡုၬဆၧၫ့ထုၪ့လၧထံၫအနဲၩ့ထံၭ လီၫ.မွဲလါနၫ့ဘိၩအထံၩအဖျဲၥံၪၥ့ၪယၫလၧအမွဲယ့ၫ",
			"5": "<sup>5</sup> ၡုၬနီၪအ့ၬ.- မၩအၥၭဘဲၫနီၪတၭ, ယ့ၫၡုၬစံၭအဝ့ၫ ၥံၪ,ဖိၪၥံၪလံၩၥံၪဧ့, မွဲနၥံၪအဆၧအၪ့အီၪလမံၩ့မံၩ့ဆ့",
			"6": "<sup>6</sup> ဧၪ.အဝ့ၫၥံၪစံၭဆၧၫ့ဝ့ၫအီၪအ့ၬ.- မွဲအစံၭအဝ့ၫၥံၪ, ခွံၬလၩ့နၥံၪအၡၬလၧချံၫအစူၪထွ့ၪလခီၫတၭ, နၥံၪ မိဒၪဘၪဆၧလီၫ. မၩအၥၭဘဲၫနီၪတၭ, အဝ့ၫၥံၪခွံၬ လၩ့ဝ့ၫတၭ,ဘၪယၪအၪအၪလ့ၬအကၠီၩ့နီၪ, ကၠူၭဝ့ၫန့ အ့ၬ.",
			"7": "<sup>7</sup> မၩအၥၭဘဲၫနီၪတၭ, အထံၩအဖျဲၥံၪလၧယ့ၫၡုၬအဲၪ ဝ့ၫလဂၩနီၪ, စံၭစပံတၧၫ, မွဲကဆါနီၪလီၫ. စပံတၧၫ နါဂၧၫ့လၧအမွဲကဆါနီၪ လၧအအီၪဘိၪ့အကၠီၩ့တၭ, ၥိၭထၪ့ထဲၩ့အဆဲၫ့ဂီၩ့တၭ, ဖုၫလၩ့ဝ့ၫလၧမၫဆမံၭအ",
			"8": "<sup>8</sup> ဖၧၩ့လီၫ.- အ့ၪမွဲအထံၩအဖျဲဂူၫဂၩၥံၪအီၪလယဲၩ့ဘၪ လၧခီၫ့တၭ ဂဲၫဝ့ၫလၧချံၫလဖျိၪ့အဖၧၩ့တၭ, ကၠူၭၡၬ အီၪဝ့ၫလၧယၪလဖၪလၧအဖၧၩ့လီၫ.",
			"9": "<sup>9</sup> မၩအၥၭဘဲၫနီၪတၭ, ထီးအထီၩ့လၧခီၫ့နီၪအဝ့ၫၥံၪ ဒၪဘၪမ့ၪအၧၩ့ဖၭအီၪဝဲၩထီးနီၪလပိၩ့, ဒဲယၪအီၪလၧ",
			"10": "<sup>10</sup> အဖၫ့ခိၪ,ဒဲကိၪဆ့လီၫ.- ယ့ၫၡုၬလီၩဘၪအဝ့ၫၥံၪ, ဂဲၫ",
			"11": "<sup>11</sup> ဆိၬယၪလၧနၥံၪမၩန့ဘိၩ့နဲၪ့ယီၩလနၩ့ဘီၪ.- စစဲမၧၫ့ ပံတၧၫထၪ့လၧချံၫဖၧၩ့တၭ ၡၬလၧအဎွ့ၩထၪ့လၧယၪ ဖၭဒိၪလယၩယဲဆံၫၥၧၫ့ဘံၪ့နီၪ ကၠူၭထၪ့ဝ့ၫလၧခီၫ့ လီၫ.မွဲအအၪဎွ့ၩနီၪလါနၫ့ဘိၩၡၬနီၪယၬဝ့ၫအ့ၬ.",
			"12": "<sup>12</sup> ယ့ၫၡုၬစံၭအဝ့ၫၥံၪ, ဂဲၫအၪ့ဆၧလၧဂီၩအၪ့ဘီၪ. အထံၩအဖျဲၥံၪၥ့ၪယၫလၧ အမွဲကဆါနီၪအၪ့စၪ့ဝ့ၫ,နဝ့ၫ",
			"13": "<sup>13</sup> ဒၪနမွဲပလၫလဂၩလဲၪနီၪဘုၪ့နးဂၩအ့ၬ.- ထီးနီၪလဖၧၫ့ ယ့ၫၡုၬဂဲၫဝ့ၫနီၪ, မၩန့ကိၪတၭ, ဖ့ၪလၫ့အဝ့ၫၥံၪ, ဒဲ",
			"14": "<sup>14</sup> ယၪဘဲၫနီၪၥိၭဆ့လီၫ.- ယ့ၫၡုၬဂဲထုၪ့ထဲၩ့ဝ့ၫ လၧဆၧ ၥံၫနီၪဒုၭနဲၪအၥၭလၧအထံၩအဖျဲၥံၪလဖၧၫ့ယီၩ, မွဲအ ဎွ့ၩထၪ့ၥၧၫ့ဖၧၫ့လဖၧၫ့လီၫ.",
			"15": "<sup>15</sup> မၩအၥၭဘဲၫနီၪတၭ, ထီးအအၪ့ဆၧလၧဂီၩအၪ့ဂီၩ့ တၭ,ယ့ၫၡုၬစံၭစစဲမၧၫ့ပံတၧၫ, စယိနၫအဖိၪခွၫ စစဲ မၧၫ့ဧ့,မွဲနအဲၪယၧၩအၪနဲၪ့အဝ့ၫၥံၪနီၪဆ့ဧၪ.အဝ့ၫ ဒၪစံၭဝ့ၫ,မွဲယူၭ, ကဆါဧ့,နၥ့ၪယၫလၧယအဲၪနၧၩလီၫ. အဝ့ၫဒၪစံၭအဝ့ၫ, လုအၪ့လုအီၩယၥိၪဖိၪၥံၪဆံၭ.",
			"16": "<sup>16</sup> စံၭဒီၭအဝ့ၫနံၫဖၧၫ့လဖၧၫ့, စယိနၫအဖိၪခွၫစစဲမၧၫ့ ဧ့,မွဲနအဲၪယၧၩဧၪ. အဝ့ၫဒၪစံၭဝ့ၫ, မွဲယူၭကဆါဧ့, နၥ့ၪယၫလၧယအဲၪနၧၩလီၫ. အဝ့ၫဒၪစံၭအဝ့ၫ,ယိထဲၩ့",
			"17": "<sup>17</sup> ခွါထဲၩ့ယၥိၪလဖၪဆံၭ.- စံၭအဝ့ၫဒၪ ၥၧၫ့ဖၧၫ့လ ဖၧၫ့,စယိနၫအဖိၪခွၫစစဲမၧၫ့ဧ့, မွဲနအဲၪယၧၩဧၪ. လၧ အစံၭဝ့ၫ,မွဲနအဲၪယၧၩဧၪနီၪ. ၥၧၫ့ဖၧၫ့လဖၧၫ့အကၠီၩ့ တၭ,စပံတၧၫ့အၥၭလမုၬဘၪတၭ, စံၭအဝ့ၫဒၪ, ကဆါဧ့,နၥ့ၪယၫဆၧထီးအလူၬနီၪ, နၥ့ၪယၫလၧယ အဲၪနၧၩလီၫ. တၭယ့ၫၡုၬစံၭအဝ့ၫ, လုအၪ့လုအီၩ ယၥိၪလဖၪဆံၭ.",
			"18": "<sup>18</sup> ယစံၭနၧၩတီၩတီၩလီၩ့လီၩ့လၧနၥၭဘၪ့ဒံၭအခၫ နီၪ,နခဲးထူၬထၪ့နၥၭဒၪနဝ့ၫတၭ, ထီးဒၪအဘၪနၥၭနီၪ နစဲၪ့နဝ့ၫဒၪလီၫ. အ့ၪမွဲထီးနၥၭ အ့ၪၡါထၪ့ခိၬနီၪ နမိ ယူၬထၪ့နစူၪတၭ, ၦဂူၫဂၩမိခဲးထူၬနၧၩတၭ, မိလ့ၩ ဆိၬနၧၩထီးဒၪအလး လၧနလမိလ့ၩဘၪနၥၭနီၪလီၫ.",
			"19": "<sup>19</sup> စံၭဆၧနီၪဒုၭနဲၪဝ့ၫ လၧစပံတၧၫမိဒုၭအီၪဖျီၪထၪ့ ယွၩအလၩအဖၩ့လၧအမိၥံၫဘဲၫအံၩဘဲၫအိၩအဂဲး နီၪလီၫ.စံၭဆၧနီၪဂီၩ့တၭ, စံၭအဝ့ၫဒၪ,ဖိၬယခဲၫ့ ဆံၭ.",
			"20": "<sup>20</sup> စပံတၧၫကၠၪထဲၩ့အၥၭတၭ, ဒၪဘၪအဖျဲလၧယ့ၫၡုၬ အဲၪဝ့ၫလဂၩဖိၬအခဲၫ့နီၪ, မွဲၦလၧအဆၧၫ့နၩ့ဒံၩ့ခံၫ့လၧ အၥၭနၫအလီၩ့လၧအအၪ့ဆၧအဘိၩ့ဘၭနီၪ ဒဲစံၭဝ့ၫ, ကဆါဧ့,ၦလၧအမိဖ့ၪလၫ့ခွံၬနၧၩလဂၩနီၪ,မွဲပလၫလ",
			"21": "<sup>21</sup> ဂၩလဲၪ.- စပံတၧၫဒၪဘၪအဝ့ၫနီၪတၭ, စံၭယ့ၫၡုၬ, ကဆါဧ့,အဝ့ၫလဂၩယီၩ မိမၩအၥၭဘဲၫၥ့ၪလဲၪ.",
			"22": "<sup>22</sup> ယ့ၫၡုၬစံၭအဝ့ၫ, ၦလဂၩယီၩအ့ၪဘၪယၥၭလၧ အအီၪထီးယအ့ၪဂဲၫထဲၩ့ခိၬနီၪ,မွဲအဘၪဆဲၫ့လၧ",
			"23": "<sup>23</sup> နၧၩဘဲၫၥ့ၪလဲၪ. နဝ့ၫဒၪယီၩဖိၬယခဲၫ့ဆံၭ.- မၩအ ၥၭဘဲၫနီၪတၭ, ဆၧဂၧၫ့ထၪ့ၥၩလၩ့လၧ ၦထၧၫ့ဖုဝဲအ ကျၩ,လၧအဖျဲလဂၩနီၪ မိၥံၫဘၪအ့ၬ. မွဲလါနၫ့ဘိၩ လၧအလမိၥံၫဘၪနီၪယ့ၫၡုၬစံၭအ့ၬ. စံၭဝ့ၫအဝ့ၫလ ဂၩယီၩအ့ၪဘၪယၥၭလၧအမိအီၪ ထီးယဂဲၫထဲၩ့ခိၬ နီၪ,မွဲအဘၪဆဲၫ့လၧနၧၩဘဲၫၥ့ၪလဲၪ.",
			"24": "<sup>24</sup> အဖျဲလဂၩနီၪမွဲၦလၧအထိးအၥၭ လၧဆၧယီၩ လဖၪအဂဲး, ဒဲကွ့ၭဆၧလဖၪယီၩလီၫ. တၭပၥ့ၪယၫ လၧအဆၧထိးအၥၭနီၪမွဲအတီၩလီၫ.",
			"25": "<sup>25</sup> ယ့ၫၡုၬမၩဆၧလၧအဂူၫဂၩ အီၪဝ့ၫအၪမံၩ့လီၫ. ကယဲဆၧလဖၪနီၪ အ့ၪဘၪဆၧကွ့ၭဝ့ၫလမံၩ့လစီၪ့ လမံၩ့လစီၪ့ ကိၭအမံၩ့ဒ့ၭတၭ,ယဆီၫ့မီၪ့လၧလံၬ ၥံၪလၧအဘၪဆၧကွ့ၭဝ့ၫလဖၪနီၪ ဂၪ့ခိၪယီၩမိထီဝါ အ့ၬ.ဎအၩမံၩ့.ၭ"
		}
	}
};
module.exports = book;